INSERT INTO `product` VALUES (3, '2023-12-20 09:06:07.720938', 'Áo sơ mi nam dành cho nam đi làm hay đi chơi\r\nThông tin bảo mật và mã hoá\r\nThiết kế mới, lá cổ mở rộng hơn về phía cầu vai, có ly gấp sau lưng. Khả năng khử mùi, kháng khuẩn và thấm hút mồ hôi tốt. Vải không nhăn với form áo đứng và giữ nếp giúp người mặc luôn diện những mẫu áo phẳng phiu.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/e61b3558-7afb-49e9-a867-037ebd9ac85a.jpg?alt=media', 'Kiểu dáng áo sơ mi nam dài tay nano\r\nÁo sơ mi Nano dài tay cổ đức là dòng sản phẩm mới nhất của yody. Từ chất liệu nano mới tới thiết kế mới với lá cổ mở rộng hơn về phía cầu vai, có ly gấp sau lưng và bọ tại chính giữa. Nẹp áo liền với thân cùng với chất liệu nano là 1 trong những chất liệu khách hàng Yody vô cùng yêu thích. Tất cả những điều trên đã tạo nên trang phục chỉnh chu và mới lạ hơn cho khách hàng và phù hợp với nhiều độ tuổi khác nhau.', 'Áo sơ mi nam', 0, 'LOCKED', '2024-07-15 11:04:45.963375', NULL, 53, 2);
