INSERT INTO `product` VALUES (20, '2024-03-16 18:26:20.009105', 'Điện thoại Samsung Galaxy A50 SM-A505FZBDXXV 4GB/64GB Xanh\r\nTận hưởng tất cả những công nghệ mới nhất trong tầm giá hấp dẫn, Samsung Galaxy A50 sở hữu cảm biến vân tay trong màn hình, 3 camera và nhiều hơn thế nữa.\r\n\r\n\r\n\r\nCảm biến vân tay ngay dưới màn hình, tương lai của công nghệ bảo mật\r\nThiết kế của Galaxy A50 trở nên liền lạc hơn khi cảm biến vân tay được tích hợp ngay trên màn hình. Phương thức bảo mật tưởng như chỉ có trong tương lai đã xuất hiện trên A50. Chỉ một lần chạm vào màn hình, điện thoại của bạn đã mở khóa ngay lập tức, vô cùng tiện lợi và an toàn.\r\n\r\n\r\n\r\nChụp ảnh chuyên nghiệp bằng 3 camera sau\r\nSamsung Galaxy A50 được trang bị tới 3 camera sau với 3 vai trò khác nhau, thể hiện rõ sự chuyên nghiệp trong nhiếp ảnh. Camera chính có độ phân giải 25MP khẩu độ lớn f/1.7 chụp đêm đẳng cấp; camera đo độ sâu 5MP và đặc biệt là camera góc siêu rộng 8MP. Dù là trong bất kỳ hoàn cảnh nào thì Galaxy A50 cũng đều mang đến những bức ảnh đẹp và khác biệt.\r\n\r\n\r\n\r\nNắm giữ khung cảnh như mắt người\r\nVới ống kính camera siêu rộng, Galaxy A50 có thể thu được cả thế giới rộng lớn vào trong khung hình. Ống kính này có góc rộng 123 độ, vượt xa so với các ống kính thông thường chỉ 77 độ. Những chuyến du lịch của bạn sẽ được lưu giữ bằng các hình ảnh thiên nhiên hùng vĩ đầy sống động. Camera Galaxy A50 còn nhận diện thông minh và gợi ý cho bạn những trường hợp nào nên chụp ảnh ở chế độ góc siêu rộng.\r\n\r\n\r\n\r\nChụp ảnh xóa phông nghệ thuật\r\nSự kết hợp giữa camera chính và camera đo độ sâu mang đến những bức ảnh xóa phông nghệ thuật. Bạn có thể tùy chỉnh độ mờ hậu cảnh dễ dàng và thêm vào các hiệu ứng ánh sáng sau khi chụp. Phía sau hình ảnh tỏa sáng của bạn có thể là những ngôi sao lấp lánh hay những bông tuyết lãng mạn trong hậu cảnh bị làm mờ, rất đẹp và độc đáo.\r\n\r\n\r\n\r\nCamera chinh phục bóng tối\r\nCamera chính 25MP khẩu độ cực lớn f/1.7 cho Samsung A50 khả năng chụp ảnh tuyệt đẹp dù là ngày nắng hay đêm tối. Chưa hết, tính năng tối ưu hóa cảnh sẽ tự động nhận diện cảnh bạn đang chụp để chỉnh sửa thông minh và mang đến bức hình chất lượng nhất. Có đến 20 chủ thể phổ biến được nhận diện và tinh chỉnh, để bạn dễ dàng chụp được những bức ảnh ấn tượng.\r\n\r\n\r\n\r\nMàn hình vô cực Infinity-U đẳng cấp\r\nHãy cùng trải nghiệm những điều thú vị nhất trên màn hình tuyệt đẹp kích thước lên tới 6,4 inch và công nghệ Infinity-U. Viền màn hình được thu hẹp đến mức tối đa để hình ảnh như nổi lên trước mắt đầy sống động qua chất lượng của màn hình Super AMOLED cao cấp. Chất lượng hiển thị từ màn hình độ phân giải cao Full HD+ chắc chắn sẽ làm bạn hài lòng.\r\n\r\n3 phiên bản màu thời trang và cá tính\r\n\r\n\r\nKhông cần phải đưa ra những màu sắc màu mè, cả 3 phiên bản màu của Galaxy A50 đều hết sức thanh lịch nhưng vẫn rất thời trang. Các phiên bản màu Đen thiên thạch, Xanh đại dương và Trắng ngọc trai cực kỳ phù hợp với thiết kế bóng bẩy của A50, cho bạn tự tin khoe cá tính riêng.\r\n\r\nHiệu năng ưu việt và bền bỉ\r\n\r\n\r\nSamsung Galaxy A50 có cấu hình đáng mơ ước với bộ vi xử lý Exynos 9610 8 nhân 64 bit, 4GB RAM và 64GB bộ nhớ trong. Chưa hết, viên pin dung lượng lên tới 4000 mAh và công nghệ sạc nhanh qua cổng USB Type-C tiên tiến cho bạn chiếc điện thoại hiệu năng hoàn hảo, luôn sẵn sàng mọi hoạt động vào bất cứ lúc nào.\r\n\r\n\r\n#A50_Den', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/ff50c7eb-c251-4582-bede-c4c660014a78.jpg?alt=media', '#	THUỘC TÍNH	GIÁ TRỊ\n1	Xuất xứ	Hàn Quốc\n2	Bảo hành	12 tháng\n3	Kích thước màn hình	6.4\"\n4	Công nghệ màn hình	Super AMOLED\n5	Độ phân giải	Full HD+ (1080 x 2340 Pixels)\n6	Mặt kính cảm ứng	Kính cường lực Corning Gorilla Glass 3\n7	Độ phân giải camera sau	Chính 25 MP & Phụ 8 MP, 5 MP\n8	Quay phim camera sau	Quay phim FullHD 1080p@30fps\n9	Chụp ảnh nâng cao Camera sau	Chụp ảnh xóa phông, Chế độ Slow Motion, Chế độ Time-Lapse, A.I Camera, Tự động lấy nét, Chạm lấy nét, Nhận diện khuôn mặt, HDR, Panorama, Làm đẹp (Beautify)\n10	Độ phân giải camera trước	25 MP\n11	Video Call	Hỗ trợ VideoCall thông qua ứng dụng\n12	Hệ điều hành	Android 9.0 (Pie)\n13	Chipset	Exynos 9610 8 nhân 64-bit\n14	Tốc độ CPU	2.3 GHz\n15	Chip đồ họa (GPU)	Mali-G72 MP3\n16	RAM	4GB\n17	Bộ nhớ trong (ROM)	64GB\n18	Thẻ nhớ ngoài	MicroSD\n19	Thẻ nhớ hỗ trợ tối đa	512 GB\n20	Mạng di động	3G, 4G LTE Cat 6\n21	Loại SIM	2 Nano SIM\n22	Wifi	Wi-Fi 802.11 a/b/g/n/ac, Dual-band, Wi-Fi Direct, Wi-Fi hotspot\n23	GPS	BDS, A-GPS, GLONASS\n24	Bluetooth	A2DP, LE, v5.0\n25	Cổng kết nối/sạc	USB Type-C\n26	Jack tai nghe	3.5 mm\n27	Kết nối khác	Không\n28	Thiết kế	Nguyên khối\n29	Chất liệu	Nhựa\n30	Kích thước	Dài 158.5 mm - Ngang 74.7 mm - Dày 7.7 mm\n31	Trọng lượng	166 g\n32	Loại pin	Pin chuẩn Li-Po\n33	Dung lượng pin	4000 mAh\n34	Công nghệ pin	Tiết kiệm pin, Siêu tiết kiệm pin, Sạc pin nhanh\n35	Bảo mật nâng cao	Mở khóa bằng khuôn mặt, Mở khoá vân tay dưới màn hình\n36	Tính năng đặc biệt	Màn hình luôn hiển thị AOD, Mặt kính 2.5D, Trợ lý ảo Samsung Bixby, Nhân bản ứng dụng, Chặn tin nhắn, Chặn cuộc gọi, Sạc pin nhanh, Đèn pin, Dolby Audio™\n37	Ghi âm	Có, microphone chuyên dụng chống ồn\n38	Xem phim	3GP, MP4, AVI, WMV\n39	Nghe nhạc	Midi, AMR, MP3, WAV, WMA, AAC, OGG, FLAC\n40	FM Radio	Có\n41	Màu sắc	Xanh\n42	Thời điểm ra mắt	03/2019\nLưu ý : Hình ảnh và thông số chỉ mang tính chất tham khảo, có thể bị thay đổi từ nhà sản xuất mà không báo trước. Quý khách vui lòng kiểm tra kỹ sản phẩm trước khi nhận hàng.', 'Điện thoại Samsung Galaxy A50 (Bản củ 1)', 137, 'ACTIVE', '2024-05-07 09:41:35.336400', 1, 16, 3);
INSERT INTO `product` VALUES (21, '2024-05-09 03:25:08.594200', 'Mua iPhone 15 Pro Max 512GB trả góp 0%: Thông tin cần biết trước khi mua\niPhone 15 Pro Max 512GB phiên bản 512GB luôn là một trong những phiên bản được nhiều người dùng ưa chuộng lựa chọn nhất. Vì phiên bản này có mức dung lượng lớn đủ để phục vụ đa dạng các nhu cầu sử dụng, lưu trữ hàng ngày lớn của người dùng và được trang bị đầy đủ những tính năng cao cấp nhất.\n\niPhone 15 Pro Max được nâng cấp gì so với iPhone 14 Pro Max?\nTrước tiên, hãy cùng nhau so sánh tổng quan 2 phiên bản cao cấp nhất của nhà Táo trong năm 2022 và năm 2023 để xem iPhone 15 Pro Max năm nay đã có những nâng cấp mới thú vị nào so với người đàn anh iPhone 14 Pro Max của mình nhé. \n\nCác tiêu chuẩn so sánh \n\niPhone 14 Pro Max \n\niPhone 15 Pro Max\n\nMàn hình\n\n6.7inch\n\n6.7inch\n\nĐộ phân giải trang bị\n\n1.290 x 2.796px\n\n1.290 x 2.796px\n\nCamera sau\n\n48MP|12MP|12MP\n\n48MP|12MP|12MP\n\nCamera selfie\n\n12MP\n\n12MP\n\nChipset trang bị \n\nApple A16 Bionic\n\nApple A17 Pro\n\nCập nhật hệ điều hành\n\niOS 16\n\niOS 17\n\nViên pin\n\n4.323 mAh\n\n4.422 mAh\n\nCông nghệ sạc nhanh\n\n27W\n\nĐang cập nhật\n\nKích thước tổng thể\n\n160.7 x 77.6 x 7.85 mm\n\n159.86 x 76.73 x 8.25 mm\n\nTrọng lượng máy\n\n240 gram\n\n221 gram\n\nCổng sạc\n\nLightning\n\nUSB-C\n\nKhung viền \n\nThép không ghỉ\n\n Titanium\n\nMàu sắc\n\nVàng, Tím, Xám, Bạc\n\nXám Titan, Đen Titan, Xanh Titan, Trắng Titan\n\niPhone 15 Pro Max 512GB giá bao nhiêu?\nĐiện thoại iPhone 15 Pro Max 512GB là phiên bản ở mức trung nằm giữa bản thấp nhất 256GB và 1TB. Đối với người dùng sử dụng các tác vụ thông thường thì bản 256GB là vừa đủ, nhưng nếu bạn làm những công việc thiên về chụp ảnh quay phim thì mức 256GB lại không đủ đáp ứng.\n\nNên bản 512GB là một lựa chọn vừa đủ nhất để phục vụ nhu cầu làm việc với nhiều tác vụ nặng hơn. Đồng thời phiên bản 512GB sẽ là lựa chọn hoàn hảo hơn về giá so với dòng 1TB. Nếu bạn không phải là người sử dụng quá nhiều tác vụ nặng, lưu trữ video, ảnh lớn thì bản 512GB đã đủ không cần phải nâng cấp lên mức 1TB với mức giá cao hơn\n\nPhiên bản iPhone 15 Pro Max 512GB khi được ra mắt tại thị trường Mỹ với mức giá 1.199 USD và giá bán tại Việt Nam lúc đó khoảng gần 40.000.000 VNĐ . Tham khảo bảng giá chi tiết mới nhất từng màu trên 15 Pro Max 512GB dưới đây. \n\nLưu ý: Giá các phiên bản màu iPhone 15 Pro Max 512GB được cập nhật trong bảng bên dưới được tham khảo theo giá ngày 3.2.2024. Sẽ có đôi chút thay đổi và cập nhật liên tục theo giá thị trường trong thời gian tới. \n\n \n\nCác phiên bản màu sắc tùy chọn của bản 256GB\n\nGiá bán tại Mỹ \n\nGiá bán hiện tại tại Việt Nam\n\niPhone 15 Pro Max bản 512GB màu Đen\n\n1.399 USD \n\n37.990.000 VNĐ\n\niPhone 15 Pro Max bản 512GB màu Trắng\n\n1.399 USD \n\n37.990.000 VNĐ\n\niPhone 15 Pro Max bản 512GB màu Titan Tự Nhiên\n\n1.399 USD \n\n38.490.000 VNĐ\n\niPhone 15 Pro Max bản 512GB màu Titan Xanh\n\n1.399 USD \n\n37.990.000 VNĐ\niPhone 15 Pro Max có mấy màu?\nPhiên bản iPhone 15 Pro Max 512GB năm nay được trang bị 4 tuỳ chọn màu sắc đa dạng để người dùng có thể tìm thấy sự phù hợp với phong cách và cá tính riêng của mình. Màu sắc mới bao gồm Black Titan (Đen) với vẻ sang trọng và lịch lãm, White Titan (Trắng) mang đến sự tinh tế và truyền thống, Natural Titanium (Xám) với sự đậm đà và mạnh mẽ và Blue Titan (Xanh den) mang đến sự cá tính và nổi bật. \n\nDù không có nhiều thay đổi so với các phiên bản trước, iPhone 15 Pro Max vẫn giữ được những màu sắc sang trọng và đẳng cấp đã từng được yêu thích. Đây là những tông màu cơ bản đã từng xuất hiện trên các dòng iPhone trước đây nên chắc chắn khi kết hợp với thiết kế sang trọng trên dòng 15 Pro Max sẽ mang đến được sự đẳng cấp, tinh tế.\n\n\n\niPhone 15 Pro Max có gì mới đáng mua?\nTiếp đến hãy cùng nhau đi vào đánh giá chiết hơn về các nâng cấp mới nhất trên iPhone 15 Pro Max 512GB VN/A dưới đây nhé. \n\nThiết kế sang trọng với khung viền Titan mới\niPhone 15 Pro Max 512GB tiếp tục giữ nguyên thiết kế tương đồng với phiên bản trước đó, iPhone 14 Pro Max. Tuy vậy, điều này không phải là điểm trừ vì thiết kế của iPhone 14 Pro Max vẫn mang đến vẻ sang trọng và hiện đại.\n\nỞ mặt sau của iPhone 15 Pro Max 512GB, vẫn có một cụm camera lớn với ba ống kính, khung kim loại phẳng và màn hình với đường cắt Dynamic Island ở phía trước. Tuy nhiên, sự khác biệt giữa hai phiên bản này được thể hiện một cách tinh tế, chỉ nhìn kỹ mới có thể nhận ra.\n\nApple đã làm cho viền màn hình của iPhone 15 Pro Max mỏng hơn, tạo ra tỷ lệ màn hình so với thân máy cao hơn một chút. Hơn nữa, khung viền máy không sử dụng thép không gỉ như trước đây, mà được làm bằng chất liệu Titan mới. Điều này giúp iPhone 15 Pro Max trở nên nhẹ hơn trong khi vẫn giữ được cảm giác sang trọng và chất lượng cao.\n\nBố trí các nút nguồn và nút âm lượng vẫn giữ nguyên, tuy nhiên hình dạng đã được điều chỉnh một chút. Đáng chú ý, công tắc tắt tiếng ở cạnh trái đã được thay thế bằng một nút hành động mới. Tương tự như trên Apple Watch Ultra, nút này có thể được lập trình để thực hiện các chức năng tắt tiếng hoặc kích hoạt các ứng dụng yêu thích theo ý muốn của người dùng.\n\nVề cổng kết nối, theo quy định của các cơ quan quản lý của Liên minh châu Âu (EU), các thiết bị điện tử nhỏ cần tuân thủ tiêu chuẩn USB-C. Do đó, iPhone 15 Pro Max đã chào tạm biệt cổng Lightning truyền thống và chuyển sang sử dụng cổng USB-C. Cổng mới này sẽ cung cấp tốc độ USB 3.2, nhanh hơn khoảng 10 lần so với cổng Lightning hiện tại.\n\n\n\nMàn hình nâng cấp với mức sáng 2.500 nits ấn tượng\nApple iPhone 15 Pro Max 512GB vẫn duy trì thiết kế quen thuộc với màn hình OLED 6.7 inch và đặc trưng Dynamic Island. Tuy nhiên, lần này viền màn hình được làm mỏng hơn, tạo cảm giác màn hình lớn hơn và tràn viền trên mặt trước. Màn hình vẫn đạt độ phân giải cao, tần số quét 120Hz mượt mà cùng tính năng luôn hiển thị Always On tiện dụng. Điểm nhấn nữa là độ sáng tối đa cực cao, lên đến 2500 nits giúp hình ảnh rõ nét, sắc nét ngay cả trong điều kiện ánh sáng mạnh. Đây chắc chắn sẽ là trải nghiệm xem video và hình ảnh tuyệt vời trên iPhone 15 Pro Max.\n\n\n\nCamera nâng cấp ấn tượng với ống kính tiềm vọng\niPhone 15 Pro Max 512GB vẫn sử dụng cụm 3 camera quen thuộc gồm camera chính 48MP, camera góc siêu rộng 12MP và camera tele 12MP hỗ trợ zoom quang 5x cùng tính năng LiDAR. Điểm mới là Apple đã tối ưu hóa phần cứng và phần mềm để nâng cao chất lượng hình ảnh, cải thiện khả năng chụp thiếu sáng. \n\nCùng với đó là các tính năng thông minh hỗ trợ người dùng chụp ảnh chuyên nghiệp dễ dàng hơn. Về video, máy hỗ trợ quay 8K chuẩn phim trường Hollywood. Những nâng cấp này giúp trải nghiệm camera trên iPhone 15 Pro Max đạt đẳng cấp mới.\n\nCamera nâng cấp ấn tượng với ống kính tiềm vọng\n\nDung lượng pin ấn tượng với nâng cấp hiệu năng mới \niPhone 15 Pro Max 512GB được trang bị viên pin dung lượng tương đương phiên bản tiền nhiệm là 4.323 mAh. Tuy nhiên, nhờ sức mạnh của chip Apple A17 Pro mới cùng hệ điều hành iOS 17 được tối ưu hóa, thời lượng pin trên iPhone 15 Pro Max 512GB được kỳ vọng sẽ đạt hiệu suất ấn tượng hơn. \n\nNgười dùng có thể yên tâm sử dụng thiết bị trong thời gian dài mà không lo hết pin, đặc biệt là các tác vụ nặng như chơi game, xem video hoặc sử dụng camera. Với thời lượng pin đỉnh cao, iPhone 15 Pro Max 512GB chắc chắn sẽ mang đến trải nghiệm sử dụng xuất sắc nhất.\n\nDung lượng pin ấn tượng với nâng cấp hiệu năng mới \n\nCổng sạc thay đổi hoàn toàn mới với cổng USB-C\niPhone 15 Pro Max 512GB đã loại bỏ cổng sạc Lightning cũ và thay vào đó là cổng sạc USB-C hoàn toàn mới. Cổng sạc mới này cho phép sạc có dây nhanh hơn với công suất lớn và sạc không dây MagSafe nhanh hơn với công suất 15W. Các bộ sạc không dây Qi khác vẫn sẽ sạc ở mức chậm hơn là 7.5W.\n\n\n\nSạc nhanh với nâng cấp vượt trội hơn\niPhone 15 Pro Max 512GB hỗ trợ sạc nhanh có dây công suất lớn giúp sạc pin nhanh hơn, đặc biệt là khi sạc đến 50% và 80% dung lượng pin. Tất cả các mẫu iPhone 15 đều hỗ trợ sạc MagSafe và chuẩn Qi2 mới, cho phép sạc không dây nhanh hơn ở mức 15W với các phụ kiện không phải của Apple, miễn là chúng hỗ trợ Qi2. Ngay cả các phụ kiện không chính thức hỗ trợ MagSafe cũng có thể sạc nhanh hơn nếu chúng hỗ trợ Qi2.\n\n\n\nHệ điều hành iOS 17 mới nhất với nhiều tính năng mới hấp dẫn\nApple đã chia sẻ với chúng ta cái nhìn đầu tiên về iOS 17, hệ điều hành mới sẽ ra mắt cùng với dòng iPhone 15. Một trong những tính năng mới thú vị nhất trong năm nay là Contact Poster, cho phép người dùng tùy chỉnh cách họ xuất hiện trên màn hình điện thoại của người khác khi đang trong cuộc gọi.\n\nApple cũng đã cải thiện tính năng tự động sửa lỗi và dự đoán từ với bàn phím. Bàn phím sẽ ghi nhớ phong cách viết cá nhân của bạn và tự động điều chỉnh để cung cấp các đề xuất tốt hơn. Ngoài ra còn có một số tính năng mới khác, chẳng hạn như khả năng sao chép toàn bộ cuộc trò chuyện hoặc tin nhắn thoại trong iMessage. Tất nhiên, tất cả các tính năng này cũng sẽ có sẵn trên bất kỳ điện thoại nào khác hỗ trợ iOS 17.\n\niPhone của Apple nổi tiếng là nhận được các bản cập nhật iOS trong nhiều năm, với thời gian hỗ trợ thông thường là 5 năm. Do đó, iPhone 15 Pro Max, ra mắt với iOS 17 vào năm 2023, dự kiến ​​sẽ tiếp tục nhận được các bản cập nhật iOS cho đến năm 2028, trừ khi có sự thay đổi.\n\n\n\nCác tính năng mới đặc biệt \nVới khả năng sạc không dây 15W, iPhone 15 Pro Max mới mang đến cho người dùng trải nghiệm sạc nhanh và tiện lợi. Chỉ cần đặt điện thoại lên đế sạc không dây tương thích và năng lượng sẽ được truyền qua không khí mà không cần dây cáp.\n\nApple đã hứa hẹn nhiều cải tiến đáng kể cho iPhone 15 Pro Max và một trong những điểm nổi bật là nút bấm vật lý không thể di chuyển. Để đảm bảo phản hồi tốt nhất, iPhone 15 Pro Max được trang bị hai mô-đun quản lý Taptic Engine, đảm bảo người dùng nhận được phản hồi chính xác từ nút bấm vật lý.\n\nCác tính năng mới đặc biệt \n\nThu cũ đổi mới lên đời iPhone 15 Pro Max từ các dòng iPhone cũ\nDi Động Việt là một trong những hệ thống bán lẻ uy tín nhất tại Việt Nam với hơn 10 năm kinh nghiệm. Chúng tôi không chỉ cạnh tranh về giá cả mà còn mang đến giá trị đích thực cho khách hàng.\n\nMột trong những chương trình độc đáo nhất của Di Động Việt là chương trình Thu Cũ Đổi Mới. Chương trình này cho phép khách hàng đổi thiết bị cũ của mình để lấy một thiết bị mới hơn với mức giá ưu đãi. Thủ tục đổi mới rất đơn giản và nhanh chóng, chỉ mất từ 3 đến 5 phút.\n\nĐiều đáng chú ý là dù điện thoại thông minh của bạn không đáp ứng các yêu cầu và tiêu chí độ mới thu máy cơ bản, Di Động Việt vẫn sẽ hỗ trợ thu mua với mức giá tốt nhất. Bạn chỉ cần mang điện thoại thông minh cũ của mình đến Di Động Việt và trải nghiệm dịch vụ lên đời máy mới hấp dẫn này.\n\nĐặc biệt, trong thời gian này Di Động Việt đang có chương trình ưu đãi độc quyền thu cũ đổi mới với quà tặng lên đến 2 triệu đồng khi đổi iPhone cũ lên đời iPhone 15 Pro Max 512GB chính hãng. Nhanh tay đến Di Động Việt để tận hưởng ưu đãi hấp dẫn này nhé.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/eab9ad6c-06b0-4a25-b070-b65887755cee.jpg?alt=media', 'Thông số kỹ thuật\nMàn hình\n\nCông nghệ màn hình\n\nSuper Retina XDR OLED\n\nMàn hình rộng\n\n6.7inch\n\nĐộ sáng tối đa\n\nĐang cập nhật\n\nMặt kính cảm ứng\n\nKính cường lực Ceramic Shield\n\nĐộ phân giải\n\n2796 x 1290-pixel\n\nCamera sau\n\nTính năng\n\nPhotonic Engine, Deep Fusion, HDR thông minh thế hệ 5, Ảnh chân dung thế hệ mới với Focus và Depth Control, Hiệu ứng Chiếu Sáng Chân Dung với sáu chế độ, Chế độ Ban Đêm\n\nĐộ phân giải\n\nChính 48 MP & Phụ 12 MP & Tele 5x & Tele 2x\n\nQuay phim\n\n4K@24/25/30/60 fps, HD 1080p@25/30/60 fps, HD 720p@30 fps\n\nĐèn Flash\n\nFlash True Tone Thích Ứng\n\nCamera trước\n\nĐộ phân giải\n\n12MP\n\nVideo Call\n\n4K@24/25/30/60 fps, HD 1080p@25/30/60 fps\n\nHệ điều hành & CPU\n\nHệ điều hành\n\niOS 17\n\nChip xử lý (CPU)\n\nApple A17 Pro 6 nhân\n\nChip đồ họa (GPU)\n\nApple GPU 6 nhân\n\nBộ nhớ & Lưu trữ\n\nBộ nhớ trong\n\n512GB\n\nThẻ nhớ ngoài\n\nKhông\n\nKết nối\n\nSIM\n\n2 SIM (nano‑SIM và eSIM)\n\nWifi\n\nWi‑Fi 6E\n\nĐịnh vị GPS\n\nGPS tần số kép chính xác (GPS, GLONASS, Galileo, QZSS, BeiDou và NavIC)\n\nKết nối khác\n\nNFC\n\nMạng di động\n\nHỗ trợ 5G\n\nBluetooth\n\nBluetooth 5.3\n\nCổng kết nối/sạc\n\nUSB-C Supports USB 3\n\nJack tai nghe\n\nKhông\n\nPin & Sạc\n\nLoại pin\n\nLi-Ion\n\nHỗ trợ sạc tối đa\n\nSạc nhanh, Sạc không dây 15W, Sạc không dây Qi 7.5W\n\nDung lượng pin\n\n4422mAh\n\nTiện ích\n\nBảo mật nâng cao\n\nNhận diện khuôn mặt FaceID\n\nKháng nước, bụi\n\nĐạt mức IP68 (chống nước ở độ sâu tối đa 6 mét trong vòng tối đa 30 phút)\n\nTính năng đặc biệt\n\nSOS Khẩn Cấp, Phát Hiện Va Chạm\n\nThời điểm ra mắt\n\n09/2023\n\nThiết kế\n\nThiết kế\n\nNguyên khối\n\nKích thước\n\nDài 159.9 mm - Ngang 76.7 mm - Dày 8.25 mm\n\nTrọng lượng\n\n221 grams\n\nChất liệu\n\nTitanium', 'Điện thoại iPhone 15 Pro Max', 0, 'ACTIVE', '2024-07-18 14:35:26.702838', NULL, 15, 3);
INSERT INTO `product` VALUES (22, '2024-05-09 03:30:42.963480', 'Mua iPhone 15 Pro Max 512GB trả góp 0%: Thông tin cần biết trước khi mua\niPhone 15 Pro Max 512GB phiên bản 512GB luôn là một trong những phiên bản được nhiều người dùng ưa chuộng lựa chọn nhất. Vì phiên bản này có mức dung lượng lớn đủ để phục vụ đa dạng các nhu cầu sử dụng, lưu trữ hàng ngày lớn của người dùng và được trang bị đầy đủ những tính năng cao cấp nhất.\n\niPhone 15 Pro Max được nâng cấp gì so với iPhone 14 Pro Max?\nTrước tiên, hãy cùng nhau so sánh tổng quan 2 phiên bản cao cấp nhất của nhà Táo trong năm 2022 và năm 2023 để xem iPhone 15 Pro Max năm nay đã có những nâng cấp mới thú vị nào so với người đàn anh iPhone 14 Pro Max của mình nhé. \n\nCác tiêu chuẩn so sánh \n\niPhone 14 Pro Max \n\niPhone 15 Pro Max\n\nMàn hình\n\n6.7inch\n\n6.7inch\n\nĐộ phân giải trang bị\n\n1.290 x 2.796px\n\n1.290 x 2.796px\n\nCamera sau\n\n48MP|12MP|12MP\n\n48MP|12MP|12MP\n\nCamera selfie\n\n12MP\n\n12MP\n\nChipset trang bị \n\nApple A16 Bionic\n\nApple A17 Pro\n\nCập nhật hệ điều hành\n\niOS 16\n\niOS 17\n\nViên pin\n\n4.323 mAh\n\n4.422 mAh\n\nCông nghệ sạc nhanh\n\n27W\n\nĐang cập nhật\n\nKích thước tổng thể\n\n160.7 x 77.6 x 7.85 mm\n\n159.86 x 76.73 x 8.25 mm\n\nTrọng lượng máy\n\n240 gram\n\n221 gram\n\nCổng sạc\n\nLightning\n\nUSB-C\n\nKhung viền \n\nThép không ghỉ\n\n Titanium\n\nMàu sắc\n\nVàng, Tím, Xám, Bạc\n\nXám Titan, Đen Titan, Xanh Titan, Trắng Titan\n\niPhone 15 Pro Max 512GB giá bao nhiêu?\nĐiện thoại iPhone 15 Pro Max 512GB là phiên bản ở mức trung nằm giữa bản thấp nhất 256GB và 1TB. Đối với người dùng sử dụng các tác vụ thông thường thì bản 256GB là vừa đủ, nhưng nếu bạn làm những công việc thiên về chụp ảnh quay phim thì mức 256GB lại không đủ đáp ứng.\n\nNên bản 512GB là một lựa chọn vừa đủ nhất để phục vụ nhu cầu làm việc với nhiều tác vụ nặng hơn. Đồng thời phiên bản 512GB sẽ là lựa chọn hoàn hảo hơn về giá so với dòng 1TB. Nếu bạn không phải là người sử dụng quá nhiều tác vụ nặng, lưu trữ video, ảnh lớn thì bản 512GB đã đủ không cần phải nâng cấp lên mức 1TB với mức giá cao hơn\n\nPhiên bản iPhone 15 Pro Max 512GB khi được ra mắt tại thị trường Mỹ với mức giá 1.199 USD và giá bán tại Việt Nam lúc đó khoảng gần 40.000.000 VNĐ . Tham khảo bảng giá chi tiết mới nhất từng màu trên 15 Pro Max 512GB dưới đây. \n\nLưu ý: Giá các phiên bản màu iPhone 15 Pro Max 512GB được cập nhật trong bảng bên dưới được tham khảo theo giá ngày 3.2.2024. Sẽ có đôi chút thay đổi và cập nhật liên tục theo giá thị trường trong thời gian tới. \n\n \n\nCác phiên bản màu sắc tùy chọn của bản 256GB\n\nGiá bán tại Mỹ \n\nGiá bán hiện tại tại Việt Nam\n\niPhone 15 Pro Max bản 512GB màu Đen\n\n1.399 USD \n\n37.990.000 VNĐ\n\niPhone 15 Pro Max bản 512GB màu Trắng\n\n1.399 USD \n\n37.990.000 VNĐ\n\niPhone 15 Pro Max bản 512GB màu Titan Tự Nhiên\n\n1.399 USD \n\n38.490.000 VNĐ\n\niPhone 15 Pro Max bản 512GB màu Titan Xanh\n\n1.399 USD \n\n37.990.000 VNĐ\niPhone 15 Pro Max có mấy màu?\nPhiên bản iPhone 15 Pro Max 512GB năm nay được trang bị 4 tuỳ chọn màu sắc đa dạng để người dùng có thể tìm thấy sự phù hợp với phong cách và cá tính riêng của mình. Màu sắc mới bao gồm Black Titan (Đen) với vẻ sang trọng và lịch lãm, White Titan (Trắng) mang đến sự tinh tế và truyền thống, Natural Titanium (Xám) với sự đậm đà và mạnh mẽ và Blue Titan (Xanh den) mang đến sự cá tính và nổi bật. \n\nDù không có nhiều thay đổi so với các phiên bản trước, iPhone 15 Pro Max vẫn giữ được những màu sắc sang trọng và đẳng cấp đã từng được yêu thích. Đây là những tông màu cơ bản đã từng xuất hiện trên các dòng iPhone trước đây nên chắc chắn khi kết hợp với thiết kế sang trọng trên dòng 15 Pro Max sẽ mang đến được sự đẳng cấp, tinh tế.\n\n\n\niPhone 15 Pro Max có gì mới đáng mua?\nTiếp đến hãy cùng nhau đi vào đánh giá chiết hơn về các nâng cấp mới nhất trên iPhone 15 Pro Max 512GB VN/A dưới đây nhé. \n\nThiết kế sang trọng với khung viền Titan mới\niPhone 15 Pro Max 512GB tiếp tục giữ nguyên thiết kế tương đồng với phiên bản trước đó, iPhone 14 Pro Max. Tuy vậy, điều này không phải là điểm trừ vì thiết kế của iPhone 14 Pro Max vẫn mang đến vẻ sang trọng và hiện đại.\n\nỞ mặt sau của iPhone 15 Pro Max 512GB, vẫn có một cụm camera lớn với ba ống kính, khung kim loại phẳng và màn hình với đường cắt Dynamic Island ở phía trước. Tuy nhiên, sự khác biệt giữa hai phiên bản này được thể hiện một cách tinh tế, chỉ nhìn kỹ mới có thể nhận ra.\n\nApple đã làm cho viền màn hình của iPhone 15 Pro Max mỏng hơn, tạo ra tỷ lệ màn hình so với thân máy cao hơn một chút. Hơn nữa, khung viền máy không sử dụng thép không gỉ như trước đây, mà được làm bằng chất liệu Titan mới. Điều này giúp iPhone 15 Pro Max trở nên nhẹ hơn trong khi vẫn giữ được cảm giác sang trọng và chất lượng cao.\n\nBố trí các nút nguồn và nút âm lượng vẫn giữ nguyên, tuy nhiên hình dạng đã được điều chỉnh một chút. Đáng chú ý, công tắc tắt tiếng ở cạnh trái đã được thay thế bằng một nút hành động mới. Tương tự như trên Apple Watch Ultra, nút này có thể được lập trình để thực hiện các chức năng tắt tiếng hoặc kích hoạt các ứng dụng yêu thích theo ý muốn của người dùng.\n\nVề cổng kết nối, theo quy định của các cơ quan quản lý của Liên minh châu Âu (EU), các thiết bị điện tử nhỏ cần tuân thủ tiêu chuẩn USB-C. Do đó, iPhone 15 Pro Max đã chào tạm biệt cổng Lightning truyền thống và chuyển sang sử dụng cổng USB-C. Cổng mới này sẽ cung cấp tốc độ USB 3.2, nhanh hơn khoảng 10 lần so với cổng Lightning hiện tại.\n\n\n\nMàn hình nâng cấp với mức sáng 2.500 nits ấn tượng\nApple iPhone 15 Pro Max 512GB vẫn duy trì thiết kế quen thuộc với màn hình OLED 6.7 inch và đặc trưng Dynamic Island. Tuy nhiên, lần này viền màn hình được làm mỏng hơn, tạo cảm giác màn hình lớn hơn và tràn viền trên mặt trước. Màn hình vẫn đạt độ phân giải cao, tần số quét 120Hz mượt mà cùng tính năng luôn hiển thị Always On tiện dụng. Điểm nhấn nữa là độ sáng tối đa cực cao, lên đến 2500 nits giúp hình ảnh rõ nét, sắc nét ngay cả trong điều kiện ánh sáng mạnh. Đây chắc chắn sẽ là trải nghiệm xem video và hình ảnh tuyệt vời trên iPhone 15 Pro Max.\n\n\n\nCamera nâng cấp ấn tượng với ống kính tiềm vọng\niPhone 15 Pro Max 512GB vẫn sử dụng cụm 3 camera quen thuộc gồm camera chính 48MP, camera góc siêu rộng 12MP và camera tele 12MP hỗ trợ zoom quang 5x cùng tính năng LiDAR. Điểm mới là Apple đã tối ưu hóa phần cứng và phần mềm để nâng cao chất lượng hình ảnh, cải thiện khả năng chụp thiếu sáng. \n\nCùng với đó là các tính năng thông minh hỗ trợ người dùng chụp ảnh chuyên nghiệp dễ dàng hơn. Về video, máy hỗ trợ quay 8K chuẩn phim trường Hollywood. Những nâng cấp này giúp trải nghiệm camera trên iPhone 15 Pro Max đạt đẳng cấp mới.\n\nCamera nâng cấp ấn tượng với ống kính tiềm vọng\n\nDung lượng pin ấn tượng với nâng cấp hiệu năng mới \niPhone 15 Pro Max 512GB được trang bị viên pin dung lượng tương đương phiên bản tiền nhiệm là 4.323 mAh. Tuy nhiên, nhờ sức mạnh của chip Apple A17 Pro mới cùng hệ điều hành iOS 17 được tối ưu hóa, thời lượng pin trên iPhone 15 Pro Max 512GB được kỳ vọng sẽ đạt hiệu suất ấn tượng hơn. \n\nNgười dùng có thể yên tâm sử dụng thiết bị trong thời gian dài mà không lo hết pin, đặc biệt là các tác vụ nặng như chơi game, xem video hoặc sử dụng camera. Với thời lượng pin đỉnh cao, iPhone 15 Pro Max 512GB chắc chắn sẽ mang đến trải nghiệm sử dụng xuất sắc nhất.\n\nDung lượng pin ấn tượng với nâng cấp hiệu năng mới \n\nCổng sạc thay đổi hoàn toàn mới với cổng USB-C\niPhone 15 Pro Max 512GB đã loại bỏ cổng sạc Lightning cũ và thay vào đó là cổng sạc USB-C hoàn toàn mới. Cổng sạc mới này cho phép sạc có dây nhanh hơn với công suất lớn và sạc không dây MagSafe nhanh hơn với công suất 15W. Các bộ sạc không dây Qi khác vẫn sẽ sạc ở mức chậm hơn là 7.5W.\n\n\n\nSạc nhanh với nâng cấp vượt trội hơn\niPhone 15 Pro Max 512GB hỗ trợ sạc nhanh có dây công suất lớn giúp sạc pin nhanh hơn, đặc biệt là khi sạc đến 50% và 80% dung lượng pin. Tất cả các mẫu iPhone 15 đều hỗ trợ sạc MagSafe và chuẩn Qi2 mới, cho phép sạc không dây nhanh hơn ở mức 15W với các phụ kiện không phải của Apple, miễn là chúng hỗ trợ Qi2. Ngay cả các phụ kiện không chính thức hỗ trợ MagSafe cũng có thể sạc nhanh hơn nếu chúng hỗ trợ Qi2.\n\n\n\nHệ điều hành iOS 17 mới nhất với nhiều tính năng mới hấp dẫn\nApple đã chia sẻ với chúng ta cái nhìn đầu tiên về iOS 17, hệ điều hành mới sẽ ra mắt cùng với dòng iPhone 15. Một trong những tính năng mới thú vị nhất trong năm nay là Contact Poster, cho phép người dùng tùy chỉnh cách họ xuất hiện trên màn hình điện thoại của người khác khi đang trong cuộc gọi.\n\nApple cũng đã cải thiện tính năng tự động sửa lỗi và dự đoán từ với bàn phím. Bàn phím sẽ ghi nhớ phong cách viết cá nhân của bạn và tự động điều chỉnh để cung cấp các đề xuất tốt hơn. Ngoài ra còn có một số tính năng mới khác, chẳng hạn như khả năng sao chép toàn bộ cuộc trò chuyện hoặc tin nhắn thoại trong iMessage. Tất nhiên, tất cả các tính năng này cũng sẽ có sẵn trên bất kỳ điện thoại nào khác hỗ trợ iOS 17.\n\niPhone của Apple nổi tiếng là nhận được các bản cập nhật iOS trong nhiều năm, với thời gian hỗ trợ thông thường là 5 năm. Do đó, iPhone 15 Pro Max, ra mắt với iOS 17 vào năm 2023, dự kiến ​​sẽ tiếp tục nhận được các bản cập nhật iOS cho đến năm 2028, trừ khi có sự thay đổi.\n\n\n\nCác tính năng mới đặc biệt \nVới khả năng sạc không dây 15W, iPhone 15 Pro Max mới mang đến cho người dùng trải nghiệm sạc nhanh và tiện lợi. Chỉ cần đặt điện thoại lên đế sạc không dây tương thích và năng lượng sẽ được truyền qua không khí mà không cần dây cáp.\n\nApple đã hứa hẹn nhiều cải tiến đáng kể cho iPhone 15 Pro Max và một trong những điểm nổi bật là nút bấm vật lý không thể di chuyển. Để đảm bảo phản hồi tốt nhất, iPhone 15 Pro Max được trang bị hai mô-đun quản lý Taptic Engine, đảm bảo người dùng nhận được phản hồi chính xác từ nút bấm vật lý.\n\nCác tính năng mới đặc biệt \n\nThu cũ đổi mới lên đời iPhone 15 Pro Max từ các dòng iPhone cũ\nDi Động Việt là một trong những hệ thống bán lẻ uy tín nhất tại Việt Nam với hơn 10 năm kinh nghiệm. Chúng tôi không chỉ cạnh tranh về giá cả mà còn mang đến giá trị đích thực cho khách hàng.\n\nMột trong những chương trình độc đáo nhất của Di Động Việt là chương trình Thu Cũ Đổi Mới. Chương trình này cho phép khách hàng đổi thiết bị cũ của mình để lấy một thiết bị mới hơn với mức giá ưu đãi. Thủ tục đổi mới rất đơn giản và nhanh chóng, chỉ mất từ 3 đến 5 phút.\n\nĐiều đáng chú ý là dù điện thoại thông minh của bạn không đáp ứng các yêu cầu và tiêu chí độ mới thu máy cơ bản, Di Động Việt vẫn sẽ hỗ trợ thu mua với mức giá tốt nhất. Bạn chỉ cần mang điện thoại thông minh cũ của mình đến Di Động Việt và trải nghiệm dịch vụ lên đời máy mới hấp dẫn này.\n\nĐặc biệt, trong thời gian này Di Động Việt đang có chương trình ưu đãi độc quyền thu cũ đổi mới với quà tặng lên đến 2 triệu đồng khi đổi iPhone cũ lên đời iPhone 15 Pro Max 512GB chính hãng. Nhanh tay đến Di Động Việt để tận hưởng ưu đãi hấp dẫn này nhé.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/546146a5-a37f-455c-ad6d-904f39878830.jpg?alt=media', 'Thông số kỹ thuật\nMàn hình\n\nCông nghệ màn hình\n\nSuper Retina XDR OLED\n\nMàn hình rộng\n\n6.7inch\n\nĐộ sáng tối đa\n\nĐang cập nhật\n\nMặt kính cảm ứng\n\nKính cường lực Ceramic Shield\n\nĐộ phân giải\n\n2796 x 1290-pixel\n\nCamera sau\n\nTính năng\n\nPhotonic Engine, Deep Fusion, HDR thông minh thế hệ 5, Ảnh chân dung thế hệ mới với Focus và Depth Control, Hiệu ứng Chiếu Sáng Chân Dung với sáu chế độ, Chế độ Ban Đêm\n\nĐộ phân giải\n\nChính 48 MP & Phụ 12 MP & Tele 5x & Tele 2x\n\nQuay phim\n\n4K@24/25/30/60 fps, HD 1080p@25/30/60 fps, HD 720p@30 fps\n\nĐèn Flash\n\nFlash True Tone Thích Ứng\n\nCamera trước\n\nĐộ phân giải\n\n12MP\n\nVideo Call\n\n4K@24/25/30/60 fps, HD 1080p@25/30/60 fps\n\nHệ điều hành & CPU\n\nHệ điều hành\n\niOS 17\n\nChip xử lý (CPU)\n\nApple A17 Pro 6 nhân\n\nChip đồ họa (GPU)\n\nApple GPU 6 nhân\n\nBộ nhớ & Lưu trữ\n\nBộ nhớ trong\n\n512GB\n\nThẻ nhớ ngoài\n\nKhông\n\nKết nối\n\nSIM\n\n2 SIM (nano‑SIM và eSIM)\n\nWifi\n\nWi‑Fi 6E\n\nĐịnh vị GPS\n\nGPS tần số kép chính xác (GPS, GLONASS, Galileo, QZSS, BeiDou và NavIC)\n\nKết nối khác\n\nNFC\n\nMạng di động\n\nHỗ trợ 5G\n\nBluetooth\n\nBluetooth 5.3\n\nCổng kết nối/sạc\n\nUSB-C Supports USB 3\n\nJack tai nghe\n\nKhông\n\nPin & Sạc\n\nLoại pin\n\nLi-Ion\n\nHỗ trợ sạc tối đa\n\nSạc nhanh, Sạc không dây 15W, Sạc không dây Qi 7.5W\n\nDung lượng pin\n\n4422mAh\n\nTiện ích\n\nBảo mật nâng cao\n\nNhận diện khuôn mặt FaceID\n\nKháng nước, bụi\n\nĐạt mức IP68 (chống nước ở độ sâu tối đa 6 mét trong vòng tối đa 30 phút)\n\nTính năng đặc biệt\n\nSOS Khẩn Cấp, Phát Hiện Va Chạm\n\nThời điểm ra mắt\n\n09/2023\n\nThiết kế\n\nThiết kế\n\nNguyên khối\n\nKích thước\n\nDài 159.9 mm - Ngang 76.7 mm - Dày 8.25 mm\n\nTrọng lượng\n\n221 grams\n\nChất liệu\n\nTitanium', 'Điện thoại iPhone 15 Pro 256GB', 3, 'ACTIVE', '2024-07-18 14:35:26.702838', NULL, 15, 3);
INSERT INTO `product` VALUES (23, '2024-07-14 00:34:09.054221', '🌺 CAT’S ON - HẠT THỨC ĂN CHO MÈO MỌI LỨA TUỔI 🌺\r\n👉 Tên sản phẩm: Hạt dinh dưỡng cho mèo Cat\'s On dạng túi chiết từ bao 20kg\r\n👉 Xuất sứ: Hàn Quốc\r\n👉 Hạn sử dụng: 12 tháng kể từ ngày sản xuất.\r\n👉 Nhà sản xuất: Công ty Farmsco Corporation Hàn Quốc\r\n👉 Đơn vị nhập khẩu và phân phối: Công ty TNHH PETKO (Tầng 9 tòa nhà indochina, Số 4 Nguyễn Đình Chiều, P Đa Kao, Q.1, TPHCM)\r\n👉 Đơn vị nhập và phân phối trên sàn TMĐT: \r\n🐶 MIU PETSHOP 🐱\r\n\r\n🌺Dòng sản phẩm phân khúc giá mềm vô cùng quen thuộc ở Hàn Quốc nay đã có ở Việt Nam. Với thang điểm 4.8/ 5 sao do người mua bình chọn trên các trang mua hàng trực tuyến tại Hàn Quốc.\r\n \r\n🌺Do không tốn chi phí cho hoạt động quảng cáo và chi phí cho hệ thống phân phối nhiều tầng lớp, giá thành của Cat’s On hầu như cũng là giá thành của nguyên vật liệu đầu vào, được chọn lựa kỹ lưỡng bởi công ty có kinh nghiệm lâu năm trong ngành sản xuất petfood – Farmsco Corporation Korea.\r\n \r\n🌺Không chứa kháng sinh và hormon như các sản phẩm khác, Cat’s On thậm chí còn đặt biệt hơn vì không chứa chất bảo quản hóa học, an toàn với vật nuôi.\r\n \r\n🌺Hàm lượng đạm 33% thuộc loại cao nhất trong phân khúc giá bình dân.\r\n \r\n🌺Thành phần chính: Thịt vịt, thịt gà, ngô, củ cải, chất béo, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin B12, Vitamin D3, Vitamin E, axit folic, , Choline chloride, taurine và khoáng.\r\n \r\n🌺Hướng dẫn sử dụng: Cho ăn hàng ngày theo trọng lượng vật nuôi\r\n \r\nTrọng lượng vật nuôi\r\n2KG~4Kg\r\n5KG~9Kg\r\n10Kg~14Kg\r\nLượng cho ăn\r\n40g~80g\r\n100g~170g\r\n190g~270g', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/e5a3c707-1ffe-416a-91f5-cd19a2553581.jpg?alt=media', '🌺Chỉ tiêu chất lượng: Độ ẩm (max) ≤ 10,0 %; protein (min) ≥ 33,0 %; béo thô (min) ≥ 15,0 %;\r\nxơ thô (max) ≤ 4,0 %; khoáng tổng số (max) ≤ 10,0 %; canxi (min) > 1,0 %; phốt pho(min) > 0,5 %\r\n🌺Công dụng:  \r\n- Tốt cho lông da, tăng cường thị lực.\r\n- Tăng cường miễn dịch và khả năng tiêu hóa.\r\n- Mùi vị thơm ngon kích thích sự thèm ăn.', 'Hạt cho mèo Cats On Chi.a Túi 1kg, Hạt cho mèo mọi lứa tuổi Cat On xuất xứ Hàn Quốc, Thức ăn mèo con Cats On Túi 1kg', 0, 'ACTIVE', '2024-07-14 00:34:09.054221', NULL, 6, 3);
INSERT INTO `product` VALUES (24, '2024-07-14 00:40:38.912206', '🌺Cát vệ sinh cho mèo Min🌺 \r\n👉 Tên sản phẩm: Cát vệ sinh cho mèo Min\r\n👉 Xuất sứ: Nhật Bản.\r\n👉 Hạn sử dụng: 10 năm kể từ ngày sản xuất.\r\n👉 Đơn vị nhập khẩu và phân phối: Công ty TNHH Ngân Hà (KCN Tân Thuận, P. Tân Thuận Đông, Q.7, TPHCM)\r\n👉 Đơn vị nhập và phân phối trên sàn TMĐT: \r\n👉 Trọng lượng: 8l ~ 3.6kg \r\n\r\n🌺Ưu điểm:\r\n👉 Cát mèo thấm hút tốt\r\n👉 Cát mèo vón cục tốt\r\n👉 Cát mèo ít bụi, mùi thơm\r\n👉 Cát mèo giá siêu rẻ\r\n\r\n🌺 Thành phần: \r\n👉 Bentonite nguyên chất \r\n👉 Ion Ag+ khử khuẩn \r\n👉 Than Hoạt tính\r\n👉 Chất kết dính \r\n👉Tinh dầu tạo mùi', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/e5eb6913-6c88-4439-a7a6-7e94f8344f9d.jpg?alt=media', '✔️ Cát mèo ít bụi phù hợp cho gia đình có trẻ nhỏ, người lớn tuổi, người bị dị ứng\r\n\r\n✔️ Đặc biệt cát mèo ít bụi hạn chế bị bệnh hô hấp cho các bé mèo \r\n\r\n✔️ Cát vệ sinh cho mèo 8l là sản phẩm cát vệ sinh cho mèo rất an toàn, dược làm từ thành phần tự nhiên, không độc hại cho mèo, đảm bảo an toàn vệ sinh. \r\n\r\n✔️Cát mèo Min  có nguồn gốc, xuất xứ rõ ràng, được nhiều \"sen\" lựa chọn, sản phẩm này giúp việc dọn vệ sinh cho mèo dễ dàng hơn.\r\n\r\n✔️Cát vệ sinh cho mèo cũng ngăn ngừa sự phát triển của vi khuẩn. Khiến ngôi nhà của bạn luôn sạch sẽ, thơm tho, đảm bảo không có mùi chất thải của boss\r\n\r\n✔️Cát mèo MIN  8L luôn có sẵn tại shop', 'Cát vệ sinh cho mèo MIN 8L, Cát vệ sinh cho mèo khử mùi, vón cục túi 8L', 0, 'ACTIVE', '2024-07-18 15:39:30.997756', NULL, 20, 3);
INSERT INTO `product` VALUES (25, '2024-07-14 00:44:21.515455', '❤Giới thiệu sản phẩm❤\r\n- RẺ, MÀU ĐẸP GIÚP BẠN DỄ DÀNG THẤY CÚN CƯNG CỦA BẠN\r\n\r\n - Vòng cổ cho cún và mèo cưng đẹp, thú cưng có cân nặng cơ thể dưới 5kg.\r\n\r\n - Bạn có thể điều chỉnh kích thước của vòng cổ theo kích thước cổ của chú cún cưng của bạn, chiều dài ngắn nhất của \r\n   vòng cổ của chúng tôi có thể được điều chỉnh là 19 cm và chiều dài dài nhất có thể được điều chỉnh là 32 cm\r\n\r\n - Chất liệu vòng cổ mềm mại, đặc biệt không làm mèo cưng bị đau, rất thoải mái khi đeo.\r\n\r\n - Màu sắc tạo hình giúp bạn dễ dàng lựa chọn màu sắc yêu thích.\r\n\r\n - Giúp bạn dễ dàng quan sát thú cưng của mình,\r\n\r\n - Tạo \"phong cách\" cho vật nuôi', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/b72ad5e2-29f9-4287-b9e9-c90a30b08afa.jpg?alt=media', 'Vòng cổ lục lạc cho thú cưng hình dấu chân chó mèo, Thiết kế khóa bấm giúp RẺ, MÀU ĐẸP GIÚP BẠN DỄ DÀNG THẤY CÚN CƯNG CỦA BẠN', 'Vòng cổ lục lạc cho thú cưng hình dấu chân chó mèo, Thiết kế khóa bấm giúp', 2, 'ACTIVE', '2024-07-14 00:44:21.515455', NULL, 19, 3);
INSERT INTO `product` VALUES (26, '2024-07-14 00:51:12.226322', '💖Giới thiệu sản phẩm\r\n- In kẻ sọc, phong cách và thời trang hơn\r\n- Dây xích phù hợp, thuận tiện cho bạn dắt chó đi dạo\r\n- Vòng và kẹp kim loại bền, có thể sử dụng lâu dài\r\n- Thiết kế sọc phản quang, giữ khả năng hiển thị cao cho chó của bạn vào ban đêm\r\n- Lưới và đệm thoáng khí mềm mại sẽ giúp chó của bạn thoải mái hơn\r\n- Phù hợp cho chó vừa và nhỏ và mèo lớn.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/4020f6e7-957c-4598-a10b-cc988d6d4819.jpg?alt=media', '💖THÔNG TIN SẢN PHẨM \r\n- Tên sản phẩm: Lưới vuông \r\n- Thích hợp cho: vật nuôi vừa và nhỏ\r\n- Chất liệu: lưới cotton poly\r\n- Màu sắc sản phẩm: màu sáng nhẹ, màu xám, màu kaki\r\n- Ưu điểm của sản phẩm: nâng cấp ngực và lưng phản quang để đi đêm an toàn hơn, tinh tế hơn.\r\n\r\n\r\n 💖Kích thước sản phẩm: S M L \r\n   S: Vòng ngực: 35cm; phù hợp với cân nặng từ 1.5-3kg, \r\n   M: Ngực: 42cm; phù hợp với cân nặng từ  3-4.5kg, \r\n   L: Ngực: 46cm; phù hợp với cân nặng từ  4.5-7kg,', 'Yếm đệm lưới mềm cho thú cưng, dây đai dắt chó phản quang và thoáng khí dây dắt chó mèo dây dắt chó lớn', 0, 'ACTIVE', '2024-07-14 00:51:12.226322', NULL, 19, 3);
INSERT INTO `product` VALUES (27, '2024-07-14 00:56:19.384043', 'Sản phẩm: Dog Leash\r\n\r\nMàu sắc: như hình ảnh hiển thị\r\n\r\nChất liệu: ABS và Nylon\r\n\r\nKích thước: 3 M phù hợp với trọng lượng chó con lên đến 8 kg\r\n\r\n       5 M phù hợp với trọng lượng chó con lên đến 14 kg\r\n\r\nTính năng: Thiết kế có thể thu vào mang lại cho thú cưng của bạn cảm giác tự do khi đang buộc dây.\r\n\r\nRất thuận tiện để chuyển nút tạm dừng và khóa.\r\n\r\nHoàn hảo cho chó và mèo vừa và nhỏ\r\n\r\n\r\n\r\nVui lòng đọc trước khi đặt hàng: Thông thường, dây kéo tự động không thể kéo đến cuối với lực lớn cùng một lúc! Chủ nhân phải nhớ khóa chó, sau đó để chó di chuyển tự do, để tránh chó đột ngột lao về phía trước khiến Roulette bị hỏng do va đập mạnh. Hầu hết tất cả Roulette đều có điểm yếu này. Nên sử dụng dây kéo thông thường nếu không thể chấp nhận, cảm ơn sự thông cảm của bạn', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/0b3f1384-e4e5-416e-b367-6cbd2f088f13.jpg?alt=media', 'Sản phẩm: Dog Leash\r\n\r\nMàu sắc: như hình ảnh hiển thị\r\n\r\nChất liệu: ABS và Nylon\r\n\r\nKích thước: 3 M phù hợp với trọng lượng chó con lên đến 8 kg\r\n\r\n       5 M phù hợp với trọng lượng chó con lên đến 14 kg\r\n\r\nTính năng: Thiết kế có thể thu vào mang lại cho thú cưng của bạn cảm giác tự do khi đang buộc dây.\r\n\r\nRất thuận tiện để chuyển nút tạm dừng và khóa.\r\n\r\nHoàn hảo cho chó và mèo vừa và nhỏ\r\n\r\n\r\n\r\nVui lòng đọc trước khi đặt hàng: Thông thường, dây kéo tự động không thể kéo đến cuối với lực lớn cùng một lúc! Chủ nhân phải nhớ khóa chó, sau đó để chó di chuyển tự do, để tránh chó đột ngột lao về phía trước khiến Roulette bị hỏng do va đập mạnh. Hầu hết tất cả Roulette đều có điểm yếu này. Nên sử dụng dây kéo thông thường nếu không thể chấp nhận, cảm ơn sự thông cảm của bạn', 'Holapet 3m Dây Xích Thú Cưng Cho Chó Nhỏ Mèo', 4, 'ACTIVE', '2024-07-18 15:19:03.288560', NULL, 19, 3);
INSERT INTO `product` VALUES (28, '2024-07-14 12:30:52.129636', 'Dầu gội sữa tắm cho chó mèo, giúp loại bỏ bọ chét, rận, làm sạch lông, giúp lông mềm mượt an toàn cho da lông\r\nĐược phát triển bởi các chuyên gia hàng đầu trong ngành thú cưng, sản phẩm này mang đến những lợi ích vượt trội cho lông thú yêu của bạn.\r\nTên sản phẩm: Sữa tắm cho thú cưng\r\nPhù hợp cho tất cả các mùa trong năm.\r\nSữa tắm cho chó mèo với một công thức đặc biệt, kết hợp những thành phần tự nhiên  tinh dầu bạc hà, dầu hạnh nhân ngọt, dầu dừa và nhiều thành phần khác. Đây là những thành phần tự nhiên an toàn giúp làm sạch sâu, nuôi dưỡng và bảo vệ lông thú khỏe mạnh.\r\nSữa tắm cho chó mèo chứa tinh chất từ cúc trắng và hoa cúc, giúp cung cấp độ ẩm cần thiết cho da và lông của thú cưng. Khi chúng ta tắm cho thú cưng, da và lông của họ có thể mất đi độ ẩm tự nhiên, dẫn đến tình trạng khô, xù lông và có vẩy nứt. Nhưng với Sữa tắm chó mèo chiết xuất thực vật thiên  nhiên, bạn có thể khôi phục và bảo vệ làn da mềm mại và lông óng ả.\r\n Đa dạng và đặc biệt:\r\nSản phẩm được thiết kế để phù hợp với mọi loại lông, từ lông ngắn, lông dài đến lông xoăn. Bạn có thể lựa chọn sản phẩm phù hợp cho thú cưng của mình, ví dụ như sữa tắm dành riêng cho lông màu trắng tinh khiết hoặc sữa tắm có tác dụng làm sáng và làm mềm lông. Sự đa dạng này giúp bạn tận hưởng việc chăm sóc thú cưng một cách tốt nhất và theo ý thích của bạn.\r\nKhông chỉ giúp làm sạch và chăm sóc lông, Sữa tắm còn mang đến cảm giác tươi mát và thư giãn cho thú cưng yêu của bạn.\r\nThành phần chính: Dầu jojoba, tinh dầu bạc hà, dầu hạnh nhân ngọt, dầu dừa, dầu ô-liu EV, chất làm mềm lông, axit amin, chiết xuất hạt nho, nha đam và các thành phần khác (chi tiết xem trên từng đóng gói sản phẩm)\r\nĐối tượng sử dụng: Mèo/Chó mọi lứa tuổi\r\nQui cách: 510ml/chai\r\nHạn sử dụng: 36 tháng ( kể từ ngày sản xuất in trên bao bì sản phẩm)\r\n- HƯỚNG DẪN BẢO QUẢN:\r\nĐể nơi khô ráo và thoáng mát, tránh ánh nắng trực tiếp.\r\nCAM KẾT\r\nSản phẩm: Cửa hàng cam kết về Mẫu Mã, Chất liệu và Chất Lượng đúng với thông tin công khai.\r\nDịch vụ: Cửa hàng sẵn sàng tiếp nhận và phản hồi ý kiến của từng khách hàng.\r\nThời gian chuẩn bị hàng: Luôn có sẵn hàng tại cửa hàng và kho hàng, đóng gói nhanh gọn để giao hàng sớm nhất cho quý khách.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/feb64a84-be5b-4e4b-ab38-99463315c466.jpg?alt=media', 'Xuất xứ\r\nTrung Quốc\r\nKiểu đóng gói\r\nHộp\r\nChăm sóc thú cưng\r\nkhử trùng, Bọ chét & Bọ ve, Kiểm soát mùi, Da nhạy cảm, Sữa tắm\r\nCông Thức\r\nDạng Lỏng\r\nHạn sử dụng\r\n36 Tháng\r\nLoại thú cưng\r\nChó/Mèo mọi lứa tuổi\r\nThể tích\r\n510ml', 'Sữa tắm chó mèo chai 510ml Dầu gội chó mèo làm sạch sâu, ít bọt khử mùi, giảm ngứa lông mềm mượt', 0, 'ACTIVE', '2024-07-14 12:30:52.129636', NULL, 20, 3);
INSERT INTO `product` VALUES (29, '2024-07-14 12:34:19.453768', 'Bảo hành: 1 đổi 1 trong vòng 3 ngày sau khi sử dụng từ người bán hàng.\r\n\r\nLưu ý khi sử dụng khách hàng cần chú ý sẽ gặp phải 1 số lỗi sau:\r\n\r\n1. Bật máy lên đèn nhưng không chạy:\r\n\r\nTrường hợp này là khi các bạn đã sử dụng cắt lông rồi và khi đang cắt máy tự động dừng lại và không chạy nữa. Nguyên nhận  là do lông của thú cưng khi cắt đã bị kẹt vào đầu lưỡi và trong máy. Cách xử lý: các bạn tháo lưỡi ra và vệ sinh lại trục quay trong máy và đầu lưỡi để loại bỏ lông bám làm máy không chạy. Có thể liên hệ shop qua để gửi video qua za.lo. Vì nhắn tin trên shopee dung lượng video cao không gửi qua được.\r\n\r\n2. Sạc pin đấy mà không lên màu xanh.\r\n\r\nTông đơ clipper chỉ có 2 chế độ đèn là khi sạc sẽ lên màu đỏ và bất máy chạy đèn sẽ lên màu xanh lá cây. Vì thế để biết máy đã đấy pin chưa các bạn có thể bật thử máy lên xem máy chạy mạnh là đã có thể sử dụng ạ. Thương các bạn cứ sạc 2 tiếng là được.\r\n\r\n3. Máy không cắt được lông\r\n\r\nKhi gặp trường hợp bật máy chạy mạnh mà không cắt được lông. Các bạn nên chú ý tắm cho thú cưng và sấy khô lông trước khi cắt như vậy lông không bị bết dính, bị bẩn hoặc bị xoắn vào nhau sẽ dễ dàng cắt hơn', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/2e865fa8-65a8-4171-87c6-2f0a743d3cfd.jpg?alt=media', '* Nguồn gốc: Trung Quốc\r\n* Thương hiệu: Clipper\r\n* Kích thước hộp sản phẩm: 18,5 cm * 5,0 cm * 12,5 cm\r\n* Lưỡi tông đơ được làm bằng chất liệu cermic và titan không rỉ, bền và sắc.\r\n* Trọng lượng: 0,5kg\r\n* Sử dụng điện áp 220V\r\n* Bộ sản phẩm tông đơ chạy bằng pin gồm có: Dây sạc, bộ dụng cụ vệ sinh tông đơ, 4 lưỡi căn chỉnh độ dài  3mm, 6mm, 9mm, 12mm cho bạn dễ dàng cắt tỉa lông với độ dài vừa ý mà không lo làm tổn thương da của vật nuôi.\r\n\r\n* Thời gian sử dụng pin của tông đơ lên tới: 45 phút.\r\n* Sạc Pin đầy trong vòng 2h.\r\n\r\nBảo hành: 1 đổi 1 trong vòng 3 ngày sau khi sử dụng từ người bán hàng.', 'Tông Đơ Cắt Lông Chó Mèo Clipper Cao Cấp Full Phụ Kiện', 0, 'ACTIVE', '2024-07-14 12:34:19.453768', NULL, 20, 3);
INSERT INTO `product` VALUES (30, '2024-07-14 12:43:26.808829', 'Tấm ghép chuồng quây cho thú cưng chó mèo\r\n\r\n1. MUA BAO NHIÊU TẤM GHÉP LÀ ĐỦ GHÉP CHUỒNG CHÓ QUÂY\r\n\r\n🔷 Đơn giản nhất là xem các mẫu chuồng chó quây đã lắp sẵn, chọn mẫu mà bạn ưa thích nhất, rồi đếm các tấm ghép.\r\nChúng tôi đã ghi số lượng tấm ghép cần thiết trên các mẫu chuồng chó lắp sẵn, Quý khách chỉ cần đặt hàng các tấm ghép theo số lượng đó.\r\nCác tấm ghép cùng kích thước là có thể thay đổi cho nhau (ví dụ Tấm trắng trong 35x35 có thể đổi sang Tấm đen vân 35x35; Tấm xanh dương 45x35 có thể đổi sang Tấm hồng phấn 45x35.\r\n \r\n🔷 Khi muốn lắp theo thiết kế riêng cho Boss thì cũng nên tham khảo các mẫu ghép chuồng sẵn có trên ảnh sản phẩm để hiểu các cách có thể phối hợp các tấm ghép với nhau. Từ đó có thể thỏa sức sáng tạo chuồng theo mong muốn.\r\nCác miếng ghép bằng lưới sắt, tấm nhựa, tấm cửa có kích thước chuẩn là 45x35 cm và 35x35cm\r\nCó nhiều cách để phối hợp các tấm ghép với nhau, tấm ghép 45x35 để nằm sẽ lắp được rộng hơn\r\n\r\nTuy nhiên, khi muốn tăng chiều cao chuồng chó, có thể cân nhắc, ghép tấm ghép 45x35 theo chiều đứng\r\nHoặc ghép 2 tầng tấm ghép 35x35 để có chiều cao là 70cm, hoặc phối hợp 2 loại tấm ghép 45x35 và 35x35 để có chiều cao 80 cm, hoặc dùng 2 lớp tấm ghép 45x35 lắp chiều đứng để có chiều cao 90cm.\r\nQuý khách hoàn toàn có thể thay thế tấm lưới thép bằng tấm nhựa, các tấm ghép này đã được thiết kế chuẩn để có thể nối ghép dễ dàng với nhau bằng các chốt nối tặng kèm.\r\nQuý khách vui lòng tham khảo số lượng tấm ghép ghi trên hình để tính toán cho riêng mình\r\n\r\n2. TỔNG HỢP SỐ LƯỢNG TỪNG LOẠI MIẾNG GHÉP CHUỒNG CHÓ\r\n\r\nKhi đặt hàng, Quý khách chỉ cần tính toán số lượng tấm ghép, tấm cửa cần đặt. Chốt nối sẽ được tặng kèm, mỗi tấm ghép 2 chốt nối, đủ hoặc thừa (để dự phòng) cho bạn lắp hoặc tùy biến chuồng theo ý thích.\r\nMỗi tấm ghép, cửa là hình vuông 35x35cm hoặc hình chữ nhật 45x35 cm được thiết kế có thể lắp ghép với nhau bằng các chốt nối.\r\n\r\n3.  CHỌN CHUỒNG CHÓ THEO HÌNH CÓ SẴN HAY SÁNG TẠO CỦA RIÊNG MÌNH\r\n\r\n🔷 Khi thấy có mẫu lắp sẵn phù hợp cho Boss thì Quý khách đặt luôn theo số lượng tấm ghép trên ảnh\r\n🔷Khi thấy có mẫu lắp sẵn phù hợp, nhưng muốn thay đổi mầu sắc, thì tính toán tấm ghép cần đổi rồi đặt theo số lượng vừa tính. Ví dụ 1 mẫu có 9 Tấm đen vân 35x35, có thể chọn thay bằng 9 Tấm trắng trong 35x35, hoặc 5 Lưới  thép trắng 35x35 và 4 Tấm đen vân 35x35… (Lưu ý là giá sẽ được tính theo tấm ghép được chọn)\r\n🔷Khi không thấy mẫu phù hợp, Quý khách nên tham khảo cách phối hợp các tấm và kích thước để thiết kế hợp lý. Ví dụ tấm ghép 45x35, nếu để ngang sẽ có chiều rộng là 45cm, cao 35cm. Nếu để đứng thì có chiều rộng  là 35cm và chiều cao là 45cm. \r\n\r\n⚠️ Lưu ý:  Xin chọn đúng và đủ số lượng tấm ghép cần thiết khi đặt hàng', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/d77cb6a2-41c2-45be-83e3-fe9689e812b3.jpg?alt=media', 'Tấm ghép chuồng quây cho thú cưng chó mèo\r\nCác tấm ghép cùng kích thước là có thể thay đổi cho nhau (ví dụ Tấm trắng trong 35x35 có thể đổi sang Tấm đen vân 35x35; Tấm xanh dương 45x35 có thể đổi sang Tấm hồng phấn 45x35.', 'QUÂY CHUỒNG CHÓ, MÈO, TẤM NHỰA TRONG, LƯỚI SẮT, THÉP nhiều màu', 0, 'ACTIVE', '2024-07-14 12:43:26.808829', NULL, 19, 3);
INSERT INTO `product` VALUES (31, '2024-07-14 15:52:41.453499', 'Apple đã trình diện đến người dùng mẫu iPhone 12 128GB với sự tuyên bố về một kỷ nguyên mới của iPhone, nâng cấp về màn hình và hiệu năng hứa hẹn đây sẽ là smartphone cao cấp đáng để mọi người đầu tư sở hữu. \r\nHiệu năng vượt trội, thách thức mọi giới hạn\r\niPhone 12 được trang bị chipset A14 Bionic - bộ xử lý được trang bị lần đầu trên iPad Air 4 vừa cho ra mắt cách đây không lâu, mở đầu xu thế chip 5 nm thương mại trên toàn thế giới.\r\n\r\nTrang bị vi xử lý A14 Bionic | iPhone 12\r\n\r\nApple cho biết A14 Bionic sẽ mạnh hơn gần 40% chipset A13 Bionic, trong đó khả năng xử lý đồ họa nhanh hơn 50% cũng như các tác vụ học máy mượt mà hơn 80% khi so sánh với bộ xử lý tiền nhiệm.\r\n\r\nApple cũng đã hỗ trợ kết nối mạng 5G tốc độ load cực nhanh cho mọi trải nghiệm lướt web, xem phim luôn được ổn định và mượt mà hơn.\r\n\r\nHỗ trợ 5G cho tốc độ load cực nhanh | iPhone 12\r\n\r\niPhone 12 cũng được tích hợp thêm chế độ “Smart Data Mode” cho phép máy tự động phát hiện ứng dụng, các thao tác nào cần nhiều băng thông để kích hoạt 5G. Nếu sử dụng các tác vụ thông thường máy sẽ chuyển sang chế độ 4G LTE phù hợp với từng điều kiện sử dụng, giúp tiết kiệm dữ liệu, hạn chế nóng máy và duy trì thời lượng pin sử dụng cho người dùng.\r\n\r\nĐược trang bị con chip mạnh nhất hiện nay đi kèm với khả năng kết nối mạng 5G giúp điện thoại chơi game mượt mà nay lại mượt mà hơn. Với sự chuyển động trơn tru, tốc độ load nhanh với độ trễ gần như bằng không chắc chắn sẽ đem đến sự hài lòng đến với người dùng.\r\n\r\nHiệu năng mạnh chiến game mượt mà | iPhone 12\r\nNgoài ra, điện thoại có bộ nhớ trong 128 GB cho khả năng lưu trữ mọi dữ liệu như hình ảnh, video hay các ứng dụng. Nếu nhu cầu lưu trữ quá cao bạn có thể tham khảo phiên bản iPhone 12 256GB hoặc có thể lưu trên các tiện ích đám mây.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/fb6d8875-93d6-46c3-8ecd-c13bf8394177.jpeg?alt=media', 'Màn hình\r\n\r\nCông nghệ màn hình:\r\n\r\nOLED\r\nĐộ phân giải:\r\nSuper Retina XDR (1170 x 2532 Pixels)\r\nMàn hình rộng:\r\n\r\n6.1\" - Tần số quét 60 Hz\r\nĐộ sáng tối đa:\r\n1200 nits\r\nMặt kính cảm ứng:\r\n\r\nKính cường lực Ceramic Shield', 'Điện thoại iPhone 12', 0, 'ACTIVE', '2024-07-18 15:39:30.997756', NULL, 15, 3);
INSERT INTO `product` VALUES (32, '2024-07-14 15:58:49.718106', 'Apple thỏa mãn sự chờ đón của iFan và người dùng với sự ra mắt của iPhone 13 series. Dù ngoại hình không có nhiều thay đổi so với iPhone 12 nhưng với cấu hình mạnh mẽ hơn, đặc biệt pin “trâu” hơn và khả năng quay phim chụp ảnh cũng ấn tượng hơn, hứa hẹn mang đến những trải nghiệm thú vị trên phiên bản mới này.\r\nHiệu năng đột phá cùng bộ xử lý Apple A15 Bionic\r\nBộ vi xử lý Apple A15 mới gia tăng tốc độ CPU tới 50% và GPU đồ họa nhanh hơn 30% so với các đối thủ cạnh tranh trong cùng phân khúc, giúp iPhone 13 thể hiện sức mạnh khả năng xử lý ấn tượng hơn, mượt mà trên mọi tác vụ.\r\n\r\nBộ vi xử lý Apple A15 - iPhone 13 256GB\r\n\r\nSo với bản tiền nhiệm, chipset này thể hiện tốc độ CPU cải tiến đến 40% và hiệu năng đồ họa nhảy vọt 80%, trong khi tiết kiệm điện năng hơn đến 15% nhờ được sản xuất trên tiến trình 5 nm cải tiến.\r\n\r\nĐồ họa mượt mà - iPhone 13 256GB\r\n\r\nHơn thế, A15 Bionic còn mang trên mình bộ xử lý hình ảnh ISP mới giúp nâng cao chất lượng ảnh chụp, tự động lấy nét, giảm nhiễu hình ảnh được tốt hơn mà không quá phụ thuộc nhiều vào cảm biến trên máy ảnh.\r\n\r\niPhone 13 có dung lượng bộ nhớ trong 256 GB lý tưởng cho nhu cầu lưu trữ cá nhân, với mọi nội dung theo ý muốn mà không lo nhanh đầy bộ nhớ.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/eb1318f4-4498-49ec-ac8e-e0bebe8d58b3.jpeg?alt=media', 'Màn hình\r\n\r\nCông nghệ màn hình:\r\n\r\nOLED\r\nĐộ phân giải:\r\nSuper Retina XDR (1170 x 2532 Pixels)\r\nMàn hình rộng:\r\n\r\n6.1\" - Tần số quét 60 Hz\r\nĐộ sáng tối đa:\r\n1200 nits\r\nMặt kính cảm ứng:\r\n\r\nKính cường lực Ceramic Shield\r\nCamera sau\r\n\r\nĐộ phân giải:\r\n2 camera 12 MP\r\nQuay phim:\r\n\r\nHD 720p@30fps\r\n\r\nFullHD 1080p@60fps\r\n\r\nFullHD 1080p@30fps\r\n\r\nFullHD 1080p@240fps\r\n\r\nFullHD 1080p@120fps\r\n\r\n4K 2160p@60fps\r\n\r\n4K 2160p@30fps\r\n\r\n4K 2160p@24fps\r\n\r\nĐèn Flash:\r\n\r\nCó\r\nTính năng:\r\n\r\nZoom quang học\r\n\r\nZoom kỹ thuật số\r\n\r\nXóa phông\r\n\r\nTự động lấy nét (AF)\r\n\r\nTrôi nhanh thời gian (Time Lapse)\r\n\r\nToàn cảnh (Panorama)\r\n\r\nSmart HDR 4\r\n\r\nQuay chậm (Slow Motion)\r\n\r\nNhận diện khuôn mặt\r\n\r\nGóc siêu rộng (Ultrawide)\r\n\r\nGóc rộng (Wide)\r\n\r\nDolby Vision HDR\r\n\r\nDeep Fusion\r\n\r\nCinematic\r\n\r\nChống rung quang học (OIS)\r\n\r\nChạm lấy nét\r\n\r\nBan đêm (Night Mode)', 'Điện thoại iPhone 13 256GB', 0, 'ACTIVE', '2024-07-18 15:39:30.997756', NULL, 15, 3);
INSERT INTO `product` VALUES (33, '2024-07-14 16:05:36.863003', 'Sau nhiều thế hệ điện thoại của Apple thì cái tên “Plus” cũng đã chính thức trở lại vào năm 2022 và xuất hiện trên chiếc iPhone 14 Plus 128GB, nổi trội với ngoại hình bắt trend cùng màn hình kích thước lớn để đem đến không gian hiển thị tốt hơn cùng cấu hình mạnh mẽ không đổi so với bản tiêu chuẩn.\r\nThân hình thanh mảnh cùng ngoại hình góc cạnh\r\nGiống như những thế hệ “Plus” trước đây, iPhone 14 Plus vẫn sẽ là phiên bản phóng to từ iPhone 14 với ngôn ngữ thiết kế không đổi, vẫn sẽ là cạnh viền vuông vức đi kèm với mặt lưng phẳng để tạo nên cái nhìn bắt trend và đặc trưng.\r\n\r\nThiết kế thời thượng - iPhone 14 Plus 128GB\r\n\r\nVề phần chế tác thì máy sẽ được bao bọc bởi một bộ khung làm từ nhôm, vừa tối ưu được khối lượng vừa mang đến một độ bền khá tốt. Phần này được làm theo kiểu nhám nhẹ nên cảm giác khi cầm nắm là rất tốt.\r\n\r\nCòn ở mặt lưng thì hãng đã sử dụng hoàn toàn từ kính cường lực, bộ phận này được làm theo kiểu nhẵn bóng nên máy sẽ trở nên rất bắt mắt và mới mẻ, tạo cho mình cảm giác sang trọng hơn khi sử dụng.\r\n\r\nThiết kế thời thượng - iPhone 14 Plus 128GB\r\n\r\nTheo mình thấy thì iPhone 14 Plus mang một cái nhìn rất thanh mảnh bởi độ mỏng của máy nằm ở mức 7.8 mm. Đối với chiều ngang của điện thoại sẽ là 78.1 mm, đây được xem là con số vừa phải chứ không thực sự “quá cỡ” như bao lời đồn đoán.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/c6704574-508c-4d10-a9e9-091b53139a46.jpeg?alt=media', 'Màn hình\r\n\r\nCông nghệ màn hình:\r\n\r\nOLED\r\nĐộ phân giải:\r\nSuper Retina XDR (1284 x 2778 Pixels)\r\nMàn hình rộng:\r\n\r\n6.7\" - Tần số quét 60 Hz\r\nĐộ sáng tối đa:\r\n1200 nits\r\nMặt kính cảm ứng:\r\n\r\nKính cường lực Ceramic Shield\r\nCamera sau\r\n\r\nĐộ phân giải:\r\n2 camera 12 MP\r\nQuay phim:\r\n\r\nHD 720p@30fps\r\n\r\nFullHD 1080p@60fps\r\n\r\nFullHD 1080p@30fps\r\n\r\nFullHD 1080p@25fps\r\n\r\nFullHD 1080p@240fps\r\n\r\nFullHD 1080p@120fps\r\n\r\n4K 2160p@60fps\r\n\r\n4K 2160p@30fps\r\n\r\n4K 2160p@25fps\r\n\r\n4K 2160p@24fps', 'Điện thoại iPhone 14 Plus 128GB', 0, 'ACTIVE', '2024-07-18 15:39:30.997756', NULL, 15, 3);
INSERT INTO `product` VALUES (34, '2024-07-14 16:05:38.427603', 'Sau nhiều thế hệ điện thoại của Apple thì cái tên “Plus” cũng đã chính thức trở lại vào năm 2022 và xuất hiện trên chiếc iPhone 14 Plus 128GB, nổi trội với ngoại hình bắt trend cùng màn hình kích thước lớn để đem đến không gian hiển thị tốt hơn cùng cấu hình mạnh mẽ không đổi so với bản tiêu chuẩn.\r\nThân hình thanh mảnh cùng ngoại hình góc cạnh\r\nGiống như những thế hệ “Plus” trước đây, iPhone 14 Plus vẫn sẽ là phiên bản phóng to từ iPhone 14 với ngôn ngữ thiết kế không đổi, vẫn sẽ là cạnh viền vuông vức đi kèm với mặt lưng phẳng để tạo nên cái nhìn bắt trend và đặc trưng.\r\n\r\nThiết kế thời thượng - iPhone 14 Plus 128GB\r\n\r\nVề phần chế tác thì máy sẽ được bao bọc bởi một bộ khung làm từ nhôm, vừa tối ưu được khối lượng vừa mang đến một độ bền khá tốt. Phần này được làm theo kiểu nhám nhẹ nên cảm giác khi cầm nắm là rất tốt.\r\n\r\nCòn ở mặt lưng thì hãng đã sử dụng hoàn toàn từ kính cường lực, bộ phận này được làm theo kiểu nhẵn bóng nên máy sẽ trở nên rất bắt mắt và mới mẻ, tạo cho mình cảm giác sang trọng hơn khi sử dụng.\r\n\r\nThiết kế thời thượng - iPhone 14 Plus 128GB\r\n\r\nTheo mình thấy thì iPhone 14 Plus mang một cái nhìn rất thanh mảnh bởi độ mỏng của máy nằm ở mức 7.8 mm. Đối với chiều ngang của điện thoại sẽ là 78.1 mm, đây được xem là con số vừa phải chứ không thực sự “quá cỡ” như bao lời đồn đoán.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/21ed7ad5-cd5d-40dd-a682-222f36d401b2.jpeg?alt=media', 'Màn hình\r\n\r\nCông nghệ màn hình:\r\n\r\nOLED\r\nĐộ phân giải:\r\nSuper Retina XDR (1284 x 2778 Pixels)\r\nMàn hình rộng:\r\n\r\n6.7\" - Tần số quét 60 Hz\r\nĐộ sáng tối đa:\r\n1200 nits\r\nMặt kính cảm ứng:\r\n\r\nKính cường lực Ceramic Shield\r\nCamera sau\r\n\r\nĐộ phân giải:\r\n2 camera 12 MP\r\nQuay phim:\r\n\r\nHD 720p@30fps\r\n\r\nFullHD 1080p@60fps\r\n\r\nFullHD 1080p@30fps\r\n\r\nFullHD 1080p@25fps\r\n\r\nFullHD 1080p@240fps\r\n\r\nFullHD 1080p@120fps\r\n\r\n4K 2160p@60fps\r\n\r\n4K 2160p@30fps\r\n\r\n4K 2160p@25fps\r\n\r\n4K 2160p@24fps', 'Điện thoại iPhone 14 Plus 2556GB', 0, 'ACTIVE', '2024-07-18 15:39:30.997756', NULL, 15, 3);
