INSERT INTO `product` VALUES (37, '2024-07-14 16:19:36.160046', 'Vui lòng chọn kích thước phù hợp theo kích thước bồn rửa nhà bếp của bạn.  Nhớ đo chiều cao tủ phía trên bồn rửa để kệ không vừa tủ bếp❤\r\n\r\nGiá đỡ bồn rửa được trang bị một lớp / hai lớp, vui lòng nhấp vào tùy chọn sản phẩm, kích thước của sản phẩm được đính kèm trong hình ảnh.❤\r\n\r\nNếu bạn không biết cách đo, vui lòng liên hệ với bộ phận chăm sóc khách hàng của chúng tôi để được tư e vâng,Cảm ơn bạn nhiều nhé!\r\n\r\n\r\n\r\nKệ Chén Bát Đa Năng  | chất lượng cao\r\n\r\nSức mạnh sản phẩm\r\n\r\n- Được làm bằng thép không gỉ và sơn nướng không dễ rỉ sét\r\n\r\n- Cốc hút đáy làm cho kệ không bị trượt và ổn định hơn\r\n\r\n- Nước sẽ nhỏ giọt vào bồn rửa trong khi sấy khô, giữ cho mặt bàn của bạn khô ráo.\r\n\r\n- Thiết kế khe cắm thẻ đơn giản có thể được điều chỉnh bất cứ lúc nào theo sở thích của bạn', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/a30a4c4b-53e4-45ac-b2de-f8b1929a6ade.jpg?alt=media', 'THÔNG TIN SẢN PHẨM:\r\n\r\n- Chất Liệu: Thép Carbon Chống Han Gỉ\r\n\r\n- Màu Sắc:  Màu đen、trắng\r\n\r\n- Kiểu Dáng: Model mới nhất-Gia cố bên\r\n\r\n- Kích thước sản phẩm:(dữ liệu giống như hình ảnh)\r\n\r\n[65cm 1、2 tầng]: 65*27*56、78cm\r\n\r\n[75cm 1、2 tầng]: 65*27*56、78cm\r\n\r\n[85cm 1、2 tầng]: 85*27*56、78cm\r\n\r\n[95cm 1、2 tầng]: 95*27*56、78cm\r\n\r\n[105cm 1、2 tầng]: 105*27*56、78cm\r\n\r\n[125cm1、 2 tầng]:125*27*56、78cm', '65-125CM Kệ đựng bát đĩa Trên Bồn Rửa Bát Cao Cấp Đa Năng 1/2 Tầng Kệ Để Chén Đĩa Trên Bồn Rửa Bát', 0, 'ACTIVE', '2024-07-14 16:24:06.684174', NULL, 45, 5);
INSERT INTO `product` VALUES (38, '2024-07-14 16:22:04.468494', 'iPhone 14 Pro Max một siêu phẩm trong giới smartphone được nhà Táo tung ra thị trường vào tháng 09/2022. Máy trang bị con chip Apple A16 Bionic vô cùng mạnh mẽ, đi kèm theo đó là thiết kế màn hình mới, hứa hẹn mang lại những trải nghiệm đầy mới mẻ cho người dùng iPhone.\r\nThiết kế cao cấp bền bỉ\r\niPhone năm nay sẽ được thừa hưởng nét đặc trưng từ người anh iPhone 13 Pro Max, vẫn sẽ là khung thép không gỉ và mặt lưng kính cường lực kết hợp với tạo hình vuông vức hiện đại thông qua cách tạo hình phẳng ở các cạnh và phần mặt lưng.\r\n\r\nThiết kế sang trọng - iPhone 14 Pro Max 128GB\r\n\r\nDòng Pro năm nay được ra mắt với nhiều tùy chọn màu sắc và trong đó nổi bật nhất có lẽ là phiên bản Deep Purple (tím), bởi vì đây là một màu mới nên mang lại độ nhận diện khá cao.\r\n\r\nMàu sắc mới mẻ - iPhone 14 Pro Max 128GB\r\n\r\nNổi bật với thiết kế màn hình mới\r\nĐiểm ấn tượng nhất trên iPhone năm nay nằm ở thiết kế màn hình, có thể dễ dàng nhận thấy được là hãng cũng đã loại bỏ cụm tai thỏ truyền thống qua bao đời iPhone bằng một hình dáng mới vô cùng lạ mắt.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/381b769c-2aa4-4cdb-9412-d41600207997.jpg?alt=media', 'Màn hình\r\n\r\nCông nghệ màn hình:\r\n\r\nOLED\r\nĐộ phân giải:\r\nSuper Retina XDR (1290 x 2796 Pixels)\r\nMàn hình rộng:\r\n\r\n6.7\" - Tần số quét 120 Hz\r\nĐộ sáng tối đa:\r\n2000 nits\r\nMặt kính cảm ứng:\r\n\r\nKính cường lực Ceramic Shield\r\nCamera sau\r\n\r\nĐộ phân giải:\r\nChính 48 MP & Phụ 12 MP, 12 MP\r\nQuay phim:\r\n\r\nHD 720p@30fps\r\n\r\nFullHD 1080p@60fps\r\n\r\nFullHD 1080p@30fps\r\n\r\nFullHD 1080p@25fps\r\n\r\nFullHD 1080p@24fps\r\n\r\nFullHD 1080p@240fps\r\n\r\nFullHD 1080p@120fps\r\n\r\n4K 2160p@60fps\r\n\r\n4K 2160p@30fps\r\n\r\n4K 2160p@25fps\r\n\r\n4K 2160p@24fps\r\n\r\nĐèn Flash:\r\n\r\nCó\r\nTính năng:\r\n\r\nẢnh Raw\r\n\r\nZoom quang học\r\n\r\nZoom kỹ thuật số\r\n\r\nXóa phông\r\n\r\nTrôi nhanh thời gian (Time Lapse)\r\n\r\nToàn cảnh (Panorama)\r\n\r\nSmart HDR 4\r\n\r\nSiêu độ phân giải\r\n\r\nSiêu cận (Macro)\r\n\r\nQuay video ProRes\r\n\r\nQuay chậm (Slow Motion)\r\n\r\nLive Photo\r\n\r\nGóc siêu rộng (Ultrawide)\r\n\r\nDolby Vision HDR\r\n\r\nDeep Fusion\r\n\r\nCinematic\r\n\r\nChống rung quang học (OIS)\r\n\r\nChế độ hành động (Action Mode)\r\n\r\nChân dung đêm\r\n\r\nBộ lọc màu\r\n\r\nBan đêm (Night Mode)\r\n\r\nPhotonic Engine', 'Điện thoại iPhone 14 Pro Max 128GB', 0, 'ACTIVE', '2024-07-18 14:35:26.702838', NULL, 15, 3);
INSERT INTO `product` VALUES (39, '2024-07-14 16:22:05.088487', 'iPhone 14 Pro Max một siêu phẩm trong giới smartphone được nhà Táo tung ra thị trường vào tháng 09/2022. Máy trang bị con chip Apple A16 Bionic vô cùng mạnh mẽ, đi kèm theo đó là thiết kế màn hình mới, hứa hẹn mang lại những trải nghiệm đầy mới mẻ cho người dùng iPhone.\r\nThiết kế cao cấp bền bỉ\r\niPhone năm nay sẽ được thừa hưởng nét đặc trưng từ người anh iPhone 13 Pro Max, vẫn sẽ là khung thép không gỉ và mặt lưng kính cường lực kết hợp với tạo hình vuông vức hiện đại thông qua cách tạo hình phẳng ở các cạnh và phần mặt lưng.\r\n\r\nThiết kế sang trọng - iPhone 14 Pro Max 128GB\r\n\r\nDòng Pro năm nay được ra mắt với nhiều tùy chọn màu sắc và trong đó nổi bật nhất có lẽ là phiên bản Deep Purple (tím), bởi vì đây là một màu mới nên mang lại độ nhận diện khá cao.\r\n\r\nMàu sắc mới mẻ - iPhone 14 Pro Max 128GB\r\n\r\nNổi bật với thiết kế màn hình mới\r\nĐiểm ấn tượng nhất trên iPhone năm nay nằm ở thiết kế màn hình, có thể dễ dàng nhận thấy được là hãng cũng đã loại bỏ cụm tai thỏ truyền thống qua bao đời iPhone bằng một hình dáng mới vô cùng lạ mắt.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/db4e594f-5e6b-43fa-bad5-b3abfa27b61a.jpg?alt=media', 'Màn hình\r\n\r\nCông nghệ màn hình:\r\n\r\nOLED\r\nĐộ phân giải:\r\nSuper Retina XDR (1290 x 2796 Pixels)\r\nMàn hình rộng:\r\n\r\n6.7\" - Tần số quét 120 Hz\r\nĐộ sáng tối đa:\r\n2000 nits\r\nMặt kính cảm ứng:\r\n\r\nKính cường lực Ceramic Shield\r\nCamera sau\r\n\r\nĐộ phân giải:\r\nChính 48 MP & Phụ 12 MP, 12 MP\r\nQuay phim:\r\n\r\nHD 720p@30fps\r\n\r\nFullHD 1080p@60fps\r\n\r\nFullHD 1080p@30fps\r\n\r\nFullHD 1080p@25fps\r\n\r\nFullHD 1080p@24fps\r\n\r\nFullHD 1080p@240fps\r\n\r\nFullHD 1080p@120fps\r\n\r\n4K 2160p@60fps\r\n\r\n4K 2160p@30fps\r\n\r\n4K 2160p@25fps\r\n\r\n4K 2160p@24fps\r\n\r\nĐèn Flash:\r\n\r\nCó\r\nTính năng:\r\n\r\nẢnh Raw\r\n\r\nZoom quang học\r\n\r\nZoom kỹ thuật số\r\n\r\nXóa phông\r\n\r\nTrôi nhanh thời gian (Time Lapse)\r\n\r\nToàn cảnh (Panorama)\r\n\r\nSmart HDR 4\r\n\r\nSiêu độ phân giải\r\n\r\nSiêu cận (Macro)\r\n\r\nQuay video ProRes\r\n\r\nQuay chậm (Slow Motion)\r\n\r\nLive Photo\r\n\r\nGóc siêu rộng (Ultrawide)\r\n\r\nDolby Vision HDR\r\n\r\nDeep Fusion\r\n\r\nCinematic\r\n\r\nChống rung quang học (OIS)\r\n\r\nChế độ hành động (Action Mode)\r\n\r\nChân dung đêm\r\n\r\nBộ lọc màu\r\n\r\nBan đêm (Night Mode)\r\n\r\nPhotonic Engine', 'Điện thoại iPhone 14 Pro Max 2556GB', 0, 'ACTIVE', '2024-07-18 14:35:26.702838', NULL, 15, 3);
INSERT INTO `product` VALUES (40, '2024-07-14 16:39:47.560619', 'Thông Tin Sản Phẩm  : Kệ Đựng Đồ Nhà Tắm Dán Tường Hình Chữ Nhật , Kệ Thép Sơn Tĩnh Điện Cao Cấp Không Rỉ Siêu Chắc Mã CNLuoi\r\n-Kích thước Kệ Nhà Tắm：34.5x15.5x15cm(dài x cao x rộng) \r\n\r\n- Chất liệu: Thép Sơn Tĩnh Điện\r\n\r\n- Màu sắc: Đen \r\n\r\n💞Tiện ích: \r\n\r\n- Kệ Dán Tường Siêu Chắc \r\n\r\n- Kệ dán tường là sản phẩm xếp gọn đồ đạc. \r\n\r\n- Sản phẩm được làm bằng thép không gỉ chất lượng cao; thân thiện môi trường. \r\n\r\n- Thiết kế sản phẩm đẹp mắt dạng rãnh nhiều khe hở giúp thoát nước tốt .\r\n\r\n - Kệ dễ dàng lắp đặt bằng cách dán trực tiếp lên tường mà không cần khoan lỗ.\r\n\r\n - Thoát nước nhanh, chứa nhiều vật dụng phòng tắm hơn\r\n\r\n - Chịu lực tốt để những vật nặng như dầu gội, sữa tắm... \r\n\r\n- Thiết kế chắc chắn, tiện dụng, đơn giản không quá cầu kỳ mà lại giúp tiết kiệm không gian phòng tắm.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/bb9ff607-5368-49fb-8069-6f97d7665ede.jpg?alt=media', '💘Hướng dẫn lắp đặt : Chỉ Dán Trên Bề Mặt Gạch Men, Kính, Nhựa\r\n1. Lau sạch vị trí cần lắp \r\n2. Bóc miếng dính dán chặt lên vị trí cần lắp, để chờ trong thời gian 3-4 tiếng\r\n3. Gắn giá vào chốt miếng dín', 'Kệ Đựng Đồ Nhà Tắm Dán Tường Hình Chữ Nhật , Kệ Thép Sơn Tĩnh Điện Cao Cấp Không Rỉ Siêu Chắc Mã CNLuoi', 0, 'ACTIVE', '2024-07-14 16:39:47.560619', NULL, 45, 5);
INSERT INTO `product` VALUES (41, '2024-07-14 16:42:16.788180', 'ĐẶC ĐIỂM NỔI BẬT\r\nThiết kế thời thượng và bền bỉ - Mặt lưng kính được pha màu xu hướng cùng khung viền nhôm bền bỉ\r\nDynamic Island hiển thị linh động mọi thông báo ngay lập tức giúp bạn nắm bắt mọi thông tin\r\nChụp ảnh đẹp nức lòng - Camera chính 48MP, Độ phân giải lên đến 4x và Tele 2x chụp chân dung hoàn hảo\r\nPin dùng cả ngày không lắng lo - Thời gian xem video lên đến 20 giờ và sạc nhanh qua cổng USB-C tiện lợi\r\nCải tiến hiệu năng vượt bậc - A16 Bionic mạnh mẽ giúp bạn cân mọi tác vụ dù có yêu cầu đồ hoạ cao\r\niPhone 15 128GB được trang bị màn hình Dynamic Island kích thước 6.1 inch với công nghệ hiển thị Super Retina XDR màn lại trải nghiệm hình ảnh vượt trội. Điện thoại với mặt lưng kính nhám chống bám mồ hôi cùng 5 phiên bản màu sắc lựa chọn: Hồng, Vàng, Xanh lá, Xanh dương và đen. Camera trên iPhone 15 series cũng được nâng cấp lên cảm biến 48MP cùng tính năng chụp zoom quang học tới 2x. Cùng với thiết kế cổng sạc thay đổi từ lightning sang USB-C vô cùng ấn tượng.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/5821a800-1f96-49ca-a37b-85e4efbf0f87.png?alt=media', 'Thông số kỹ thuật\r\nKích thước màn hình\r\n\r\n6.1 inches\r\nCông nghệ màn hình\r\n\r\nSuper Retina XDR OLED\r\nCamera sau\r\n\r\nChính 48 MP & Phụ 12 MP\r\nCamera trước\r\n\r\n12MP, ƒ/1.9\r\nChipset\r\n\r\nApple A16 Bionic 6 nhân\r\nCông nghệ NFC\r\n\r\nCó\r\nDung lượng RAM\r\n\r\n6 GB\r\nBộ nhớ trong\r\n\r\n128 GB\r\nPin\r\n\r\n3349 mAh\r\nThẻ SIM\r\n\r\n2 SIM (nano‑SIM và eSIM)\r\nHệ điều hành\r\n\r\niOS 17\r\nĐộ phân giải màn hình\r\n\r\n2556 x 1179 pixels', 'iPhone 15 128GB', 0, 'ACTIVE', '2024-07-17 17:31:43.835572', NULL, 15, 3);
