INSERT INTO `product` VALUES (44, '2024-07-14 16:42:17.739309', 'ĐẶC ĐIỂM NỔI BẬT\r\nThiết kế thời thượng và bền bỉ - Mặt lưng kính được pha màu xu hướng cùng khung viền nhôm bền bỉ\r\nDynamic Island hiển thị linh động mọi thông báo ngay lập tức giúp bạn nắm bắt mọi thông tin\r\nChụp ảnh đẹp nức lòng - Camera chính 48MP, Độ phân giải lên đến 4x và Tele 2x chụp chân dung hoàn hảo\r\nPin dùng cả ngày không lắng lo - Thời gian xem video lên đến 20 giờ và sạc nhanh qua cổng USB-C tiện lợi\r\nCải tiến hiệu năng vượt bậc - A16 Bionic mạnh mẽ giúp bạn cân mọi tác vụ dù có yêu cầu đồ hoạ cao\r\niPhone 15 128GB được trang bị màn hình Dynamic Island kích thước 6.1 inch với công nghệ hiển thị Super Retina XDR màn lại trải nghiệm hình ảnh vượt trội. Điện thoại với mặt lưng kính nhám chống bám mồ hôi cùng 5 phiên bản màu sắc lựa chọn: Hồng, Vàng, Xanh lá, Xanh dương và đen. Camera trên iPhone 15 series cũng được nâng cấp lên cảm biến 48MP cùng tính năng chụp zoom quang học tới 2x. Cùng với thiết kế cổng sạc thay đổi từ lightning sang USB-C vô cùng ấn tượng.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/31d48203-79a6-416c-b4a3-59c4a3d2429d.png?alt=media', 'Thông số kỹ thuật\r\nKích thước màn hình\r\n\r\n6.1 inches\r\nCông nghệ màn hình\r\n\r\nSuper Retina XDR OLED\r\nCamera sau\r\n\r\nChính 48 MP & Phụ 12 MP\r\nCamera trước\r\n\r\n12MP, ƒ/1.9\r\nChipset\r\n\r\nApple A16 Bionic 6 nhân\r\nCông nghệ NFC\r\n\r\nCó\r\nDung lượng RAM\r\n\r\n6 GB\r\nBộ nhớ trong\r\n\r\n128 GB\r\nPin\r\n\r\n3349 mAh\r\nThẻ SIM\r\n\r\n2 SIM (nano‑SIM và eSIM)\r\nHệ điều hành\r\n\r\niOS 17\r\nĐộ phân giải màn hình\r\n\r\n2556 x 1179 pixels', 'iPhone 15 1T', 0, 'ACTIVE', '2024-07-14 16:42:17.739309', NULL, 15, 3);
INSERT INTO `product` VALUES (45, '2024-07-14 16:43:25.806998', 'TÍNH NĂNG SẢN PHẨM:\r\n\r\n- Sản phẩm có thiết kế hiện đại, sang trọng\r\n\r\n- Sản phẩm có tính năng sử dụng đa mục đích: Kệ nhà tắm, kệ nhà bếp, nhà vệ sinh…\r\n\r\n- Thiết kế sản phẩm thông minh, bề mặt có lỗ thoát nước giúp nước không bị ứ đọng trên bề mặt\r\n\r\n- Treo tường không cần khoan sử dụng miếng dán cường lực siêu chắc\r\n\r\n- Thanh treo inox tiện lợi sử dụng đa mục đích như treo khăn mặt, khăn tắm, khăn lau…', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/704e63c0-5e3b-4514-aab0-3df80e626c9f.jpg?alt=media', 'THÔNG TIN SẢN PHẨM :\r\n\r\nKệ nhà tắm, kệ nhà bếp đa năng cao cấp\r\n\r\n– Thương hiệu: Ecoco\r\n\r\n– Chất liệu: Chất liệu: Nhựa ABS, PP, thanh inox\r\n\r\n– Kích thước: dài 42cm, rộng 12cm, cao 5,5cm\r\n\r\n– Màu sắc: Xám , Đen', 'Kệ Nhà Tắm Để Đồ ECOCO Đa Năng, Kệ Ngang Không Có Thanh Treo Không Cần Khoan Tường', 0, 'ACTIVE', '2024-07-14 16:43:25.806998', NULL, 45, 5);
INSERT INTO `product` VALUES (46, '2024-07-14 16:43:45.103373', 'MTXT HP Pavilion 14-dv2070TU 7C0V9PA (Core i3 1215U/ 8GB/ 256GB SSD/ Intel UHD Graphics/ 14.0inch Full HD/ Windows 11 Home/ Silver)', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/d2bcc68c-5f1e-4c8d-921a-be4c48864a92.jpeg?alt=media', 'Đặc điểm nổi bật\r\nHP Pavilion 14-dv2070TU 7C0V9PA sở hữu thiết kế cuốn hút, sang trọng và tinh tế thu hút người dùng từ cái nhìn đầu tiên. Bên cạnh thiết kế đẹp, Pavilion 14-dv2070TU 7C0V9PA còn đem đến hiệu năng mạnh mẽ đáp ứng tốt mọi nhu cầu từ xem phim, lướt web đến làm việc văn phòng và chơi các tựa game nhẹ nhàng.\r\n\r\n\r\n\r\nMáy tính HP Pavilion 14-dv2070TU 7C0V9PA\r\n\r\nThiết kế HP Pavilion 14-dv2070TU 7C0V9PA thanh lịch, sang trọng và cao cấp\r\n\r\n\r\n\r\nThiết kế Pavilion 14-dv2070TU 7C0V9PA\r\n\r\nHP Pavilion 14-dv2070TU 7C0V9PA khoác trên mình bộ cánh khiến nhiều đối thủ cùng phân khúc phải thèm thuồng. Máy được hoàn thiện từ hợp kim nhôm nguyên khối, kết hợp màu bạc - Silver đem đến vẻ đẹp vừa thanh lịch vừa sang trọng. Pavilion 14-dv2070TU 7C0V9PA chỉ nặng 1,4 kg và có kích thước 32.5 x 21.66 x 1.7 cm khá nhỏ gọn giúp người dùng có thể đem theo mọi lúc mọi nơi, đi học, đi làm đều rất thuận tiện.\r\n\r\nMàn hình 14 inch sắc nét', 'MTXT HP Pavilion 14-dv2070TU 7C0V9PA ( Intel UHD Graphics/ 14.0inch Full HD/ Windows 11 Home/ Silver)', 0, 'ACTIVE', '2024-07-14 16:43:45.103373', NULL, 48, 6);
INSERT INTO `product` VALUES (47, '2024-07-14 16:47:08.816375', '_ Kính chào quý khách hàng đến với New Home, điểm đến đáng tin cậy cho mọi nhu cầu về thiết bị gia dụng. Tại New Home, chúng tôi hiểu tầm quan trọng của một ngôi nhà thoải mái, tiện nghi và phản ánh phong cách sống của bạn. Đó là lý do tại sao chúng tôi tỉ mỉ tuyển chọn một loạt các sản phẩm gia dụng cao cấp từ các thương hiệu uy tín nhất trên thị trường.\r\n_ Với đội ngũ chuyên gia am hiểu và tận tâm, chúng tôi tin rằng mọi ngôi nhà đều là duy nhất và xứng đáng được trang bị những sản phẩm chất lượng cao nhất. New Home cam kết cung cấp các sản phẩm đáng tin cậy, dịch vụ khách hàng chu đáo và sự đổi mới liên tục. Khám phá bộ sưu tập thiết bị gia dụng của chúng tôi ngay hôm nay và bắt đầu tạo nên ngôi nhà mơ ước của bạn cùng New Home!\r\n\r\nƯU ĐIỂM SẢN PHẨM\r\n- Khăn lau sử dụng công nghệ dệt lưới kim cương tiên tiến và chất liệu dây kim loại chất lượng cao, dễ dàng loại bỏ rỉ sét, vết dầu, nấm mốc cứng đầu, v.v.\r\n- Giẻ rửa bát thiết kế lỗ mịn đa năng khô và ướt làm cho nó đầy bọt, bạn có thể làm ướt nó, được sử dụng để làm sạch hiệu quả bộ đồ ăn, chậu, v.v., \r\n- Khăn dạng lưới nhanh khô do thiết kế bề mặt vải lưới vảy cá, nó có thể hút ẩm ngay lập tức, khô nhanh chóng và dễ dàng làm sạch\r\n- Kích thước nhỏ, sử dụng lớn, sau khi sử dụng có thể treo tường, tiết kiệm không gian bếp và dễ thoát nước, có thể đi sâu vào hộp đựng, dễ dàng làm sạch bụi bẩn, ngay cả miệng chai nhỏ có thể dễ dàng làm sạch.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/4ab5c4f7-f000-4eff-87a6-5dfbe55a696f.jpg?alt=media', 'THÔNG TIN SẢN PHẨM:\r\n- Tên sản phẩm: Khăn dây kim loại lau bát đĩa, rửa chén bát, cọ xoong nồi đa năng\r\n- Chất liệu: PVA\r\n- Kích thước: 20 * 20cm\r\n- Thiết kế: lưới đồng đều, Máy chà sàn không nhờn, không trầy xước', 'Set 10 Khăn Rửa Chén Dây Kim Loại Đa Năng Chà Bồn Rửa Bát - Cọ Rửa Xoong Nồi Không Mài Mòn', 0, 'ACTIVE', '2024-07-14 16:47:08.816375', NULL, 45, 5);
INSERT INTO `product` VALUES (48, '2024-07-14 16:49:30.061417', 'Tặng Túi/Balo\r\n  Nhập mã VTS120K giảm 10% tối đa 120000 cho đơn hàng từ 1 triệu khi khách hàng tải ví VNPAY mới và thanh toán qua VNPAY-QR\r\n  Giảm 50% tối đa 100.000đ cho giá trị giao dịch đầu tiên của khách hàng mới khi thanh toán qua Kredivo hoặc Giảm 5% tối đa 200.000đ trên giá trị giao dịch trả góp kỳ hạn 6 hoặc 12 tháng (Giá trị giao dịch trả góp tối thiểu 700.000đ) qua Kredivo\r\n  Phụ kiện giảm giá đến 35% khi mua cùng\r\n  Giảm 20% tối đa 500k khi mở thẻ tín dụng TPBANK EVO, Chi tiết TẠI ĐÂY\r\n  Giảm giá 50% Sim số đẹp (không quá 200k) và ưu đãi mua bảo hiểm rơi vỡ thiết bị di động giảm 35% (chỉ từ 165k), Bảo hành mở rộng chỉ từ 500đ/ngày', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/f42dc96f-aac5-4712-ac83-fd8fd03681c9.jpeg?alt=media', 'Chi tiết thông số kỹ thuật\r\nThông tin hàng hóa\r\nHướng dẫn bảo quản, cảnh báo	Để nơi khô ráo, nhẹ tay, dễ vỡ, cảnh báo cháy nổ\r\nHãng	HP\r\nNhà cung cấp	FPT, DGW\r\nHướng dẫn sử dụng	Xem trong sách hướng dẫn sử dụng\r\nNơi sản xuất	Trung Quốc\r\nNăm ra mắt	Trên hộp máy (Đi kèm sản phẩm)\r\nBộ vi xử lý\r\nLoại CPU	Core i5\r\nCông nghệ CPU	Core i5 Raptor Lake\r\nTốc độ CPU	1.3GHz Up to 4.6 GHz\r\nBộ nhớ đệm	12Mb Cache\r\nBộ nhớ Ram, Ổ cứng\r\nSố Slot RAM	2\r\nCông nghệ RAM	DDR4\r\nDung lượng	512GB\r\nTốc độ bus RAM	3200\r\nMàn hình\r\nKích thước màn hình	15.6inch Full HD\r\nĐộ phân giải	1920x1080\r\nPin\r\nPin	3 cell\r\nCông suất bộ sạc	41 Wh\r\nKết nối\r\nCổng giao tiếp	1 SuperSpeed USB Type-C® 5Gbps signaling rate; 2 SuperSpeed USB Type-A 5Gbps signaling rate; 1 HDMI 1.4b; 1 AC smart pin; 1 headphone/microphone combo\r\nKết nối không dây	Realtek RTL8822CE 802.11a/b/g/n/ac (2x2) Wi-Fi 6 (2x2) and Bluetooth 5.3', 'MTXT HP 15-fd0237TU ,Core i5-1334U,8GB RAM,512GB SSD', 0, 'ACTIVE', '2024-07-14 16:49:30.061417', NULL, 48, 6);
INSERT INTO `product` VALUES (49, '2024-07-14 16:55:05.221013', 'Bộ sản phẩm bao gồm:\r\n\r\n* 01 Điện Thoại Samsung Galaxy A55 (8GB/128GB) trị giá 9,990,000\r\n\r\n* 01 Sạc 25W trị giá 550,000\r\n\r\n* 01 Thẻ game trị giá 500,000', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/c58a8abb-beac-465b-96c4-564e88a21fa5.jpg?alt=media', 'Bộ sản phẩm bao gồm:\r\n\r\n* 01 Điện Thoại Samsung Galaxy A55 (8GB/128GB) trị giá 9,990,000\r\n\r\n* 01 Sạc 25W trị giá 550,000\r\n\r\n* 01 Thẻ game trị giá 500,000', 'Điện Thoại Samsung Galaxy A55 (8GB/128GB)', 0, 'ACTIVE', '2024-07-14 16:55:05.221013', NULL, 16, 3);
INSERT INTO `product` VALUES (50, '2024-07-14 16:55:05.359253', 'Bộ sản phẩm bao gồm:\r\n\r\n* 01 Điện Thoại Samsung Galaxy A55 (8GB/128GB) trị giá 9,990,000\r\n\r\n* 01 Sạc 25W trị giá 550,000\r\n\r\n* 01 Thẻ game trị giá 500,000', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/8c032f53-30bd-4a52-b17f-f565ed7757c8.jpg?alt=media', 'Bộ sản phẩm bao gồm:\r\n\r\n* 01 Điện Thoại Samsung Galaxy A55 (8GB/128GB) trị giá 9,990,000\r\n\r\n* 01 Sạc 25W trị giá 550,000\r\n\r\n* 01 Thẻ game trị giá 500,000', 'Điện Thoại Samsung Galaxy A55 (8GB/256GB)', 0, 'ACTIVE', '2024-07-14 16:55:05.359253', NULL, 16, 3);
INSERT INTO `product` VALUES (51, '2024-07-14 16:58:12.095328', 'Đặc điểm nổi bật\r\n\r\nBàn phím wireless thiết kế mỏng gọn, thời trang.\r\nPhím in laser nổi bật, bền màu, bàn phím có 79 phím cơ bản.\r\nChuột dạng Ergonomic, di chuyển chính xác với độ nhạy 1300 DPI.\r\nKết nối không dây qua Bluetooth 3.0, 4.0 và USB Receiver (đầu thu USB) 2.4 GHz ở khoảng cách đến 10 m. \r\nChuột dùng siêu êm, không có tiếng click khi nhấn phím trái - phải. \r\nDễ dàng kết nối và chuyển đổi giữa nhiều thiết bị.\r\nThời lượng sử dụng pin tốt với 12 tháng trên bàn phím và 9 tháng trên chuột.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/c673c3ee-6fc9-4344-bb51-2054a5aef0c0.jpeg?alt=media', 'Video giới thiệu Bộ bàn phím và chuột không dây Rapoo 8000M:\r\n\r\nBộ bàn phím và chuột không dây Rapoo tương thích tốt với các laptop, PC hệ điều hành Windows, MacOS (MacBook, iMac)\r\nTương thích Windows, MacOS - Bộ Bàn Phím Chuột Không Dây Rapoo 8000M\r\n\r\nThiết kế gọn gàng, trẻ trung, sang đẹp\r\nBàn phím Rapoo không dây gọn kích thước gọn gàng, các cạnh bo viền mềm mại, phím bấm vuông vức tinh tế chất liệu nhựa bền tốt với chữ in laser nổi bật, không bị làm mờ khi sử dụng trong thời gian dài. Thiết kế bảo vệ an toàn tối ưu cho các bo mạch, không lo hư hại trong các tình huống vô tình làm tràn nước, để bạn thoải mái vừa làm việc vừa thưởng thức cà phê hay các thức uống yêu thích.\r\n\r\nChuột không dây thiết kế Ergonomic vừa vặn tay cầm, thoải mái với cổ tay để không gây mỏi khi dùng lâu, kiểu dáng chuột mỏng gọn, mềm mại rất trẻ trung, đẹp mắt, tô điểm hiệu quả cho không gian bàn làm việc.', 'Bộ Bàn Phím Chuột Không Dây Bluetooth Rapoo 8000M', 0, 'ACTIVE', '2024-07-14 16:58:12.095328', NULL, 47, 6);
INSERT INTO `product` VALUES (52, '2024-07-14 17:10:19.584851', 'Nếu bạn quan tâm đến chiếc điện thoại Samsung Galaxy A05 4GB/64GB được bảo hành 12 tháng chính hãng có thể ghé ngay Đức Huy Mobile mua với giá cam kết rẻ nhất thị trường, ưu đãi trả góp 0%, thu cũ đổi mới lên Galaxy A05 4GB/64GB cực tiết kiệm.\r\n\r\nNgoại hình Samsung Galaxy A05 4GB/64GB trẻ trung\r\nVề thiết kế, mẫu smartphone Samsung Galaxy A05 4GB/64GB có ngôn ngữ thiết kế tương tự sản phẩm Galaxy A05s giá rẻ với thiết kế nguyên khối, mặt lưng nhựa được phủ nhám giúp hạn chế tình trạng bám vân tay và mô hôi.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/be2d671b-e629-45f0-9461-df3a42eca714.jpg?alt=media', 'Camera Samsung Galaxy A05 4GB/64GB tốt trong tầm giá\r\nVề khả năng chụp ảnh, chiếc smartphone Samsung Galaxy A05 4GB/64GB giá rẻ sở hữu 2 camera với cảm biến chính độ phân giải 50MP + camera phụ có độ phân giải 2MP đáp ứng nhu cầu chụp ảnh cơ bản của người dùng. Và camera của máy hỗ trợ quay video chuẩn FullHD 1080p@60fps.\r\n\r\nCấu hình Samsung Galaxy A05 4GB/64GB ấn tượng\r\nCung cấp sức mạnh cho chiếc điện thoại Samsung Galaxy A05 4GB/64GB giá rẻ là vi xử lý MediaTek Helio G85 8 nhân cho tốc độ xung nhịp tối đa 2.0 GHz cho hiệu năng mạnh hơn người tiền nhiệm Galaxy A04, chipset này được hỗ trợ bởi đồ họa GPU Mali-G52, thanh RAM 4GB, bộ nhớ trong lưu trữ ROM 64GB có hỗ trợ thẻ nhớ MicroSD mở rộng tối đa 1 TB.', 'Điện Thoại Samsung Galaxy A05 256GB', 0, 'ACTIVE', '2024-07-18 14:35:26.702838', NULL, 16, 3);
