INSERT INTO `product` VALUES (55, '2024-07-14 17:15:43.067935', 'Chuột Không dây DareU LM106G gọn nhẹ, dễ sử dụng, kết nối nhanh chóng, tương thích nhiều thiết bị.\r\n• Đường nét mềm mại, độ hoàn thiện cao, chuột vừa vặn và êm tay khi sử dụng.\r\n\r\n• Màu sắc thông dụng, phù hợp với mọi người dùng.\r\n\r\n• Chuột DareU được thiết kế đối xứng 2 bên, tay trái hay tay phải sử dụng đều thuận.\r\n\r\n• Phím bấm có độ nảy tốt, con lăn chuột mềm mại, thoải mái thực hiện các thao tác di chuột trên mặt phẳng.\r\n\r\n• Kết nối chuột và thiết bị sử dụng hệ điều hành Windows, macOS nhanh chóng bằng đầu thu USB Receiver.\r\n\r\n• Sản phẩm tương thích với các dòng máy sử dụng hệ điều hành Windows, macOS.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/b408dcad-5b5a-43a4-a537-bdcd0c2091da.jpg?alt=media', 'Chuột Không dây DareU LM106G gọn nhẹ, dễ sử dụng, kết nối nhanh chóng, tương thích nhiều thiết bị.\r\n• Đường nét mềm mại, độ hoàn thiện cao, chuột vừa vặn và êm tay khi sử dụng.\r\n\r\n• Màu sắc thông dụng, phù hợp với mọi người dùng.\r\n\r\n• Chuột DareU được thiết kế đối xứng 2 bên, tay trái hay tay phải sử dụng đều thuận.\r\n\r\n• Phím bấm có độ nảy tốt, con lăn chuột mềm mại, thoải mái thực hiện các thao tác di chuột trên mặt phẳng.\r\n\r\n• Kết nối chuột và thiết bị sử dụng hệ điều hành Windows, macOS nhanh chóng bằng đầu thu USB Receiver.\r\n\r\n• Sản phẩm tương thích với các dòng máy sử dụng hệ điều hành Windows, macOS.', 'Chuột Không dây DareU LM106G', 0, 'ACTIVE', '2024-07-14 17:15:43.067935', NULL, 47, 6);
INSERT INTO `product` VALUES (56, '2024-07-14 17:17:13.504379', 'Samsung Galaxy A05s 6GB được cho ra mắt tại thị trường Việt Nam vào hồi tháng 09/2023. Máy gây chú ý nhờ sở hữu mức giá bán hợp lý, cấu hình ổn với chip Snapdragon 680 8 nhân và hệ thống camera chất lượng đến 50 MP.\r\nThiết kế thanh mảnh, sang trọng\r\nGalaxy A05s 6GB lấy cảm hứng thiết kế từ các phiên bản flagship như Galaxy S23, với một diện mạo vuông vắn và tinh tế. Cụm camera được đặt theo kiểu của các phiên bản cao cấp, tạo nên sự gọn gàng và bố cục hài hòa ở mặt lưng.\r\n\r\nVẻ ngoài thanh lịch - Samsung Galaxy A05s\r\n\r\nMặt lưng của máy được làm nhám và thiết kế cụm camera trên Galaxy A05s 6GB được tối giản với 3 ống kính được bố trí riêng lẻ. Viền kim loại nhô cao được sử dụng để bảo vệ mặt kính camera, giảm nguy cơ trầy xước khi đặt điện thoại xuống các bề mặt phẳng.\r\n\r\nVẻ ngoài cuốn hút - Samsung Galaxy A05s\r\n\r\nKhi sử dụng ngoài trời trong một khoảng thời gian, mình thấy rằng tay của mình bắt đầu đổ mồ hôi. Tuy nhiên, nhờ vào thiết kế nhám ở mặt lưng, mình không gặp vấn đề này và đồng thời cảm thấy rất chắc chắn khi cầm nắm. Điều này giúp máy luôn giữ được vẻ sáng bóng dù đã sử dụng trong thời gian dài.\r\n\r\nMặc dù vậy, do máy sở hữu viên pin khá lớn, nên khối lượng của máy lên đến khoảng 194 g, nên việc cầm nắm trở nên khá đầm tay và có chút mỏi khi sử dụng trong thời gian dài.\r\n\r\nMặt lưng sáng bóng - Samsung Galaxy A05s\r\n\r\nỞ phía trước, Samsung áp dụng thiết kế màn hình dạng giọt nước cho Galaxy A05s 6GB, với các cạnh viền được tối ưu khá mỏng và cân đối. Mặc dù phần viền dưới hơi dày một chút, nhưng không ảnh hưởng đáng kể đến trải nghiệm xem.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/3bb8bc8b-b11b-4a4a-a4d0-66fcf58cac2a.jpg?alt=media', 'Màn hình\r\n\r\nCông nghệ màn hình:\r\n\r\nPLS LCD\r\nĐộ phân giải:\r\nFull HD+ (1080 x 2400 Pixels)\r\nMàn hình rộng:\r\n\r\n6.7\" - Tần số quét 90 Hz\r\nĐộ sáng tối đa:\r\n500 nits\r\nMặt kính cảm ứng:\r\n\r\nKính cường lực\r\nCamera sau\r\n\r\nĐộ phân giải:\r\nChính 50 MP & Phụ 2 MP, 2 MP\r\nQuay phim:\r\n\r\nHD 720p@120fps\r\n\r\nFullHD 1080p@60fps\r\n\r\nFullHD 1080p@30fps\r\n\r\nĐèn Flash:\r\n\r\nCó\r\nTính năng:\r\n\r\nZoom quang học\r\n\r\nZoom kỹ thuật số\r\n\r\nXóa phông\r\n\r\nTự động lấy nét (AF)\r\n\r\nTrôi nhanh thời gian (Time Lapse)\r\n\r\nToàn cảnh (Panorama)\r\n\r\nSiêu cận (Macro)\r\n\r\nQuay chậm (Slow Motion)\r\n\r\nLàm đẹp\r\n\r\nHDR\r\n\r\nChụp hẹn giờ\r\n\r\nChuyên nghiệp (Pro)\r\n\r\nBộ lọc màu\r\n\r\nBan đêm (Night Mode)', 'Điện thoại Samsung Galaxy A05s 6GB/128GB', 0, 'ACTIVE', '2024-07-18 14:35:26.702838', NULL, 16, 3);
INSERT INTO `product` VALUES (57, '2024-07-14 17:17:13.504379', 'Samsung Galaxy A05s 6GB được cho ra mắt tại thị trường Việt Nam vào hồi tháng 09/2023. Máy gây chú ý nhờ sở hữu mức giá bán hợp lý, cấu hình ổn với chip Snapdragon 680 8 nhân và hệ thống camera chất lượng đến 50 MP.\r\nThiết kế thanh mảnh, sang trọng\r\nGalaxy A05s 6GB lấy cảm hứng thiết kế từ các phiên bản flagship như Galaxy S23, với một diện mạo vuông vắn và tinh tế. Cụm camera được đặt theo kiểu của các phiên bản cao cấp, tạo nên sự gọn gàng và bố cục hài hòa ở mặt lưng.\r\n\r\nVẻ ngoài thanh lịch - Samsung Galaxy A05s\r\n\r\nMặt lưng của máy được làm nhám và thiết kế cụm camera trên Galaxy A05s 6GB được tối giản với 3 ống kính được bố trí riêng lẻ. Viền kim loại nhô cao được sử dụng để bảo vệ mặt kính camera, giảm nguy cơ trầy xước khi đặt điện thoại xuống các bề mặt phẳng.\r\n\r\nVẻ ngoài cuốn hút - Samsung Galaxy A05s\r\n\r\nKhi sử dụng ngoài trời trong một khoảng thời gian, mình thấy rằng tay của mình bắt đầu đổ mồ hôi. Tuy nhiên, nhờ vào thiết kế nhám ở mặt lưng, mình không gặp vấn đề này và đồng thời cảm thấy rất chắc chắn khi cầm nắm. Điều này giúp máy luôn giữ được vẻ sáng bóng dù đã sử dụng trong thời gian dài.\r\n\r\nMặc dù vậy, do máy sở hữu viên pin khá lớn, nên khối lượng của máy lên đến khoảng 194 g, nên việc cầm nắm trở nên khá đầm tay và có chút mỏi khi sử dụng trong thời gian dài.\r\n\r\nMặt lưng sáng bóng - Samsung Galaxy A05s\r\n\r\nỞ phía trước, Samsung áp dụng thiết kế màn hình dạng giọt nước cho Galaxy A05s 6GB, với các cạnh viền được tối ưu khá mỏng và cân đối. Mặc dù phần viền dưới hơi dày một chút, nhưng không ảnh hưởng đáng kể đến trải nghiệm xem.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/a6c46c40-f3ef-43e1-b075-51d37ea9f4d0.jpg?alt=media', 'Màn hình\r\n\r\nCông nghệ màn hình:\r\n\r\nPLS LCD\r\nĐộ phân giải:\r\nFull HD+ (1080 x 2400 Pixels)\r\nMàn hình rộng:\r\n\r\n6.7\" - Tần số quét 90 Hz\r\nĐộ sáng tối đa:\r\n500 nits\r\nMặt kính cảm ứng:\r\n\r\nKính cường lực\r\nCamera sau\r\n\r\nĐộ phân giải:\r\nChính 50 MP & Phụ 2 MP, 2 MP\r\nQuay phim:\r\n\r\nHD 720p@120fps\r\n\r\nFullHD 1080p@60fps\r\n\r\nFullHD 1080p@30fps\r\n\r\nĐèn Flash:\r\n\r\nCó\r\nTính năng:\r\n\r\nZoom quang học\r\n\r\nZoom kỹ thuật số\r\n\r\nXóa phông\r\n\r\nTự động lấy nét (AF)\r\n\r\nTrôi nhanh thời gian (Time Lapse)\r\n\r\nToàn cảnh (Panorama)\r\n\r\nSiêu cận (Macro)\r\n\r\nQuay chậm (Slow Motion)\r\n\r\nLàm đẹp\r\n\r\nHDR\r\n\r\nChụp hẹn giờ\r\n\r\nChuyên nghiệp (Pro)\r\n\r\nBộ lọc màu\r\n\r\nBan đêm (Night Mode)', 'Điện thoại Samsung Galaxy A05s 256GB', 0, 'ACTIVE', '2024-07-18 14:35:26.702838', NULL, 16, 3);
