INSERT INTO `product` VALUES (60, '2024-07-14 17:18:39.235035', 'Lắp được cho những mẫu đồng hồ thời trang có dây 16 mm.\r\nChất liệu da tổng hợp có bề mặt mềm mại, dễ bảo quản.\r\nThiết kế thanh lịch, kết cấu tỉ mỉ và có màu nâu sang trọng.\r\nDây đồng hồ vẫn dùng loại khóa kim gài chắc chắn.\r\nViệc tháo lắp dây đồng hồ rất đơn giản. Xem thêm cách lắp dây da.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/23eb7b38-1f31-4bfb-92e4-845c69bbbf49.jpg?alt=media', 'Thông số kỹ thuật Dây da đồng hồ 16mm G027 Nâu\r\n\r\nLoại dây\r\n\r\nDây đồng hồ thời trang\r\nĐộ rộng dây\r\n\r\n16 mm\r\nChất liệu dây\r\n\r\nDây da tổng hợp\r\nMàu dây\r\n\r\nNâu', 'Dây da đồng hồ 16mm G027', 0, 'ACTIVE', '2024-07-14 17:18:39.235035', NULL, 49, 6);
INSERT INTO `product` VALUES (61, '2024-07-14 17:34:08.785718', 'Đặc điểm nổi bật\r\n\r\nỐp lưng dạng trong phủ màu Rainbow đa sắc tuyệt đẹp, thời thượng.\r\nCác đường cắt dứt khoát cho thiết kế tinh xảo, trải nghiệm liền mạch như khi không có ốp lưng.\r\nBảo vệ iPhone 13 Pro hiệu quả với thiết kế vừa khít, ôm sát.\r\nChất liệu kính viền dẻo bóng sáng, ít bám bẩn, dễ vệ sinh và tháo lắp.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/4605ba30-97d2-4b1f-b85d-559310f768d9.jpg?alt=media', 'Đặc điểm nổi bật\r\n\r\nỐp lưng dạng trong phủ màu Rainbow đa sắc tuyệt đẹp, thời thượng.\r\nCác đường cắt dứt khoát cho thiết kế tinh xảo, trải nghiệm liền mạch như khi không có ốp lưng.\r\nBảo vệ iPhone 13 Pro hiệu quả với thiết kế vừa khít, ôm sát.\r\nChất liệu kính viền dẻo bóng sáng, ít bám bẩn, dễ vệ sinh và tháo lắp.', 'Ốp lưng iPhone 13 Pro Kính viền dẻo Rainbow OSMIA', 0, 'ACTIVE', '2024-07-14 17:34:08.785718', NULL, 49, 6);
INSERT INTO `product` VALUES (62, '2024-07-14 17:35:48.781780', 'CÔNG DỤNG SẢN PHẨM\r\n- Mạch sử dụng ở vùng núi, biển.. những nơi xa xôi không có điện lưới để xài tivi, đèn, loa...\r\n- Mạch sử dụng cho những thiết bị như: quạt, bóng đèn, tivi, sạc điện thoại.\r\n- Mạch chạy cùng biến áp 12/220\r\n- Mạch có công suất khuyên dùng liên tục là 50W, trong trường hợp bạn muốn sử dụng cho công suất lớn hơn cỡ 300W thì nên gắn thêm quạt tản nhiệt vào nhôm.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/8a638f59-5725-4895-8e46-7de87aca8bb7.jpg?alt=media', 'Mạch inverter 12V lên 220V DC công suất liên tục 50W - linh kiện tháo UPS TG500 - mạch in chất lượng - khó hư hỏng\r\nTính năng chung:\r\n- Mạch được thiết kế lại tối giản sử dụng linh kiện từ UPS TG500.\r\n- Mạch có công suất khuyên dùng liên tục là 50W, trong trường hợp bạn muốn sử dụng cho công suất lớn hơn cỡ 300W thì nên gắn thêm quạt tản nhiệt vào nhôm.\r\n- Mạch có diode ngõ vào chống ngược cực nên cắm nhầm cọc không bị sao.\r\nỨng dụng:\r\n- Mạch sử dụng ở vùng núi, biển.. những nơi xa xôi không có điện lưới để xài tivi, đèn, loa...\r\n- Mạch chỉ sử dụng cho những thiết bị tải trở, ngõ vào mạch nguồn của thiết bị là mạch điện tử.\r\n- Mạch không sử dụng cho thiết bị cuộn dây như: quạt, biến áp, bơm...', 'Mạch inverter 12V lên 220V DC công suất liên tục 50W - linh kiện tháo UPS TG500 - mạch in chất lượng - khó hư hỏng', 0, 'ACTIVE', '2024-07-14 17:35:48.781780', NULL, 52, 5);
INSERT INTO `product` VALUES (63, '2024-07-14 17:37:03.374745', 'ĐẶC ĐIỂM NỔI BẬT\r\nTrải nghiệm đỉnh cao với hiệu năng mạnh mẽ từ vi xử lý tân tiến, kết hợp cùng RAM 12GB cho khả năng đa nhiệm mượt mà.\r\nLưu trữ thoải mái mọi ứng dụng, hình ảnh và video với bộ nhớ trong 256GB.\r\nNâng tầm nhiếp ảnh di động với hệ thống camera tiên tiến, cho ra đời những bức ảnh và video chất lượng chuyên nghiệp.\r\nThiết kế sang trọng, đẳng cấp, khẳng định phong cách thời thượng.\r\nSamsung S24 Ultra là siêu phẩm smartphone đỉnh cao mở đầu năm 2024 đến từ nhà Samsung với chip Snapdragon 8 Gen 3 For Galaxy mạnh mẽ, công nghệ tương lai Galaxy AI cùng khung viền Titan đẳng cấp hứa hẹn sẽ mang tới nhiều sự thay đổi lớn về mặt thiết kế và cấu hình. SS Galaxy S24 bản Ultra sở hữu màn hình 6.8 inch Dynamic AMOLED 2X tần số quét 120Hz. Máy cũng sở hữu camera chính 200MP, camera zoom quang học 50MP, camera tele 10MP và camera góc siêu rộng 12MP.\r\n\r\nVì sao nên mua Samsung Galaxy S24 Ultra?\r\nĐầu năm 2024, Samsung cho ra mắt Samsung S24 Ultra – Flagship dẫn đầu xu hướng với công nghệ AI tích hợp cùng nhiều tính năng và ưu điểm vượt trội khác. Các tính năng AI nổi bật trên điện thoại Samsung mới nhất bao gồm:\r\n\r\n- Galaxy AI với các tính năng Khoanh tròn để tìm kiếm, Photo Assist, Live Translate, Note Assist.\r\n\r\n- Khung viền bằng titan cứng cáp, giúp thiết bị bền bỉ theo thời gian.\r\n\r\n- Các phiên bản màu lấy cảm hứng từ chất liệu đá tự nhiên, mang đến vẻ đẹp sang trọng và hiện đại.\r\n\r\n- Camera tích hợp công nghệ AI tuyệt đỉnh, nâng tầm chất lượng và khả năng xử lý hình ảnh.\r\n\r\n- Hiệu năng cực đỉnh với chip Snapdragon 8 Gen3 for Galaxy, chiến game mượt mà.\r\n\r\n- Pin khoẻ 5000mAh, kéo dài thời gian sử dụng cả ngày dài, để không bỏ lỡ khoảnh khắc quan trọng.\r\n\r\n- Màn hình Dynamic AMOLED 2X với độ sáng lên đến 2600 nit, chìm đắm trong thế giới hình ảnh rực rỡ đầy màu sắc.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/edf3e622-f90b-40dc-8afd-07bff7f03b4d.jpg?alt=media', 'Thông số kỹ thuật\r\nKích thước màn hình\r\n\r\n6.8 inches\r\nCông nghệ màn hình\r\n\r\nDynamic AMOLED 2X\r\nCamera sau\r\n\r\nCamera chính: 200MP, Laser AF, OIS\r\nCamera: 50MP, PDAF, OIS, zoom quang học 5x\r\nCamera tele: 10MP\r\nCamera góc siêu rộng: 12 MP, f/2.2, 13mm, 120˚\r\nCamera trước\r\n\r\n12 MP, f/2.2\r\nChipset\r\n\r\nSnapdragon 8 Gen 3 For Galaxy\r\nCông nghệ NFC\r\n\r\nCó\r\nDung lượng RAM\r\n\r\n12 GB\r\nBộ nhớ trong\r\n\r\n256 GB\r\nPin\r\n\r\n5,000mAh', 'Samsung Galaxy S24 Ultra 12GB/256GB', 0, 'ACTIVE', '2024-07-14 17:37:03.374745', NULL, 16, 3);
