INSERT INTO `product` VALUES (66, '2024-07-14 17:38:18.410396', 'Lưu ý có bán cả mạch cắt tín hiệu và mạch công suất lẻ, vui lòng chọn đúng cái bạn muốn mua.\r\nMạch như hình chưa có sò và 2 tụ nguồn chính.\r\nMạch chỉ chạy một nguồn chính 30v đôi, nguồn lớn có thể dùng biến áp từ 30v đôi đến 45v đôi\r\nLắp sò theo chiều đã lắp trong hình\r\nMạch có công tắc đảo pha, nút chỉnh lớn nhỏ và chỉnh tần số của sub luôn\r\nChỗ cộc loa là đường tín hiệu vào luôn, dùng để câu vào cộc loa của amply để lấy tín hiệu đánh sub.\r\nMạch dùng để đánh sub 2 tấc đến 3 tấc ok nha mọi người\r\nMạch được lắp sẵn đầy đủ hết chỉ thiếu 2 con tụ nguồn chính, khách mua về tự lắp tụ nguồn lớn nhé, hoặc có thể mua tụ 10000uf 63v của trong shop mình.\r\nMạch có tích hợp sẵn rơle để bảo vệ loa luôn.\r\nSản phẩm 100% giống hình chụp', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/5333fa39-68df-46d7-9547-e8e362ecf1e4.jpg?alt=media', 'Chuyên cung cấp mạch điện tử lắp ráp sẵn, các loại linh kiện chất lượng như tụ điện, sò \r\n   công suất, phụ kiện nâng cấp âm thanh audio.\r\n• Hỗ trợ kỹ thuật miễn phí cho khách hàng trọn đời.\r\n• Chuyên cung cấp mạch phân tần cho loa và các loại mạch xử lý âm thanh karaoke.\r\n• Sản phẩm chúng tôi giao cho khách hàng đảm bảo giống hình 100% và đã được kiểm tra \r\n   test kỹ càng trước khi đóng gói.\r\n• Sản phẩm bao đổi trả nếu khác mẫu hoặc bị lỗi nên khách hàng cứ yên tâm mua sắm.\r\n• Hàng được đóng gói cẩn thận và bao bọc bằng xốp mút rất kỹ càng nên không lo bể vỡ.\r\n• Nếu sản phẩm quý khách nhận được bị lỗi hoặc gặp sự cố vui lòng liên hệ với chúng tôi \r\n   trước khi đánh giá, xin cảm ơn!', 'Mạch cắt tín hiệu và mạch công suất cho lưng sub điện 2 sò', 0, 'ACTIVE', '2024-07-14 17:38:18.410396', NULL, 52, 5);
INSERT INTO `product` VALUES (67, '2024-07-14 17:40:22.846884', '*Hình ảnh sản phẩm chỉ mang tính chất minh họa*\r\n\r\nPC Power Ai Intel I9-14900K | Ram 32GB | 1 TB SSD | RTX 4070 Ti Super 16G\r\nDòng PC Ai đem đến cho khách hàng một sự lựa chọn cực vô cùng hợp lý với cấu hình mạnh mẽ, mức giá dễ chịu, đáp ứng tốt các nhu cầu cơ bản, hoặc trainning AI dài hạn. Sử dụng VGA RTX 4000 mới nhất từ Nvidia với chất lượng phần cứng cao cấp, hiệu năng AI mạnh mẽ. \r\n\r\n \r\n\r\nChi tiết bộ máy \r\nCPU - Bộ vi xử lý trung tâm Intel i9-14900K\r\n\r\nBộ máy sử dụng chip xử lý Intel i9-14900K với 24 nhân và 32 luồng xử lý mạnh mẽ, xung nhịp boost lên tối đa đến 6.0Ghz sẵn sàng cho đa tác vụ hoặc các tác vụ cần hiệu năng xử lý mạnh. \r\n\r\n\r\n\r\nBo mạch chủ Bo Mạch Chủ MSI Z790 Gaming Plus Wifi DDR5\r\n Sử dụng Bo Mạch Chủ MSI Z790 Gaming Plus Wifi DDR5 hỗ trợ đầy đủ các cổng giao tiếp ăn chơi:\r\n\r\n4 khe cắm RAM DDR5\r\n4 khe cắm SSD M.2 PCIe Gen4 x4\r\n1 khe cắm VGA PCIe Gen5 x16\r\n6 cổng cắm SATA SSD\r\n1 cổng xuất hình DP 1.2, 1 cổng HDMI\r\n11 cổng cắm USB Type A, 1 cổng USB Type C\r\nTích hợp Wifi 6E và Bluetooth 5.3\r\n\r\n\r\nBộ Nhớ Ram PC Adata XPG Lancer 32Gb (2x16GB) DDR5 6000MHz\r\nVới việc sử dụng Bộ Nhớ Ram PC Adata XPG Lancer 32Gb (2x16GB) DDR5 6000MHz White, bộ máy sẽ chạy ở chế độ Dual Channel, giúp hỗ trợ tăng tối đa tốc độ xử lý của máy. Dòng RAM tích hợp bộ tản nhiệt giúp RAM hoạt động bền bỉ hơn, mát mẻ hơn và đẹp mắt hơn. Ngoài ra RAM còn hỗ trợ XMP 3.0 giúp người dùng khai thác tối đa hiệu năng sản phẩm chỉ với 1 cú click chuột.\r\n\r\n\r\n\r\nCard Màn Hình MSI GeForce RTX 4070 Ti SUPER Ventus 2x OC 16GB GDDR6X\r\nSử dụng kiến trúc NVIDIA® Ada Lovelace mới nhất, cho phép người sử dụng đạt được hiệu suất cao nhất với mức tiêu thụ điện năng thấp nhất trong một mức giá hợp lý. Tích hợp nhân Ray Tracing thế hệ thứ 3 nâng cao hiệu suất xử lý khả năng đổ bóng và nhân Tensor thế hệ thứ 4 cho phép nâng cao khả năng xử lý của các thuật toán AI áp dụng trên công nghệ DLSS 3 => tối ưu hóa khung hình/s mà vẫn giữ được vẻ đẹp của game(Sức mạnh gấp 4 lần thuật toán Bruyte Force). Ngoài ra bạn có thể cài thêm phần mềm GeForce Experience nâng cao trải nghiệm gaming miễn phí.\r\n\r\n\r\n\r\nỔ Cứng SSD Lexar NM790 Heatsink 1TB M.2 2280 PCIe Gen 4×4 NVMe SSD\r\nĐáp ứng đủ như cầu lưu trữ cơ bản của người dùng: Cài đặt Windows, các phần mềm cơ bản với tốc độ cao hơn gấp 7 lần ổ Sata 3 cũ . Ngoài ra với việc hỗ trợ nâng cấp mạnh mẽ từ bo mạch chủ, bạn hoàn toàn có thể nâng cấp dung lượng ổ cứng SSD này lên cao hơn (2TB, 4TB...) hoặc có thể gắn thêm ổ cứng HDD hoặc ổ cứng SSD 2.5\" giao tiếp Sata 3, thậm chí là có thể gắn thêm SSD NVMe. \r\n\r\n\r\n\r\nNguồn Máy Tính Super Flower Leadex III Gold 850W PCIe 5.0 Black\r\nĐầu tư vào một bộ nguồn chất lượng cao, công suất thực chưa bao giờ là phung phí. Với việc trang bị một bộ nguồn chất lượng cao, công suất thực 850W và hiệu suất đạt tới 88%, bộ máy của bạn sẽ luôn đạt tình trạng khỏe mạnh nhất, không bao giờ bị thiếu điện cũng như sử dụng hiệu quả điện năng nhất có thể. \r\n\r\n\r\n\r\nVỏ Máy Tính Gamdias Talos E3 Mesh Elite Black', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/02c6a56a-40aa-4dba-a09c-7d8d9343ea82.jpg?alt=media', 'Loại Linh Kiện	Tên Linh Kiện	Bảo Hành\r\nBo mạch chủ	Bo Mạch Chủ MSI Z790 Gaming Plus Wifi DDR5	36 tháng \r\nBộ vi xử lý	CPU Intel Core I9 14900K (3.2GHz Turbo Upto 6.0GHz, 24 Nhân 32 Luồng, Cache 36MB, 150W) - Box Công Ty	36 tháng \r\nCard màn hình	Card Màn Hình MSI GeForce RTX 4070 Ti SUPER Ventus 2x OC 16GB GDDR6X	36 tháng \r\nBộ nhớ RAM	32GB , 2 thanh Bộ Nhớ RAM PC ADATA DDR5 XPG LANCER 16GB (1*16GB) 6000 - (Màu Đen)	60 tháng \r\nỔ cứng SSD	Ổ Cứng SSD Lexar NM790 Heatsink 1TB M.2 2280 PCIe Gen 4×4 NVMe SSD	60 tháng', 'PC Power Ai Intel I9-14900K | Ram 32GB | 1 TB SSD | RTX 4070 Ti Super 16G', 0, 'ACTIVE', '2024-07-14 17:40:22.846884', NULL, 50, 6);
INSERT INTO `product` VALUES (68, '2024-07-14 17:40:28.847894', 'Mạch in và hàn sẵn linh kiện về chỉ việc hàn ic là chạy , mạch chuyên dùng cho các bán lắp ráp cho các chuồng nuôi chim yến, loa kéo bán rong... Ngoài ra có thể dùng nghe nhạc với loa bass 20 . Nếu cần thêm ic các bạn có thể chọn thêm ở danh mục\r\n• SHOP CAM KẾT \r\n-  Hỗ trợ tư vấn kỹ thuật miễn phí cho Quý Khách trọn đời.\r\n- Sản phẩm được kiểm tra kĩ càng, cẩn thận và tư vấn nhiệt tình trước khi gói hàng giao cho Quý Khách \r\n- Hoàn tiền nếu sản phẩm không giống với mô tả .\r\n- Hỗ trợ đổi trả theo quy định của sàn.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/b6b7ecaf-e667-4864-923f-b93123611b31.jpg?alt=media', 'QUY ĐỊNH ĐỔI TRẢ HÀNG \r\n1. Trường hợp được chấp nhận: \r\n- Hàng không đúng hình ảnh shop đăng.\r\n- Không đủ số lượng đơn hàng .Các bạn yêu cầu hoàn tiền hoặc có thể liên hệ shop để được gửi bù hàng thiếu hoàn toàn miễn phí.\r\n2. Trường hợp không đủ điều kiện áp dụng chính sách: \r\n- Quá 07 ngày kể từ khi Quý khách nhận hàng.\r\n- Lỗi do khách hàng cấp ngược nguồn cháy linh kiện làm mạch không hoạt động.\r\n- Gửi lại hàng không đúng mẫu mã, không phải sản phẩm của shop bán\r\n- Không thích, không hợp, đặt nhầm loại...', 'Mạch công suất chim yến 12v LA 4440', 0, 'ACTIVE', '2024-07-14 17:40:28.847894', NULL, 52, 5);
INSERT INTO `product` VALUES (69, '2024-07-14 17:43:57.889065', 'ĐẶC ĐIỂM NỔI BẬT\r\nGalaxy AI tiện ích - Khoanh vùng search đa năng, là trợ lý chỉnh ảnh, trợ lý note thông minh, phiên dịch trực tiếp\r\nThiết kế tinh tế với nếp gấp vô hình - Cải tiến nếp gấp thẩm mĩ hơn và gập không kẽ hở\r\nBền bỉ bất chấp mọi tình huống - Đạt chuẩn kháng bụi và nước IPX8 cùng chất liệu nhôm Armor Aluminum giúp hạn chế cong và xước\r\nMở ra không gian giải trí cực đại với màn hình trong 7.6\"\" cùng bản lề Flex dẫn đầu công nghệ\r\nThoải mái sáng tạo mọi lúc - Bút Spen tiện dụng giúp bạn phác hoạ và ghi chép không cần đến sổ tay\r\nHiệu năng cân mọi tác vụ - Snapdragon® 8 Gen 2 for Galaxy xử lí mượt mà, đa nhiệm mượt mà\r\nSamsung Galaxy Z Fold 5 phiên bản 12GB 256GB tạo nên trải nghiệm xử lý tác vụ siêu mượt mà thông qua chipset Snapdragon 8 Gen 2 đỉnh cao cùng dung lượng RAM lên tới 12GB. Máy được trang bị công nghệ màn hình Dynamic AMOLED 2X 120Hz với kích thước có thể lên tới 7.6 inch khi mở, đem lại trải nghiệm hình ảnh sắc nét trong từng điểm ảnh. Bên cạnh đó, phân khúc smartphone gập này còn sở hữu cụm camera hiện đại với độ sắc nét đạt tới 50MP cùng viên pin 4400mAh.\r\n\r\nSamsung Galaxy Z Fold5 12GB 256GB - Hiệu năng vượt trội, thiết kế mỏng nhẹ hơn\r\nSamsung Galaxy Z Fold5 là phân khúc smartphone gập đáng được mong chờ nhất trong năm 2023 khi sở hữu thiết kế đột phá cùng nhiều tính năng ấn tượng. Với màn hình gập mở linh hoạt, Z Fold5 mang tới cho bạn trải nghiệm sử dụng của cả điện thoại thông minh lẫn máy tính bảng. Bên cạnh đó, máy còn đi kèm với nhiều tính năng công nghệ hàng đầu, sẵn sàng phục vụ được những yêu cầu sử dụng phức tạp của người dùng.\r\n\r\nUpdate mới nhất: điện thoại gập thế hệ thứ 6 hay Samsung Z Fold 6 sẽ chính thức ra mắt đầu tháng 7/2024 với nâng cấp mạnh mẽ về phần cứng và tích hợp AI. Cùng CellphoneS liên tục cập nhật thông tin cấu hình, giá bán, ngày về hàng Z Fold 6 tại Việt Nam nhé!\r\n\r\nNâng tầm khả năng quay chụp với cụm camera lên tới 50MP\r\nSamsung Galaxy Z Fold5 nổi bật với khả năng quay chụp siêu sắc nét thông qua hệ thống máy ảnh với độ phân giải lên tới 50MP. Cụ thể, smartphone gập mới này được trang bị cụm 3 camera với độ sắc nét lần lượt là 50 + 10 + 12MP. \r\n\r\nSamsung Galaxy Z Fold5 12GB 256GB - Hiệu năng vượt trội, thiết kế mỏng nhẹ hơn\r\n\r\nVới ưu thế vượt trội về cụm ống kính hiện đại này, Z Fold5 đảm bảo sẽ mang tới cho bạn những bức ảnh sắc nét và chất lượng hơn các thế hệ tiền nhiệm rất nhiều. Bên cạnh đó, nhờ được trang bị vi xử lý đời mới cũng giúp cho Z Fold5 có khả năng xử lý và chụp ảnh tốt hơn nhiều so với các thế hệ tiền nhiệm.\r\n\r\nHiệu năng đột phá với chipset Snapdragon 8 Gen 2 mạnh mẽ\r\nVề mặt cấu hình, Samsung Galaxy Z Fold5 sở hữu vi xử lý hiện đại Snapdragon 8 Gen 2, cho hiệu năng vượt trội hơn nhiều so với các thế hệ Galaxy Z trước đó. Cụ thể, các nhà sản xuất chip Qualcomm cho biết, 8 Gen 2 là một vi xử lý mạnh hoạt động nhanh hơn 18%, hiệu quả GPU tăng 32%.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/828850e4-2b13-4cd0-b41a-1a947046f7c3.jpg?alt=media', 'Thông số kỹ thuật\r\nKích thước màn hình\r\n\r\n7.6 inches\r\nCông nghệ màn hình\r\n\r\nDynamic AMOLED 2X\r\nCamera sau\r\n\r\nCamera siêu rộng: 12MP F2.2, 123°, 1.12μm\r\nCamera góc rộng: 50MP, F1.8, Dual Pixel AF, OIS, 2.0μm\r\nCamera Tele: 10 MP, F2.4, PDAF, OIS, 1.0μm, zoom 3X, zoom kỹ thuật số 30X\r\nCamera trước\r\n\r\nCamera bên ngoài:10 MP, f/2.2\r\nCamera bên trong: 4 MP, F1.8\r\nChipset\r\n\r\nSnapdragon 8 Gen 2 for Galaxy (4nm) 8 nhân\r\nCông nghệ NFC\r\n\r\nCó\r\nDung lượng RAM\r\n\r\n12 GB\r\nBộ nhớ trong\r\n\r\n256 GB\r\nPin\r\n\r\n4.400 mAh\r\nThẻ SIM\r\n\r\n2 SIM (nano‑SIM và eSIM)\r\nHệ điều hành\r\n\r\nAndroid 13, One UI 5.1\r\nĐộ phân giải màn hình\r\n\r\n2176 x 1812 pixels (QXGA+)\r\nTính năng màn hình\r\n\r\nMàn hình chính rộng: 7,6 inch, 21.6:18, Dynamic AMOLED 2X, 1-120Hz, Hỗ trợ S Pen\r\nMàn hình ngoài rộng: 6,2 inch, HD+ (2316 x 904), Dynamic AMOLED 2X, 23.1:9, 48-120Hz\r\nĐộ sáng tối đa: 1750 nits Mặt kính cảm ứng Chính: Ultra Thin Glass & Phụ: Corning', 'Điện thoại Samsung Galaxy Z Fold5 5G 1TB', 0, 'ACTIVE', '2024-07-14 17:43:57.889065', NULL, 16, 3);
INSERT INTO `product` VALUES (70, '2024-07-14 17:43:57.905948', 'ĐẶC ĐIỂM NỔI BẬT\r\nGalaxy AI tiện ích - Khoanh vùng search đa năng, là trợ lý chỉnh ảnh, trợ lý note thông minh, phiên dịch trực tiếp\r\nThiết kế tinh tế với nếp gấp vô hình - Cải tiến nếp gấp thẩm mĩ hơn và gập không kẽ hở\r\nBền bỉ bất chấp mọi tình huống - Đạt chuẩn kháng bụi và nước IPX8 cùng chất liệu nhôm Armor Aluminum giúp hạn chế cong và xước\r\nMở ra không gian giải trí cực đại với màn hình trong 7.6\"\" cùng bản lề Flex dẫn đầu công nghệ\r\nThoải mái sáng tạo mọi lúc - Bút Spen tiện dụng giúp bạn phác hoạ và ghi chép không cần đến sổ tay\r\nHiệu năng cân mọi tác vụ - Snapdragon® 8 Gen 2 for Galaxy xử lí mượt mà, đa nhiệm mượt mà\r\nSamsung Galaxy Z Fold 5 phiên bản 12GB 256GB tạo nên trải nghiệm xử lý tác vụ siêu mượt mà thông qua chipset Snapdragon 8 Gen 2 đỉnh cao cùng dung lượng RAM lên tới 12GB. Máy được trang bị công nghệ màn hình Dynamic AMOLED 2X 120Hz với kích thước có thể lên tới 7.6 inch khi mở, đem lại trải nghiệm hình ảnh sắc nét trong từng điểm ảnh. Bên cạnh đó, phân khúc smartphone gập này còn sở hữu cụm camera hiện đại với độ sắc nét đạt tới 50MP cùng viên pin 4400mAh.\r\n\r\nSamsung Galaxy Z Fold5 12GB 256GB - Hiệu năng vượt trội, thiết kế mỏng nhẹ hơn\r\nSamsung Galaxy Z Fold5 là phân khúc smartphone gập đáng được mong chờ nhất trong năm 2023 khi sở hữu thiết kế đột phá cùng nhiều tính năng ấn tượng. Với màn hình gập mở linh hoạt, Z Fold5 mang tới cho bạn trải nghiệm sử dụng của cả điện thoại thông minh lẫn máy tính bảng. Bên cạnh đó, máy còn đi kèm với nhiều tính năng công nghệ hàng đầu, sẵn sàng phục vụ được những yêu cầu sử dụng phức tạp của người dùng.\r\n\r\nUpdate mới nhất: điện thoại gập thế hệ thứ 6 hay Samsung Z Fold 6 sẽ chính thức ra mắt đầu tháng 7/2024 với nâng cấp mạnh mẽ về phần cứng và tích hợp AI. Cùng CellphoneS liên tục cập nhật thông tin cấu hình, giá bán, ngày về hàng Z Fold 6 tại Việt Nam nhé!\r\n\r\nNâng tầm khả năng quay chụp với cụm camera lên tới 50MP\r\nSamsung Galaxy Z Fold5 nổi bật với khả năng quay chụp siêu sắc nét thông qua hệ thống máy ảnh với độ phân giải lên tới 50MP. Cụ thể, smartphone gập mới này được trang bị cụm 3 camera với độ sắc nét lần lượt là 50 + 10 + 12MP. \r\n\r\nSamsung Galaxy Z Fold5 12GB 256GB - Hiệu năng vượt trội, thiết kế mỏng nhẹ hơn\r\n\r\nVới ưu thế vượt trội về cụm ống kính hiện đại này, Z Fold5 đảm bảo sẽ mang tới cho bạn những bức ảnh sắc nét và chất lượng hơn các thế hệ tiền nhiệm rất nhiều. Bên cạnh đó, nhờ được trang bị vi xử lý đời mới cũng giúp cho Z Fold5 có khả năng xử lý và chụp ảnh tốt hơn nhiều so với các thế hệ tiền nhiệm.\r\n\r\nHiệu năng đột phá với chipset Snapdragon 8 Gen 2 mạnh mẽ\r\nVề mặt cấu hình, Samsung Galaxy Z Fold5 sở hữu vi xử lý hiện đại Snapdragon 8 Gen 2, cho hiệu năng vượt trội hơn nhiều so với các thế hệ Galaxy Z trước đó. Cụ thể, các nhà sản xuất chip Qualcomm cho biết, 8 Gen 2 là một vi xử lý mạnh hoạt động nhanh hơn 18%, hiệu quả GPU tăng 32%.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/f7373c7e-b900-4e8a-b905-cf731299662b.jpg?alt=media', 'Thông số kỹ thuật\r\nKích thước màn hình\r\n\r\n7.6 inches\r\nCông nghệ màn hình\r\n\r\nDynamic AMOLED 2X\r\nCamera sau\r\n\r\nCamera siêu rộng: 12MP F2.2, 123°, 1.12μm\r\nCamera góc rộng: 50MP, F1.8, Dual Pixel AF, OIS, 2.0μm\r\nCamera Tele: 10 MP, F2.4, PDAF, OIS, 1.0μm, zoom 3X, zoom kỹ thuật số 30X\r\nCamera trước\r\n\r\nCamera bên ngoài:10 MP, f/2.2\r\nCamera bên trong: 4 MP, F1.8\r\nChipset\r\n\r\nSnapdragon 8 Gen 2 for Galaxy (4nm) 8 nhân\r\nCông nghệ NFC\r\n\r\nCó\r\nDung lượng RAM\r\n\r\n12 GB\r\nBộ nhớ trong\r\n\r\n256 GB\r\nPin\r\n\r\n4.400 mAh\r\nThẻ SIM\r\n\r\n2 SIM (nano‑SIM và eSIM)\r\nHệ điều hành\r\n\r\nAndroid 13, One UI 5.1\r\nĐộ phân giải màn hình\r\n\r\n2176 x 1812 pixels (QXGA+)\r\nTính năng màn hình\r\n\r\nMàn hình chính rộng: 7,6 inch, 21.6:18, Dynamic AMOLED 2X, 1-120Hz, Hỗ trợ S Pen\r\nMàn hình ngoài rộng: 6,2 inch, HD+ (2316 x 904), Dynamic AMOLED 2X, 23.1:9, 48-120Hz\r\nĐộ sáng tối đa: 1750 nits Mặt kính cảm ứng Chính: Ultra Thin Glass & Phụ: Corning', 'Điện thoại Samsung Galaxy Z Fold5 5G 512GB', 0, 'ACTIVE', '2024-07-14 17:43:57.905948', NULL, 16, 3);
