INSERT INTO `product` VALUES (72, '2024-07-14 17:46:37.051200', 'MÔ TẢ SẢN PHẨM\r\n\r\n*Hình ảnh sản phẩm chỉ mang tính chất minh họa*\r\n\r\n\r\n\r\n\r\nPC Gaming Asus Intel I9 14900K | Ram 32GB | 1TB SSD | RTX 4090 24G\r\nDòng PC Gaming Asus đem đến cho khách hàng một sự lựa chọn cực vô cùng hợp lý với cấu hình mạnh mẽ, chất lượng linh kiện bền bì thuộc hàng Top của Asus. Cấu hình mạnh mẽ trong một thùng máy chuẩn ATX  hầm hố, thông thoáng giúp bộ máy đạt được hiệu năng cao nhất mà vẫn luôn mát mẻ.\r\n\r\n \r\n\r\nCPU - Bộ vi xử lý trung tâm Intel Core i9-14900K\r\n\r\nBộ máy PC Gaming Asus Intel I9 14900K | Ram 32GB | 1TB SSD | RTX 4090 24G sử dụng chip xử lý Intel Core i9-14900 với 24 nhân 32 luồng xử lý mạnh mẽ nhất hiện nay, xung nhịp boost tối đa 6.0 Ghz cho phép bạn xử lý được vừa các tác vụ nặng nhất, vừa có thể chạy thêm các tác vụ nhẹ nhờ vào các nhân P-Core và E-Core trên vi xử lý. \r\n\r\n \r\n\r\n\r\n\r\nBo Mạch Chủ Mainboard Asus ROG Maximus Z690 Hero WIFI DDR5\r\n Sử dụng Bo Mạch Chủ Mainboard Asus ROG Maximus Z690 Hero WIFI DDR5 hỗ trợ đầy đủ các cổng giao tiếp, chất lượng linh kiện thuộc hàng TOP, dàn phase VRM cao cấp sẵn sàng giúp CPU hoạt động một cách mạnh mẽ nhất:\r\n\r\n4 khe cắm RAM DDR5\r\n5 khe cắm SSD M.2 PCIe Gen4 x4\r\n2 khe cắm VGA PCIe Gen 5 x16, 1 khe PCIe Gen4 x16(chạy ở tốc độ x4)\r\n6 cổng cắm SATA SSD\r\n2 cổng Thunderbolt 4, 1 cổng xuất hình HDMI \r\n8 cổng cắm USB, 1 cổng USB-TypeC, hỗ trợ cổng xuất âm thanh trực tiếp\r\n\r\n\r\nBộ nhớ ram 32GB với 2 thanh Bộ Nhớ Ram PC G.Skill Trident Z5 RGB DDR5 6000MHz \r\nVới việc sử dụng 2 thanh Bộ Nhớ Ram PC G.Skill Trident Z5 RGB DDR5-6000MHz  bộ máy sẽ chạy ở chế độ Dual Channel, giúp hỗ trợ tăng tối đa tốc độ xử lý của máy. Dòng RAM tích hợp bộ tản nhiệt giúp RAM hoạt động bền bỉ hơn, mát mẻ hơn và đẹp mắt hơn. Ngoài ra RAM còn hỗ trợ XMP 3.0 giúp người dùng khai thác tối đa hiệu năng sản phẩm chỉ với 1 cú click chuột.\r\n\r\n\r\n\r\nCard Màn Hình VGA ASUS ROG Strix GeForce RTX 4090 OC Edition 24GB GDDR6X\r\nDòng VGA RTX 4090 ROG Strix cao cấp nhất từ Asus: Hiệu năng top 1, với bộ tản nhiệt siêu khủng cực mát mẻ, ngoại hình ấn tượng với dải LED RGB có thể đồng bộ AuraSync với bo mạch chủ một cách hoàn hảo.\r\n\r\n\r\n\r\nỔ đĩa cứng SSD Samsung 990 Pro 1TB PCIe Gen4 X4\r\nỔ SSD cao cấp nhất từ Samsung. Với tốc độ đọc tối đa lên đến 7450 MB/s trên bằng thông Gen4x4. Với tốc độ cực cao, đi kèm 3D V-Nand, Cache cao cấp và độ bền cao giúp chiếc SSD này trở thành chiếc SSD cao cấp nhất hiện tại\r\n\r\n\r\n\r\nBộ nguồn máy tính Asus ROG Strix AURA 1000W 80 Plus Gold', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/d3619663-038e-4139-a8a9-1ea91694c2e3.jpg?alt=media', 'THÔNG SỐ SẢN PHẨM\r\nCPU: Intel I9 14900K\r\nCard: RTX 4090 24G\r\nRam: 32GB\r\nỔ cứng: 1TB SSD M.2\r\nMain: Z690 Hero\r\nNguồn : 1000W', 'PC Gaming MyGear X Asus Intel I9 14900K | Ram 32GB | 1TB SSD | RTX 4090 24G', 0, 'ACTIVE', '2024-07-14 17:46:37.051200', NULL, 50, 6);
INSERT INTO `product` VALUES (73, '2024-07-14 17:53:30.495737', 'Windows 10 Pro 64-bit English 1pk DSP OEI DVD (FQC-08929) là phiên bản hệ điều hành mạnh mẽ và linh hoạt của Microsoft, được thiết kế đặc biệt cho các doanh nghiệp và người dùng chuyên nghiệp. Với giao diện tiếng Anh, đĩa DVD dễ sử dụng, nó cung cấp nền tảng ổn định để làm việc hiệu quả và bảo mật thông tin cá nhân. Windows 10 Pro hỗ trợ nâng cao cho kết nối mạng, quản lý thiết bị và các tính năng bảo mật, bao gồm BitLocker để bảo vệ dữ liệu quan trọng. Đi kèm với đó là tính năng cập nhật liên tục để đảm bảo hệ thống luôn được cập nhật mới nhất từ Microsoft.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/d1c71c6d-ccec-4720-a57b-1309d9500322.jpg?alt=media', 'THÔNG SỐ SẢN PHẨM\r\nThương hiệu : Mircosoft\r\nLoại phần mềm : Windows', 'Windows 10 Pro 64bit 1pk DSP OEI DVD (FQC-08929)', 0, 'ACTIVE', '2024-07-14 17:53:30.495737', NULL, 51, 6);
INSERT INTO `product` VALUES (74, '2024-07-14 17:56:15.864606', '✅ CHI TIẾT SẢN PHẨM\r\n\r\n	+ Form Áo: Regular (Dáng vừa) mặc trơn hay khoác ngoài đều phù hợp.\r\n\r\n	+ Chất Liệu: Vải Chéo Thái cao cấp, dày dặn, mềm mịn, ít nhăn, co giãn 4 chiều và thấm hút tốt. Giúp người mặc thoáng mát, không gò bó hay hầm bí. Cam kết không ra màu không bai nhãu.\r\n\r\n\r\n\r\n✅ QUY CÁCH ĐÓNG GÓI\r\n\r\n	+ Mọi đơn hàng sẽ được đóng gói trong hộp POLYS trắng sang trọng và túi niêm phong của Brand.\r\n\r\n	+ POLYS hỗ trợ IN THIỆP MIỄN PHÍ theo nội dung của khách hàng.\r\n\r\n( Khách hàng có nhu cầu tặng quà cần bảo vệ hộp hoặc IN THIỆP, vui lòng NHẮN TIN sau khi đặt hàng để được POLYS hỗ trợ thêm)', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/1ca99d24-26b4-4972-982b-054b8d955feb.jpg?alt=media', '✅ HƯỚNG DẪN GIẶT ỦI VÀ BẢO QUẢN\r\n\r\n	+ Có thể giặt máy, sử dụng nước lạnh hoặc ấm (Dưới 30 độ).\r\n\r\n	+ Ủi hoặc sấy áo ở nhiệt độ thấp.\r\n\r\n	+ KHÔNG sử dụng nước tẩy.\r\n\r\n	+ KHÔNG phơi nắng gắt.\r\n\r\n\r\n\r\n✅ CHÍNH SÁCH ĐỔI TRẢ\r\n\r\n	+ POLYS hỗ trợ đổi trả trong 7 ngày kể từ khi nhận hàng.\r\n\r\n	+ POLYS hỗ trợ đổi trả toàn quốc, giao thu tận nơi.\r\n\r\n	+ Sản phẩm đổi cần còn nguyên tem mác, không bị bẩn và chưa qua sử dụng.\r\n\r\n	+ Đơn đổi trả khách hàng cần thanh toán phí ship.', 'Áo sơ mi nam POLYS Fullbox, Vải Chéo Thái 6 Màu dày dặn. Áo sơ mi tay ngắn Cổ Vest CUBAN SHIRT', 0, 'ACTIVE', '2024-07-14 17:56:15.864606', NULL, 53, 5);
