INSERT INTO `product` VALUES (76, '2024-07-14 17:59:06.470965', 'Windows 11 Pro X64 Intl 1pk DSP OEI DVD (FQC-10528) là hệ điều hành tiên tiến của Microsoft, dành cho doanh nghiệp và người dùng chuyên nghiệp. Với giao diện quốc tế, đĩa DVD cung cấp trải nghiệm đơn giản và hiệu quả. Windows 11 Pro mang đến các tính năng tiên tiến như Microsoft Teams tích hợp sẵn, cải thiện tích hợp đám mây và khả năng bảo mật vượt trội như Windows Hello để bảo vệ dữ liệu cá nhân. Hệ điều hành này cũng hỗ trợ cập nhật liên tục và hỗ trợ kết nối mạng tối ưu, giúp người dùng làm việc và giải trí một cách thông minh và linh hoạt.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/9a42bcff-ad3c-4886-a118-a6841981dca2.jpg?alt=media', 'THÔNG SỐ SẢN PHẨM\r\nThương hiệu : Mircosoft\r\nLoại phần mềm : Windows', 'Windows Pro 11 X64 Intl 1pk DSP OEI DVD (FQC-10528)', 0, 'ACTIVE', '2024-07-14 17:59:06.470965', NULL, 51, 6);
INSERT INTO `product` VALUES (77, '2024-07-14 18:02:52.667991', 'Điểm đặc biệt:\r\nÁo sơ mi nam trơn không nhăn LAVIC-523 lịch lãm, phù hợp với dáng người là có thể đem lại cảm giác tự tin ngay trong mọi hoàn cảnh. May gia công tỉ mỉ với chất liệu vải áo sơ mi nam không nhăn,mang đến sự thanh lịch, cuốn hút và trẻ trung cho các bạn nam. Áo sơ mi nam tay dài với thiết kế cổ bẻ, tay dài, có nút gài phía trước chắc chắn, đường may tỉ mỉ, áo thiết kế form vừa vặn giúp tôn được đường nét mạnh mẽ, nam tính của các chàng trai. Áo sơ mi nam với màu sắc đa dạng, trẻ trung,thời thượng, dễ dàng phối cùng quần jean, quần kaki, hay cách điệu với quần xắn gấu và phối hợp cùng giày thể thao hoặc giày lười. Với áo sơ mi nam tay dài có thể sử dụng thoải mái cho môi trường công sở, mẫu áo có thiết kế như thế này sẽ giúp các bạn nam thể hiện được sự tươi trẻ, năng động, thanh lịch và dễ dàng khoe được vóc dáng cân đối của cơ thể.\r\nĐường may tinh tế, tỉ mỉ trong từng chi tiết\r\nPhong cách lịch lãm\r\nChất lượng sản phẩm tốt, giá cả hợp lý\r\nShop luôn sẵn sàng trả lời inbox để tư vấn', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/37639c61-e254-4af3-a88e-ee216aafbf6c.jpg?alt=media', 'Xuất xứ: VIỆT NAM\r\nChất liệu: lụa nến\r\nKiểu dáng: Thiết kế theo form chuẩn\r\nMàu sắc: Đen, Xanh đen, Trắng, Vàng, Bò, Xám nhạt, Xanh biển, Hồng, Rêu, Xanh lam, Xanh ngọc\r\nTrọng lượng: 100g', '[MẪU MỚI] Áo sơ mi nam xanh form body LAVIC LV523', 0, 'ACTIVE', '2024-07-14 18:02:52.667991', NULL, 53, 5);
INSERT INTO `product` VALUES (78, '2024-07-14 18:04:06.163293', 'iPad Pro M4 256GB, dòng máy tính bảng cao cấp nhất năm 2024, nổi bật với hiệu năng vượt trội nhờ chip Apple M4 9 nhân CPU, màn hình Ultra Retina XDR sắc nét và camera trước đặt ở cạnh dài tiện lợi. Với thiết kế mỏng nhẹ và thời lượng pin ấn tượng, iPad Pro M4 256GB hứa hẹn là lựa chọn hoàn hảo cho người dùng yêu thích công nghệ.\r\nThiết kế mỏng nhẹ, cao cấp hơn\r\nKhung viền của iPad Pro M4 256GB được thiết kế phẳng và vuông vức, không chỉ mang lại cảm giác chắc chắn và bền bỉ cho người dùng khi cầm trên tay mà còn tạo điểm nhấn thiết kế, phản ánh sự chuyên nghiệp và sang trọng.\r\n\r\niPad Pro M4 11 inch WiFi 256GB - Khung viền\r\n\r\nCác góc trên iPad được làm bo tròn nhẹ nhàng, giúp việc cầm nắm thoải mái hơn, đặc biệt khi bạn dùng máy trong thời gian dài. Thân máy bằng nhôm nguyên khối không chỉ tạo ra một bề ngoài mượt mà mà còn góp phần vào độ bền và cảm giác cao cấp của iPad.\r\n\r\nVề độ mỏng và khối lượng, iPad Pro M4 256GB tỏa sáng với 5.3 mm độ dày và nặng chỉ 444 g, được cho là một trong những chiếc máy tính bảng mỏng nhẹ nhất hiện nay. Điều này chứng tỏ Apple luôn chú trọng vào việc tối ưu hóa kích thước để mang lại sự thoải mái nhất cho người dùng đi kèm với phần hiệu năng mạnh mẽ của máy.\r\n\r\niPad Pro M4 11 inch WiFi 256GB - Độ mỏng\r\n\r\nApple Pencil Pro khi kết hợp với iPad Pro M4 256GB tạo nên một công cụ sáng tạo tiên tiến với nhiều tính năng ưu việt. Công nghệ phản hồi xúc giác cho phép người dùng tận hưởng trải nghiệm vẽ và ghi chú chân thực, với mỗi cử động được tái tạo một cách sinh động. Không chỉ vậy, tính năng tìm kiếm trong ứng dụng Tìm giúp người dùng dễ dàng định vị bút khi cần thiết, mang lại sự an tâm tối đa.\r\n\r\nLưu ý: Bút Apple Pencil Pro và Magic Keyboard là phụ kiện được mua riêng.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/2987177e-2c97-4bd7-bffc-d71af4c96924.jpg?alt=media', 'Màn hình\r\n\r\nCông nghệ màn hình:\r\n\r\nUltra Retina XDR\r\nĐộ phân giải:\r\n\r\n1668 x 2420 Pixels\r\nMàn hình rộng:\r\n\r\n11\" - Tần số quét 120 Hz\r\nHệ điều hành & CPU\r\n\r\nHệ điều hành:\r\n\r\niPadOS 17\r\nChip xử lý (CPU):\r\n\r\nApple M4 9 nhân\r\nTốc độ CPU:\r\nHãng không công bố\r\nChip đồ hoạ (GPU):\r\n\r\nApple GPU 10 nhân\r\nBộ nhớ & Lưu trữ\r\n\r\nRAM:\r\n8 GB\r\nDung lượng lưu trữ:\r\n\r\n256 GB\r\nDung lượng còn lại (khả dụng) khoảng:\r\n\r\n241 GB', 'Máy tính bảng iPad Pro M4 11 inch WiFi 256GB', 0, 'ACTIVE', '2024-07-14 18:04:06.163293', NULL, 5, 3);
INSERT INTO `product` VALUES (79, '2024-07-14 18:04:06.924432', 'iPad Pro M4 256GB, dòng máy tính bảng cao cấp nhất năm 2024, nổi bật với hiệu năng vượt trội nhờ chip Apple M4 9 nhân CPU, màn hình Ultra Retina XDR sắc nét và camera trước đặt ở cạnh dài tiện lợi. Với thiết kế mỏng nhẹ và thời lượng pin ấn tượng, iPad Pro M4 256GB hứa hẹn là lựa chọn hoàn hảo cho người dùng yêu thích công nghệ.\r\nThiết kế mỏng nhẹ, cao cấp hơn\r\nKhung viền của iPad Pro M4 256GB được thiết kế phẳng và vuông vức, không chỉ mang lại cảm giác chắc chắn và bền bỉ cho người dùng khi cầm trên tay mà còn tạo điểm nhấn thiết kế, phản ánh sự chuyên nghiệp và sang trọng.\r\n\r\niPad Pro M4 11 inch WiFi 256GB - Khung viền\r\n\r\nCác góc trên iPad được làm bo tròn nhẹ nhàng, giúp việc cầm nắm thoải mái hơn, đặc biệt khi bạn dùng máy trong thời gian dài. Thân máy bằng nhôm nguyên khối không chỉ tạo ra một bề ngoài mượt mà mà còn góp phần vào độ bền và cảm giác cao cấp của iPad.\r\n\r\nVề độ mỏng và khối lượng, iPad Pro M4 256GB tỏa sáng với 5.3 mm độ dày và nặng chỉ 444 g, được cho là một trong những chiếc máy tính bảng mỏng nhẹ nhất hiện nay. Điều này chứng tỏ Apple luôn chú trọng vào việc tối ưu hóa kích thước để mang lại sự thoải mái nhất cho người dùng đi kèm với phần hiệu năng mạnh mẽ của máy.\r\n\r\niPad Pro M4 11 inch WiFi 256GB - Độ mỏng\r\n\r\nApple Pencil Pro khi kết hợp với iPad Pro M4 256GB tạo nên một công cụ sáng tạo tiên tiến với nhiều tính năng ưu việt. Công nghệ phản hồi xúc giác cho phép người dùng tận hưởng trải nghiệm vẽ và ghi chú chân thực, với mỗi cử động được tái tạo một cách sinh động. Không chỉ vậy, tính năng tìm kiếm trong ứng dụng Tìm giúp người dùng dễ dàng định vị bút khi cần thiết, mang lại sự an tâm tối đa.\r\n\r\nLưu ý: Bút Apple Pencil Pro và Magic Keyboard là phụ kiện được mua riêng.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/3a2ea11d-50d5-4f87-991a-84c1003e917b.jpg?alt=media', 'Màn hình\r\n\r\nCông nghệ màn hình:\r\n\r\nUltra Retina XDR\r\nĐộ phân giải:\r\n\r\n1668 x 2420 Pixels\r\nMàn hình rộng:\r\n\r\n11\" - Tần số quét 120 Hz\r\nHệ điều hành & CPU\r\n\r\nHệ điều hành:\r\n\r\niPadOS 17\r\nChip xử lý (CPU):\r\n\r\nApple M4 9 nhân\r\nTốc độ CPU:\r\nHãng không công bố\r\nChip đồ hoạ (GPU):\r\n\r\nApple GPU 10 nhân\r\nBộ nhớ & Lưu trữ\r\n\r\nRAM:\r\n8 GB\r\nDung lượng lưu trữ:\r\n\r\n256 GB\r\nDung lượng còn lại (khả dụng) khoảng:\r\n\r\n241 GB', 'Máy tính bảng iPad Pro M4 11 inch WiFi 512GB', 0, 'ACTIVE', '2024-07-14 18:04:06.924432', NULL, 5, 3);
