XDR\r\nĐộ phân giải:\r\n\r\n1668 x 2420 Pixels\r\nMàn hình rộng:\r\n\r\n11\" - Tần số quét 120 Hz\r\nHệ điều hành & CPU\r\n\r\nHệ điều hành:\r\n\r\niPadOS 17\r\nChip xử lý (CPU):\r\n\r\nApple M4 9 nhân\r\nTốc độ CPU:\r\nHãng không công bố\r\nChip đồ hoạ (GPU):\r\n\r\nApple GPU 10 nhân\r\nBộ nhớ & Lưu trữ\r\n\r\nRAM:\r\n8 GB\r\nDung lượng lưu trữ:\r\n\r\n256 GB\r\nDung lượng còn lại (khả dụng) khoảng:\r\n\r\n241 GB', 'Máy tính bảng iPad Pro M4 11 inch 5G 256GB', 0, 'ACTIVE', '2024-07-14 18:04:06.943511', NULL, 5, 3);
INSERT INTO `product` VALUES (81, '2024-07-14 18:05:20.508818', 'ĐÔI NÉT VỀ SẢN PHẨM ÁO THUN NAM\r\n\r\nÁo thun nam là trang phục cơ bản và tiện dụng nhất đối với phái mạnh. Hầu như người đàn ông nào cũng đều phải có vài chiếc áo pull nam trong tủ áo của mình. Việc mua áo thun nam cũng được bàn tán sôi nổi trên khắp các diễn đàn hay blog cá nhân. Với những ưu điểm tuyệt vời như phong cách đa dạng, kiểu dáng đơn giản và chất liệu thoáng mát, áo thun nam Hàn Quốc được phái mạnh yêu thích và lựa chọn khi đến công sở hay dạo phố. Bên cạnh đó, áo thun nam cổ trụ cũng được các chàng trai văn phòng yêu thích vì nét lịch sự và trẻ trung. Chỉ cần kết hợp áo thun nam body với quần jeans nam hay quần kaki nam và những phụ kiện đi kèm như ví nam, túi du lịch nam hay đơn giản hơn là chiếc balo laptop nam năng động, bạn đã có ngay bộ cánh đơn giản mà hiện đại.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/88ecade0-c4b9-420e-aabb-6c841e1ffc66.jpg?alt=media', '- Chất liệu: Vải thun cá sấu cao cấp, 4 chiều co dãn mềm mại, thấm hút mồ hôi tốt, không nóng bức khi vận động nhiều, không nhăn, không co rút sau khi giặt.\r\n\r\nĐặc điểm nổi bật: \r\n\r\n- Cổ áo và tay áo phối sọc tinh tế tạo điểm nhấn thời trang bắt mắt\r\n\r\n- Thiết kế trang nhã, màu sắc ấn tượng, tiện dụng và thoải mái mang đến vẻ thanh lịch, tự tin cho người mặc.\r\n\r\n - Form áo suông phù hợp với mọi độ tuổi, tay áo bo nhẹ khỏe khoắn.\r\n\r\n - Áo Thun có cổ rất đa năng, mặc được trong nhiều dịp khác nhau, đi dạo phố cùng bạn bè, đi phượt, mặc hàng ngày...\r\n\r\n - Với thiết kế đơn giản nhưng đẳng cấp, cùng với sự tiện dụng và thoải mái khi mặc.\r\n\r\n-	Xuất xứ: Việt Nam\r\n\r\n-	Size: S-M-L-XL-XXL-3XL (Tham khảo bảng size ở hình ảnh kỹ hơn)', 'Áo thun polo nam vải cá sấu phối sọc viền tay viền cổ Everest 10 mẫu phối màu mới 2024', 0, 'ACTIVE', '2024-07-14 18:05:20.508818', NULL, 53, 5);
INSERT INTO `product` VALUES (82, '2024-07-14 18:13:08.757287', 'Mới khô nhanh băng lụa Bộ đồ liền thân Áo thun nam ngắn tay mùa hè Quần Short thường ngày thể thao Hai mảnh đẹp trai Nam giới\r\n\r\nNâng cấp vải, vải thoáng khí lụa băng, bền và thoải mái, vải mới có kết cấu hơn, màu đồng nhất không phai, hút ẩm và thoáng khí, mềm mại và thân thiện với làn da, không dễ đóng cọc, chống mài mòn. Điểm bán vải: Vải đặc biệt, phần thoáng khí, cảm giác mát lạnh tức thì, nhiệt độ thấp lâu dài, màu cao chắc chắn, không phai màu, co giãn tự do, tốt và thoáng khí, Tạm biệt làn da, thoải mái và thân thiện với làn da, mềm hơn, mỏng hơn và thoáng khí hơn.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/05ee1833-f55e-46e3-aba8-bc6dcf4f8d07.jpg?alt=media', 'Mới khô nhanh băng lụa Bộ đồ liền thân Áo thun nam ngắn tay mùa hè Quần Short thường ngày thể thao Hai mảnh đẹp trai Nam giới\r\n\r\nNâng cấp vải, vải thoáng khí lụa băng, bền và thoải mái, vải mới có kết cấu hơn, màu đồng nhất không phai, hút ẩm và thoáng khí, mềm mại và thân thiện với làn da, không dễ đóng cọc, chống mài mòn. Điểm bán vải: Vải đặc biệt, phần thoáng khí, cảm giác mát lạnh tức thì, nhiệt độ thấp lâu dài, màu cao chắc chắn, không phai màu, co giãn tự do, tốt và thoáng khí, Tạm biệt làn da, thoải mái và thân thiện với làn da, mềm hơn, mỏng hơn và thoáng khí hơn.', 'Mùa Hè Nhanh Khô Băng Lụa Chuyển Màu Phù Hợp Với Nam Áo Thun Ngắn Tay Mùa Hè Quần Short Thể Thao Hai Mảnh', 0, 'ACTIVE', '2024-07-14 18:13:08.757287', NULL, 53, 5);
INSERT INTO `product` VALUES (83, '2024-07-14 18:28:36.545040', 'CAM KẾT CỦA SHOP\r\nSản phẩm chuẩn chất lượng, đúng với hình ảnh và video mà shop cung cấp\r\nDịch vụ khách hàng luôn tận tâm và nhiệt tình\r\nNhắn tin cho shop để được tư vấn về size của sản phẩm\r\nThời gian chuẩn bị, đóng gói và giao hàng luôn được tối ưu nhất\r\nĐổi trả sản phẩm nếu có lỗi từ nhà sản xuất theo quy định của Shopee:\r\n1. Điều kiện áp dụng (trong vòng 03 ngày kể từ khi nhận sản phẩm):\r\n - Hàng hoá vẫn còn mới, chưa qua sử dụng\r\n2. Trường hợp được chấp nhận:\r\n- Hàng không đúng size, kiểu dáng như quý khách đặt hàng	\r\n- Không đủ số lượng, không đủ bộ như trong đơn hàng\r\n3. Trường hợp không đủ điều kiện áp dụng chính sách:		\r\n- Quá 03 ngày kể từ khi Quý khách nhận hàng					\r\n- Gửi lại hàng không đúng mẫu mã, không phải hàng của Gen Z Store HN', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/b948155b-4d46-46aa-ab9c-ab04cd42bd1a.jpg?alt=media', 'Quần jeans baggy nam ống suông rộng màu xanh, đen vải bò dày dặn T1 - GenZ Store HN\r\n\r\nTHÔNG TIN VỀ SẢN PHẨM QUẦN JEANS BAGGY NAM ỐNG SUÔNG RỘNG\r\n- Xuất xứ: Việt Nam\r\n- Chất liệu: 97% cotton, 3% spandex\r\n- Màu sắc: Xanh Nhạt, Đen Trơn\r\n- Kiểu dáng: Trơn\r\n- Kích thước: Size 27 - 36\r\n*Hãy nhắn tin cho shop để được tư vấn size chuẩn nhất với bạn!\r\n- Đặc điểm nổi bật:\r\n+ Quần jeans nam ống suông rộng, cạp cao, dáng đứng giúp tạo nên form cực chuẩn cho người mặc.\r\n+ Quần jeans nút cài, có 4 túi lớn rất thuận tiện cho việc đựng smart phone hoặc ví cỡ bự.\r\n+ Quần có màu xanh nhạt và đen trơn được nhuộm kỹ giúp hạn chế tối đa việc phai màu khi sử dụng.\r\n+ Sản phẩm được đảm bảo với quy trình sản xuất chất lượng với đường may chắc chắn, tỉ mỉ từng chi tiết.\r\n*Màu sản phẩm có thể sẽ chênh lệch thực tế một phần nhỏ, do ảnh hưởng về độ lệch màu của ánh sáng nhưng vẫn đảm bảo chất lượng.', 'Quần jeans baggy nam ống suông rộng màu xanh, đen vải bò dày dặn T1 - GenZ Store HN', 2, 'ACTIVE', '2024-07-14 18:28:36.545040', NULL, 54, 5);
INSERT INTO `product` VALUES (84, '2024-07-14 18:31:54.797560', '🔰  HƯỚNG DẪN CÁCH ĐẶT HÀNG:\r\n\r\n⏩  Cách chọn size: Shop có bảng size mẫu. Bạn NÊN INBOX, cung cấp chiều cao, cân nặng để SHOP TƯ VẤN SIZE\r\n\r\n⏩ Mã sản phẩm đã có trong ảnh\r\n\r\n⏩ Cách đặt hàng: Nếu bạn muốn mua 2 sản phẩm khác nhau hoặc 2 size khác nhau, để được freeship\r\n\r\n-	Bạn chọn từng sản phẩm rồi thêm vào giỏ hàng\r\n\r\n-	Khi giỏ hàng đã có đầy đủ các sản phẩm cần mua, bạn mới tiến hành ấn nút “ Thanh toán”\r\n\r\n\r\n\r\n⏩ QUY ĐỊNH ĐỔI HÀNG:\r\n\r\n- Còn nguyên tem & nhãn mác. \r\n\r\n- Chưa qua sử dụng giặt ủi & chỉnh sửa.\r\n\r\n- Được đổi hàng trong vòng 7 ngày kể từ ngày nhận hàng.\r\n\r\nSản phẩm bị lỗi do sản xuất sẽ được chấp nhận đổi nếu đảm bảo đầy đủ những điều kiện trên.\r\n\r\n⏩ Shop luôn sẵn sàng trả lời inbox để tư vấn.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/11e69e22-def6-4c9e-9458-95ef170e3f9c.jpg?alt=media', '- Mẫu Jogger vải kaki cotton co giãn tốt\r\n\r\n- Vải kaki cotton co giãn, thấm hút mồ hôi tốt nên mặc rất thoải mái \r\n\r\n- Với 2 túi quần trước và 2 túi sau sâu, bạn để ví hay nhưng dòng điện thoại smart phone không sợ bị rơi hay trồi ra\r\n\r\n\r\n\r\n- Với 6 màu cơ bản dễ phối đồ: Đen, Xanh đen, Vàng Bò, Xám Nhạt, Xám Đậm, Xanh rêu\r\n\r\n\r\n\r\nSize 29: 50-57kg\r\n\r\nSize 30: 58-67kg\r\n\r\nSize 31: 68-74kg\r\n\r\nSize 32: 75-80kg\r\n\r\nSize 34: 81-87kg\r\n\r\nSize 36: 88- 100kg', 'Quần Jogger kaki khoá kéo - Jogger kaki nam co giãn JGKK 02', 0, 'ACTIVE', '2024-07-14 18:31:54.797560', NULL, 54, 5);
INSERT INTO `product` VALUES (85, '2024-07-14 18:35:55.613424', 'Phong cách\r\nPhong cách quân đội\r\nGửi từ\r\nNước ngoài\r\n\r\nPhong cách\r\nPhong cách quân đội\r\nGửi từ\r\nNước ngoài\r\n\r\nPhong cách\r\nPhong cách quân đội\r\nGửi từ\r\nNước ngoài', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/738864d1-e83f-4740-af74-023729087248.jpg?alt=media', 'Khuyến nghị kích thước\r\n\r\nSize M: Vòng eo: 54 ~ 94cm; Vòng hông: 94cm;\r\n\r\nSize L: Vòng eo: 58 ~ 98cm; Vòng hông: 98cm;\r\n\r\nSize XL: Vòng eo: 62 ~ 102cm; Vòng hông: 102cm;\r\n\r\nSize 2XL: Vòng eo: 66 ~ 106cm; Vòng hông: 106cm;\r\n\r\nSize 3XL: Vòng eo: 70 ~ 110cm; Vòng hông: 110cm;\r\n\r\nSize 4XL: Vòng eo: 74 ~ 114cm; Vòng hông: 114cm;\r\n\r\nSize 5XL: Vòng eo: 78 ~ 118cm; Vòng hông: 118cm;\r\n\r\nM: 145 ~ 160cm; 40 ~ 50kg,\r\n\r\nL: 145 ~ 160cm; 50 ~ 55kg,\r\n\r\nXl: 155 ~ 160cm; 55 ~ 60kg,\r\n\r\n2xl: 165 ~ 178cm; 60 ~ 75kg,\r\n\r\n3xl: 168 ~ 180cm; 75 ~ 85kg,\r\n\r\n4xl: 168 ~ 180cm; 80 ~ 90kg,\r\n\r\n5xl: 168 ~ 180cm; 90 ~ 95KG.', 'Phiên bản Hàn Quốc Quần công sở hợp thời trang Thiết kế phong cách Preppy Quần legging màu sắc tương phản', 0, 'ACTIVE', '2024-07-14 18:35:55.613424', NULL, 54, 5);
INSERT INTO `product` VALUES (86, '2024-07-14 18:38:33.605512', 'THÔNG TIN SẢN PHẨM\r\n⭐Chất liệu: quần túi hộp được sản xuất bằng chất Kaki Cotton có pha chút Polly. Chất vải được sản xuất bởi Haven được kiểm duyệt đảm bảo chất vải Dày Dặn, kiểm soát thuốc nhuộm AN TOÀN CHO DA. Đảm bảo thoáng mát, đứng form cho người mặc\r\n⭐ Đường may: Quần túi hộp được sản xuất chính bởi Haven nên cam kết về sự chắc chắn và tỉ mỉ trong từng đường chỉ.\r\n⭐ Kiểu dáng: Quần túi hộp được sản xuất với sự đa dạng về cách mặc của cả nam và nữ. ĐẶC BIỆT QUẦN CHÚNG TỚ GIỮ FORM RẤT CHẮC CHẮN phù hợp cho các bạn trẻ  hoạt động mạnh.\r\n+ Bạn kéo quần xuống dưới rốn thì quần sẽ có form kiểu dáng thụng, kiểu quần hiphop ống rộng\r\n+ Bạn kéo quần trên rốn thì quần sẽ có form dạng quần ống suông, giúp chân dài hơn, che đi các khuyết điểm đùi to, chân vòng kiềng\r\n+ Nếu bạn muốn mặc thể thao, hoạt động mạnh thì mình có thể kéo dây quần dưới ống chân, trở thành chiếc quần jogger khỏe khoắn\r\n⭐ Màu sắc: quần túi hộp ống rộng có 7 màu Trắng, Đen, Xám, Đỏ, Hồng pastel, Xanh rêu, Trắng be (Do điều kiện ánh sáng & màn hình hiển thị nên sẽ có sự chênh lệch màu sắc so với thực tế ạ )', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/da498f61-b30e-490c-ac5d-63356759466c.jpg?alt=media', '📏BẢNG SIZE CHI TIẾT SẢN PHẨM\r\n    - Size S: Dài 96 – Đùi 58 - Mông 90 - Ống chân 52 => Các bạn từ 1m50-1m58 & 43-55kg\r\n    - Size M: Dài 98 – Đùi 60 - Mông 95 - Ống chân 54 => Các bạn từ 1m58-1m65 & 55-60kg\r\n    - Size L: Dài 102 – Đùi 62 - Mông  105 - Ống chân 56 => Các bạn từ 1m65-1m73 & 60-70kg\r\n    - Size XL: Dài 105 – Đùi 64 - Mông 110 - Ống chân 58 => Các bạn từ 1m73-1m78 & 70-80kg\r\n    - Size 2XL: Dài 107 – Đùi 68 - Mông 116 - Ống chân 60 => Các bạn từ 1m78-1m90 & 80-95kg', 'Quần túi hộp ống rộng nam nữ Haven kaki cotton, dài, dây rút quần jogger bigzise đen trắng xám', 0, 'ACTIVE', '2024-07-14 18:38:33.605512', NULL, 54, 5);
INSERT INTO `product` VALUES (87, '2024-07-14 18:45:20.064184', '✅Cách bơm: ❶Bơm thủ công bằng bơm tay (tùy chọn)\r\n\r\n❷ Sử dụng bơm điện (tùy chọn)\r\n\r\n✅Lưu ý:\r\n\r\n❶Khi trẻ em xuống nước, người lớn phải luôn giám sát cẩn thận;\r\n\r\n❷Không đặt sản phẩm trên mặt đất không bằng phẳng;\r\n\r\n❸Không tiếp xúc với vật sắc nhọn hoặc nước nóng;\r\n\r\n❹Không bơm căng quá mức;\r\n\r\n❺Các vết thủng hoặc vết rách nhỏ do sử dụng không đúng cách có thể dễ dàng sửa chữa bằng cách sử dụng bộ sửa chữa được cung cấp kèm theo hồ bơi (keo dán và miếng vá) hoặc mua miếng vá xe đạp.\r\n\r\n✅Về màu sắc: Do ánh sáng và các lô sản xuất khác nhau nên có thể có một số khác biệt nhất định giữa hình ảnh và sản phẩm thực tế. Vui lòng lấy hình ảnh thực tế làm chuẩn.\r\n\r\n✅Điểm lưu ý nho nhỏ: Các thông số kỹ thuật trong mô tả sản phẩm đều được đo thủ công. Vì kích thước thực của sản phẩm còn phụ thuộc vào độ căng khi bơm nên sẽ có sai số 5-15cm là bình thường.\r\n\r\n✅Đảm bảo dịch vụ: Hỗ trợ đổi hoàn trong vòng 7 ngày\r\n\r\n✅Chăm sóc khách hàng: Nhóm chăm sóc khách hàng chuyên nghiệp, luôn sẵn sàng phục vụ quý khách', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/1beca2e5-c020-4264-872e-6209a5f1fdfa.jpg?alt=media', 'Bể hình bãi biển\r\n\r\n❶1M2-2 tầng: 120×90×33CM; \r\n\r\n❷1M3-3 tầng: 130×90×50CM; \r\n\r\n❸1M5-2 tầng: 150×110×33CM; \r\n\r\n❹1M5-3 tầng: 150×110×50CM; \r\n\r\n❺1M8-3 tầng: 180×140×60CM; \r\n\r\n❻2M1-3 tầng: 210×145×65CM; \r\n\r\nBể tiến sĩ truyền thống\r\n\r\n❶1M2-2 tầng: 120×85×35CM;\r\n\r\n❷1M3-3 tầng: 130×85×55CM; \r\n\r\n❸1M5-2 tầng: 150×110×35CM;\r\n\r\n❹1M5-3 tầng: 150×110×50CM;\r\n\r\n❺1M8-3 tầng: 180×140×60CM; \r\n\r\n❻2M1-3 tầng: 210×145×65CM;', 'Hồ bơi cho bé phao bơi cho bé bể bơi cho bé bể bơi trẻ em bể bơi bơm hơi to gia đình nhựa 2-3 tầng', 0, 'ACTIVE', '2024-07-14 18:45:20.064184', NULL, 56, 5);
INSERT INTO `product` VALUES (88, '2024-07-14 18:46:59.630447', 'Chi tiết sản phẩm\r\n- Chất liệu : nhựa ABS an toàn cho bé\r\n- Bộ sản phẩm gồm 3 con quay : 1 con quay bọ vàng 2 cánh , 1 mickey xanh 3 cánh và 1 con bướm hồng 4 cánh\r\n- Cách dùng: đế hít chân không gắn các bề mặt trơn như kính , gỗ trơn, nhựa, mặt đá hoa trơn ...', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/2f360520-9895-4a94-b569-d0bee5a535ba.jpg?alt=media', 'Đặc điểm nổi bật : \r\n- Giúp bé vui chơi lành mạnh hạn chế sử dụng smart phone ^^\r\n- Sử dụng cho bé chơi thu hút sự chú ý của bé trong lúc ăn, tắm, ... thay thế cho việc xem điện thoại hiện tại\r\n- Chất liệu nhựa ABS cao cấp, cọ độ bền cao, có khả năng chống rơi rớt, đồng thời chống thấm nước rất hiệu quả. \r\n- Đồ chơi spinner đi kèm với một cốc hút ở phía dưới có thể bám vào bất cứ bề mặt nào nhẵn và phẳng để bé yêu của bạn không bị giới hạn trong việc tận hưởng niềm vui với con quay con trùng dễ thương này.\r\n- Hình dáng côn trùng dễ thương, màu sắc bắt mắt thu hút sự chú ý của bé khi chơi, giúp bé không quấy khóc khi tắm.\r\n- Đồ chơi con quay có bề mặt nhẵn, không có gờ trên bề mặt nên sẽ không làm tổn thương bé khi chơi.', 'Set 3 đồ chơi con quay spinner vui nhộn cho bé chơi lành mạnh chất liệu nhựa ABS an toàn - đồ chơi thông minh Bi House', 0, 'ACTIVE', '2024-07-14 18:46:59.630447', NULL, 56, 5);
INSERT INTO `product` VALUES (89, '2024-07-14 18:48:00.161007', 'Đặc điểm nổi bật của iPad Air M2 128GB\r\n• Hiệu năng bứt phá với chip Apple M2\r\n• Camera trước cải tiến với việc đặt ống kính ở cạnh dài của máy\r\n• Màn hình Retina IPS LCD 11 inch hỗ trợ độ phân giải cao\r\n• Thời lượng sử dụng lên đến 10 tiếng\r\n• Hỗ trợ Apple Pencil Pro và tích hợp nhiều tính năng mới\r\n\r\niPad Air M2 128GB, với chip Apple M2 đánh dấu một bước tiến đột phá trong công nghệ, nâng cao trải nghiệm người dùng với hiệu suất ấn tượng và thiết kế tinh tế. Đây không chỉ là một công cụ làm việc mạnh mẽ mà còn là người bạn đồng hành giải trí lý tưởng, hứa hẹn mang lại trải nghiệm người dùng không giới hạn.\r\nThiết kế cao cấp, hiện đại\r\niPad Air M2 128GB tiếp tục kế thừa thiết kế sang trọng và tinh tế với khung viền vuông vức mang đến vẻ ngoài hiện đại, phù hợp với xu hướng của các sản phẩm công nghệ cao cấp. Các góc của máy được bo tròn mềm mại, không chỉ tăng thêm tính thẩm mỹ mà còn giúp cải thiện cảm giác cầm nắm, đem lại trải nghiệm thoải mái cho người dùng khi sử dụng trong thời gian dài.\r\n\r\niPad Air M2 11 inch WiFi 128GB - Thiết kế\r\n\r\nNgoài ra, phần cạnh trên của iPad Air M2 128GB được tích hợp nút nguồn đa năng, bao gồm cả cảm biến vân tay Touch ID, cho phép người dùng mở khóa máy nhanh chóng và an toàn, mang lại sự tiện lợi tối đa trong việc truy cập nhanh chóng vào các ứng dụng và dữ liệu mà không cần phải nhập mật khẩu mỗi lần sử dụng.\r\n\r\niPad Air M2 đạt được sự cân bằng giữa tính thẩm mỹ và tính năng với thiết kế mỏng và nhẹ, cho phép màn hình 11 inch trở thành tâm điểm mà không làm tăng kích thước tổng thể của máy. Điều này không chỉ cải thiện tính di động mà còn phản ánh xu hướng hiện đại trong công nghệ.\r\n\r\niPad Air M2 11 inch WiFi 128GB - Màu sắc\r\n\r\nApple Pencil Pro trên iPad Air M2 128GB là một công cụ sáng tạo đột phá, tích hợp nhiều tính năng cao cấp. Với công nghệ phản hồi xúc giác, người dùng có thể cảm nhận được các tương tác một cách sinh động, từ đó nâng cao trải nghiệm sử dụng. Ngoài ra, tính năng tìm kiếm trong ứng dụng Tìm giúp người dùng dễ dàng định vị bút khi cần thiết, mang lại sự an tâm tối đa.\r\n\r\nLưu ý: Bút Apple Pencil Pro không đi kèm trong hộp.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/6bd45ec5-0216-426e-aa37-f48413122d75.jpg?alt=media', 'Màn hình\r\n\r\nCông nghệ màn hình:\r\n\r\nRetina IPS LCD\r\nĐộ phân giải:\r\n\r\n1640 x 2360 Pixels\r\nMàn hình rộng:\r\n\r\n11\" - Tần số quét Hãng không công bố\r\nHệ điều hành & CPU\r\n\r\nHệ điều hành:\r\n\r\niPadOS 17\r\nChip xử lý (CPU):\r\n\r\nApple M2 8 nhân\r\nTốc độ CPU:\r\nHãng không công bố\r\nChip đồ hoạ (GPU):\r\n\r\nApple GPU 9 nhân\r\nBộ nhớ & Lưu trữ\r\n\r\nRAM:\r\n8 GB\r\nDung lượng lưu trữ:\r\n\r\n128 GB\r\nDung lượng còn lại (khả dụng) khoảng:\r\n\r\n113 GB', 'Máy tính bảng iPad Air 6 M2 11 inch WiFi 128GB', 0, 'ACTIVE', '2024-07-14 18:48:00.161007', NULL, 5, 3);
INSERT INTO `product` VALUES (90, '2024-07-14 18:48:00.331025', 'Đặc điểm nổi bật của iPad Air M2 128GB\r\n• Hiệu năng bứt phá với chip Apple M2\r\n• Camera trước cải tiến với việc đặt ống kính ở cạnh dài của máy\r\n• Màn hình Retina IPS LCD 11 inch hỗ trợ độ phân giải cao\r\n• Thời lượng sử dụng lên đến 10 tiếng\r\n• Hỗ trợ Apple Pencil Pro và tích hợp nhiều tính năng mới\r\n\r\niPad Air M2 128GB, với chip Apple M2 đánh dấu một bước tiến đột phá trong công nghệ, nâng cao trải nghiệm người dùng với hiệu suất ấn tượng và thiết kế tinh tế. Đây không chỉ là một công cụ làm việc mạnh mẽ mà còn là người bạn đồng hành giải trí lý tưởng, hứa hẹn mang lại trải nghiệm người dùng không giới hạn.\r\nThiết kế cao cấp, hiện đại\r\niPad Air M2 128GB tiếp tục kế thừa thiết kế sang trọng và tinh tế với khung viền vuông vức mang đến vẻ ngoài hiện đại, phù hợp với xu hướng của các sản phẩm công nghệ cao cấp. Các góc của máy được bo tròn mềm mại, không chỉ tăng thêm tính thẩm mỹ mà còn giúp cải thiện cảm giác cầm nắm, đem lại trải nghiệm thoải mái cho người dùng khi sử dụng trong thời gian dài.\r\n\r\niPad Air M2 11 inch WiFi 128GB - Thiết kế\r\n\r\nNgoài ra, phần cạnh trên của iPad Air M2 128GB được tích hợp nút nguồn đa năng, bao gồm cả cảm biến vân tay Touch ID, cho phép người dùng mở khóa máy nhanh chóng và an toàn, mang lại sự tiện lợi tối đa trong việc truy cập nhanh chóng vào các ứng dụng và dữ liệu mà không cần phải nhập mật khẩu mỗi lần sử dụng.\r\n\r\niPad Air M2 đạt được sự cân bằng giữa tính thẩm mỹ và tính năng với thiết kế mỏng và nhẹ, cho phép màn hình 11 inch trở thành tâm điểm mà không làm tăng kích thước tổng thể của máy. Điều này không chỉ cải thiện tính di động mà còn phản ánh xu hướng hiện đại trong công nghệ.\r\n\r\niPad Air M2 11 inch WiFi 128GB - Màu sắc\r\n\r\nApple Pencil Pro trên iPad Air M2 128GB là một công cụ sáng tạo đột phá, tích hợp nhiều tính năng cao cấp. Với công nghệ phản hồi xúc giác, người dùng có thể cảm nhận được các tương tác một cách sinh động, từ đó nâng cao trải nghiệm sử dụng. Ngoài ra, tính năng tìm kiếm trong ứng dụng Tìm giúp người dùng dễ dàng định vị bút khi cần thiết, mang lại sự an tâm tối đa.\r\n\r\nLưu ý: Bút Apple Pencil Pro không đi kèm trong hộp.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/283916fb-5bf3-46f0-ad9d-a0f355030926.jpg?alt=media', 'Màn hình\r\n\r\nCông nghệ màn hình:\r\n\r\nRetina IPS LCD\r\nĐộ phân giải:\r\n\r\n1640 x 2360 Pixels\r\nMàn hình rộng:\r\n\r\n11\" - Tần số quét Hãng không công bố\r\nHệ điều hành & CPU\r\n\r\nHệ điều hành:\r\n\r\niPadOS 17\r\nChip xử lý (CPU):\r\n\r\nApple M2 8 nhân\r\nTốc độ CPU:\r\nHãng không công bố\r\nChip đồ hoạ (GPU):\r\n\r\nApple GPU 9 nhân\r\nBộ nhớ & Lưu trữ\r\n\r\nRAM:\r\n8 GB\r\nDung lượng lưu trữ:\r\n\r\n128 GB\r\nDung lượng còn lại (khả dụng) khoảng:\r\n\r\n113 GB', 'Máy tính bảng iPad Air 6 M2 11 inch 5G128GB', 0, 'ACTIVE', '2024-07-14 18:48:00.332021', NULL, 5, 3);
