INSERT INTO `product` VALUES (93, '2024-07-14 18:49:30.527965', 'Máy dùng pin 2A (x2) \r\nÂm thanh đủ nghe\r\nCác chi tiết chắc chắn\r\nGiao hàng nhanh, giá rẻ\r\nGiao hàng nhanh, đóng gói cẩn thận, giá rẻ nhưng chơi khá vui, bé rất thích', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/6b5422bb-1e5f-4f7d-8efa-47efae208e41.jpg?alt=media', '1, Giai điệu mẫu giáoTrigger để phát bài hát tiếp theo (Nội dung gồm 3 bài hát)\r\n\r\n2, Làm dịu\r\n\r\nKích hoạt để phát bài hát tiếp theo (Nội dung gồm 8 bài hát\r\n\r\n3, Giao thông vận tải\r\n\r\nKích hoạt để phát bài hát tiếp theo (Nội dung chứa các bài hát $\r\n\r\n4, Chuông điện thoại\r\n\r\nIrigger để phát bài hát tiếp theo (Nội dung chứa các bài hát $)\r\n\r\n5, Piano MusicTrigger để phát nội dung bài hát tiếp theo gồm 8 bài hát)\r\n\r\n6, Khả năng miễn dịch kháng khuẩn Kích hoạt phát nội dung bài hát tiếp theo gồm 2 bài hát)\r\n\r\n7, Nhận dạng thời tiết\r\n\r\nKích hoạt để phát bài hát tiếp theo (Nội dung gồm 5 bài hát\r\n\r\n8, Hiệu ứng âm thanh máy ảnh\r\n\r\nKích hoạt để phát bài hát tiếp theo (Nội dung gồm 2 bài hát)\r\n\r\n9. Giấc ngủ êm dịu\r\n\r\nKích hoạt để phát nội dung bài hát tiếp theo gồm 2 bài hát\r\n\r\n10. Kích hoạt hiệu ứng âm thanh cho bé để phát nội dung bài hát tiếp theo gồm 4 bài hát\r\n\r\n11, Animal CognitionTrigger để phát bài hát tiếp theo (Nội dung chứa các bài hát $\r\n\r\n12. Chuyển đổi chế độ Giáo dục song ngữ', 'Đồ Chơi Học Tập Giáo Dục Cho Bé 0 12 Tháng Montessori Đèn Nhạc Piano Điện Thoại Di Động Bé Gái Trẻ Em Điện Thoại', 0, 'ACTIVE', '2024-07-14 18:49:30.527965', NULL, 56, 5);
INSERT INTO `product` VALUES (94, '2024-07-14 18:51:28.560003', 'CÁCH CHƠI\r\n- Có rất nhiều cách chơi theo từng lứa tuổi và độ khóa tuy nhiên chủ yếu là Đặt ếch theo vị trí mong muốn làm sao cho bàn không bị nghiên, dẫn đến bị ngã sẽ thua. Theo độ khó từ thấp đến cao.\r\n1. Không cần dùng đến xúc xắc, mỗi lượt đi 1 con đến hết bàn, chủ yếu cho bé suy luận xác định vị trí cân bằng.\r\n2. Đổ xúc xắc và đặt ếch theo số điểm xúc xắc cho mỗi lượt chơi. VD 5 điểm thì đặt 5 chú ếch theo các vị trí mong muốn.\r\n3. Tương tự như bước 2 tuy nhiên bắt buộc phải đặt ếch theo nhóm dính với nhau. VD 4 điểm đặt Nhóm 4 ếch dính với nhau không được rời rạc.\r\n\r\nCÔNG DỤNG SẢN PHẨM\r\n- Phù hợp cho bé trai và bé gái trong mọi độ tuổi và cả người lớn.\r\n- Giúp các Bé vận động, tránh xa tivi, điện thoại.\r\n- Rèn luyện sự tập trung cao độ và tính kiên nhẫn khi chơi, Tăng khả năng phối hợp tay mắt, bé khéo léo và tỉ mỉ.\r\n- Giúp bé học hỏi tăng trí thông minh logic, hiểu rõ về sự vật hiện tượng\r\n- Bé tự làm handmade DIY tạo ra món đồ chơi cho riêng mình, tăng tính sáng tạo và mỹ thuật\r\n- Giảm stress căng thẳng sau những giờ học tập và làm việc.\r\n- Chơi chung nhóm bạn và gia đình tăng tương tác, trò chuyện, tạo sự gắn kết với nhau.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/5e399f1c-8107-4cc6-9a50-3d46ebffde3a.jpg?alt=media', '- Bộ đồ chơi gồm:\r\n+ Bộ bàn cân bằng màu lục.\r\n+ 1 chân đế.\r\n+ 1 cây chống.\r\n+ 1 bàn cân bằng.\r\n+ 50 chú ếch.\r\n+ 1 viên xúc xắc.\r\n-  Màu sắc: xanh lá.\r\n- Chất liệu: Nhựa.', 'Cây Cân Bằng Ếch Đồ Chơi Xếp Hình Cây Thăng Bằng Chú Ếch Balance Frog Dễ Thương Đồ Chơi Trẻ Em Khéo Léo - Little Kobo', 0, 'ACTIVE', '2024-07-14 18:51:28.560003', NULL, 56, 5);
INSERT INTO `product` VALUES (95, '2024-07-14 18:58:00.825797', 'Tại sự kiện Unpacked 2023 diễn ra tại Hàn Quốc, Samsung đã trình làng mẫu máy tính bảng Samsung Galaxy S thế hệ mới Samsung Galaxy Tab S9+ WiFi 256GB. Máy sở hữu hiệu năng mạnh mẽ, màn hình hiển thị sắc nét và điểm đặc biệt đây là máy có khả năng kháng nước IP68 cùng nhiều tính năng hấp dẫn khác.\r\nThiết kế đẹp mắt xứng danh flagship\r\nSamsung Galaxy Tab S9+ WiFi vẫn giữ nguyên những đặc điểm thiết kế độc đáo của thế hệ tiền nhiệm, nhưng đã đổi mới ở một vài điểm. Thay vì đặt camera vào một cụm thì giờ đây đã được tách riêng ra, làm cho vẻ ngoài của máy trở nên thanh thoát và sang trọng hơn.\r\n\r\nThiết kế thanh lịch - Samsung Galaxy Tab S9+ WiFi 256GB\r\n\r\nMáy có một thiết kế nguyên khối và được làm với hình dáng vuông vức, điều này giúp máy phản ánh xu hướng thiết kế hiện đại và sang trọng. Máy sử dụng chất liệu nhôm và đạt khối lượng 581 g, khi cầm trên tay mình cảm giác máy không quá nặng và mình có thể sử dụng hai tay trong thời gian dài mà không gặp hiện tượng mỏi tay.\r\n\r\nTuy nhiên, đối với các bạn nữ, mình nghĩ nên trang bị bộ bàn phím để có thể dựng máy đứng vững ở trên bàn và đồng thời biến nó thành một chiếc laptop với Samsung DeX để sử dụng được thuận tiện hơn.\r\n\r\nThiết kế siêu mỏng - Samsung Galaxy Tab S9+ WiFi 256GB\r\n\r\nMặt lưng của Tab S9+ WiFi được thiết kế với độ nhám vừa phải, mang lại sự thoải mái khi sử dụng và tránh trượt. Tuy nhiên, mặt lưng vẫn bám mồ hôi và dấu vân tay, điều này có thể là một điểm mình không ưng lắm. Để giảm thiểu tình trạng này, bạn nên trang bị ốp lưng cho máy để hạn chế dấu vân tay cũng như là bảo vệ máy tốt hơn tránh những vết xước không đáng có.\r\n\r\nMở rộng không gian quan sát với màn hình lớn\r\nMáy tính bảng Samsung này trang bị một màn hình rộng lớn, với kích thước lên đến 12.4 inch và sử dụng tấm nền Dynamic AMOLED 2X độ phân giải 1752 x 2800 pixels. Màn hình này không chỉ hiển thị rất sắc nét, màu đen sâu và hài hòa, mà còn hỗ trợ HDR10+, mang đến cho mình một trải nghiệm hiển thị xuất sắc.\r\n\r\nViền màn hình của thiết bị giờ đã mảnh hơn, làm cho việc nhìn trở nên thoải mái. Điều này cũng đồng nghĩa với việc không gian hiển thị mở rộng, mang lại cho người dùng trải nghiệm tối ưu hóa khi sử dụng, với thông tin hiển thị nhiều hơn và khả năng tận hưởng giải trí hoặc làm việc được nâng cao.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/356e7cd3-221a-4064-a590-7d4dd1b825ae.jpg?alt=media', 'Màn hình\r\n\r\nCông nghệ màn hình:\r\n\r\nDynamic AMOLED 2X\r\nĐộ phân giải:\r\n\r\n1752 x 2800 Pixels\r\nMàn hình rộng:\r\n\r\n12.4\" - Tần số quét 120 Hz\r\nHệ điều hành & CPU\r\n\r\nHệ điều hành:\r\n\r\nAndroid 13\r\nChip xử lý (CPU):\r\n\r\nSnapdragon 8 Gen 2 for Galaxy\r\nTốc độ CPU:\r\n1 nhân 3.36 GHz, 4 nhân 2.8 GHz & 3 nhân 2 GHz\r\nChip đồ hoạ (GPU):\r\n\r\nAdreno 740\r\nBộ nhớ & Lưu trữ\r\n\r\nRAM:\r\n12 GB\r\nDung lượng lưu trữ:\r\n\r\n256 GB\r\nDung lượng còn lại (khả dụng) khoảng:\r\n\r\n218.2 GB\r\nThẻ nhớ ngoài:\r\n\r\nMicro SD, hỗ trợ tối đa 1 TB\r\nCamera sau\r\n\r\nĐộ phân giải:\r\n\r\nChính 13 MP & Phụ 8 MP\r\nQuay phim:\r\n\r\n4K 2160p@30fps\r\nTính năng:\r\n\r\nBộ lọc màu\r\n\r\nĐèn Flash\r\n\r\nÁnh sáng yếu (Chụp đêm)\r\n\r\nZoom kỹ thuật số\r\n\r\nXóa phông\r\n\r\nVideo chuyên nghiệp\r\n\r\nTua nhanh thời gian (Time‑lapse)\r\n\r\nToàn cảnh (Panorama)\r\n\r\nQuét mã QR\r\n\r\nLàm đẹp\r\n\r\nHDR\r\n\r\nGóc siêu rộng\r\n\r\nChụp ảnh chuyển động\r\n\r\nChụp một chạm\r\n\r\nChụp hẹn giờ\r\n\r\nChuyên nghiệp (Pro)\r\n\r\nTự động lấy nét', 'Máy tính bảng Samsung Galaxy Tab S9+ WiFi 256GB', 0, 'ACTIVE', '2024-07-14 18:58:00.825797', NULL, 5, 3);
