INSERT INTO `product` VALUES (101, '2024-07-15 09:22:22.876806', 'Pin sạc dự phòng 10000mAh Type C PD QC3.0 20W Xmobile Y73 sở hữu vẻ ngoài ấn tượng, thiết kế tương đối nhẹ chỉ với 216 g, dung lượng pin lớn, hứa hẹn mang đến cho bạn những trải nghiệm tối ưu.\r\n• Diện mạo pin sạc dự phòng Xmobile độc đáo với kiểu thiết kế trong suốt ở mặt trước có thể nhìn thấy toàn bộ vi mạch bên trong kết hợp cùng gam màu xám và vài chi tiết màu vàng làm pin sạc thêm nổi bật. \r\n\r\n• Lõi pin Li-Ion giúp lưu trữ năng lượng lâu dài, hạn chế tối đa tình trạng rò rỉ, an toàn cho thiết bị trong quá trình sử dụng.\r\n\r\n• Dung lượng pin sạc dự phòng 10.000 mAh, hiệu suất sạc lên đến 68% cho phép bạn sạc pin nhiều lần cho các thiết bị (số lần sạc tuỳ thuộc vào dung lượng pin của thiết bị).\r\n\r\n• Sản phẩm cung cấp nguồn năng lượng cho nhiều loại thiết bị như: Điện thoại, máy tính bảng, tai nghe,... thông qua cổng sạc Type C: 5V - 3A, 9V - 2.22A, 12V - 1.67A và cổng USB-A: 5V - 3A, 5V - 4.5A, 9V - 2A, 12V - 1.5A. Các mức sạc sẽ tự động điều chỉnh để phân bố hợp lý tuỳ vào thiết bị nhận sạc.\r\n\r\n• Đặc biệt, với cổng sạc Type-C, người dùng iPhone 15 series: iPhone 15, iPhone 15 Plus, iPhone 15 Pro, iPhone 15 Pro Max hoàn toàn có thể sử dụng sản phẩm để sạc pin cho thiết bị.\r\n\r\n• Ở đa phần các điều kiện sạc thông thường, pin sạc dự phòng chỉ đáp ứng mức sạc tối đa là 20 W, khi sử dụng sản phẩm này kết hợp cùng cáp dữ liệu chuẩn của Huawei hoặc cáp dữ liệu hỗ trợ sạc nhanh/sạc siêu nhanh để sạc cho vài model điện thoại được hỗ trợ của Huawei thì mức sạc sẽ lên tới 22.5 W.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/0f91d970-5ddd-4ec3-85e4-5f02cb6ba81f.jpg?alt=media', 'Dung lượng pin:\r\n\r\n10000 mAh\r\nHiệu suất sạc:\r\n68%\r\nLõi pin:\r\n\r\nLi-Ion\r\nCông nghệ/Tiện ích:\r\n\r\nMàn hình LED báo hiệu\r\n\r\nPower Delivery\r\n\r\nQuick Charge 3.0\r\n\r\nThời gian sạc đầy pin:\r\n\r\n3 giờ 30 phút (dùng Adapter 3A)\r\nNguồn ra:\r\n\r\nType C: 5V - 3A, 9V - 2.22A, 12V - 1.67A (Max 20 W)USB: 5V - 3A, 5V - 4.5A, 9V - 2A, 12V - 1.5A\r\nNguồn vào:\r\n\r\nType C: 5V - 3A, 9V - 2A\r\nKích thước:\r\n\r\nDài 8.4 cm - Rộng 4.8 cm - Dày 3.7 cm\r\nKhối lượng:\r\n\r\n216 g\r\nThương hiệu của:\r\n\r\nThế Giới Di Động\r\nSản xuất tại:\r\n\r\nTrung Quốc', 'Pin sạc dự phòng 10000mAh Type C PD QC3.0 20W Xmobile Y73', 0, 'ACTIVE', '2024-07-15 09:22:22.876806', NULL, 25, 3);
