INSERT INTO `product` VALUES (105, '2024-07-15 09:35:20.577369', 'Apple Watch Ultra 2 GPS + Cellular 49mm viền Titanium dây Ocean là chiếc đồng hồ thông minh của Apple gây được nhiều sự chú ý của giới truyền thông và người yêu công nghệ tại sự kiện Wonderlust năm 2023. Đồng hồ sở hữu vẻ ngoài vừa thời thượng vừa đậm chất thể thao vô cùng độc đáo, các tính năng bên trong cũng có cải tiến hứa hẹn sẽ làm hài lòng sự mong đợi của người dùng.\r\nPhong cách độc đáo, thoải mái khi đeo trên tay\r\nVề mặt thiết kế thì chiếc Apple Watch Ultra 2 này vẫn chưa có quá nhiều điểm khác biệt so với thế hệ Apple Watch Ultra đã ra mắt vào năm 2022. Mặt đồng hồ hình chữ nhật dẫn đầu xu thế, kích thước 49 mm có phần hơi hầm hố nên sẽ thích hợp với người dùng nam có cổ tay lớn. \r\n\r\nSử dụng viền Titanium vô cùng chắc chắn và chống ăn mòn hiệu quả, không chỉ giúp tối ưu khối lượng, gia tăng độ bền mà còn giúp nâng cấp vẻ ngoài của đồng hồ. \r\n\r\nPhiên bản smartwatch này được trang bị dây đeo Ocean với chất liệu cao su có độ bền cao, khả năng chống nước tốt phù hợp đeo khi tham gia các hoạt động thể thao dưới nước.\r\n\r\nApple Watch Ultra 2 LTE 49mm viền Titanium dây Ocean - Thiết kế\r\n\r\nNút Crown trên Apple Watch Ultra 2 có kích thước lớn hơn và phần rãnh sâu hơn giúp người dùng thuận tiện khi thao tác. Nút này có thể được sử dụng để điều chỉnh âm lượng, quay lại màn hình chính, mở ứng dụng,... Bên dưới là nút Side Part có chức năng ra vào ứng dụng gần nhất, tắt/mở nguồn và thực hiện cuộc gọi SOS. Cả hai nút vật lý đều đặt trong một cái gờ giúp an toàn khi va chạm và tạo điểm nhấn cho đồng hồ.\r\n\r\nỞ cạnh trái của mặt đồng hồ thông minh có loa, micro và nút Hành Động (Action). Phần loa của đồng hồ được làm theo dạng tổ ong khá đẹp mắt, âm thanh phát cũng vô cùng chất lượng. Nút Hành Động được phủ bởi gam màu cam vô cùng bắt mắt, người dùng có thể lập trình một chức năng theo nhu cầu, thói quen sử dụng, hỗ trợ truy cập nhanh chóng, tối ưu thời gian điều hướng.\r\n\r\nApple Watch Ultra 2 đã vượt qua tất cả các bài kiểm tra trong tiêu chuẩn MIL-STD-810H. Chứng minh khả năng chịu đựng các tác động vật lý, nhiệt độ, độ ẩm, bụi bẩn và xung điện. Điều này giúp đồng hồ có thể hoạt động ổn định trong nhiều điều kiện môi trường khắc nghiệt, luôn đồng hành cùng người dùng mọi lúc mọi nơi.\r\n\r\nMang đến nội dung chất lượng cao, bất kể mọi điều kiện ánh sáng\r\nMàn hình Apple Watch Ultra 2 có kích thước khủng lên đến 1.92 inch cho không gian hiển thị vô cùng rộng rãi. Với các đoạn tin nhắn dài bạn cũng có thể xem hết chỉ với một lần cuộn trang, biểu đồ sức khỏe hay bản đồ đường đi cũng vô cùng chi tiết, những thao tác vuốt chạm điều khiển đồng hồ cũng ít bị nhầm hơn.\r\n\r\nĐồng hồ sử dụng tấm nền OLED có độ sáng lên đến 3000 nits mang đến khả năng hiển thị vô cùng xuất sắc khi bạn sử dụng ở ngoài trời. Kết hợp cùng độ phân giải 410 x 502 pixels sẽ mang đến cho bạn những nội dung rõ nét, màu sắc vô cùng sống động. Sử dụng mặt kính Sapphire với khả năng chịu lực tốt sẽ giúp bảo vệ màn hình bên trong một cách hiệu quả khi có va chạm xảy ra.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/0df3b6b7-6b35-4bae-9ce7-3334136d6c25.jpg?alt=media', 'Màn hình\r\n\r\nCông nghệ màn hình:\r\n\r\nOLED\r\nKích thước màn hình:\r\n\r\n1.92 inch\r\nĐộ phân giải:\r\n\r\n410 x 502 pixels\r\nKích thước mặt:\r\n\r\n49 mm\r\nThiết kế\r\n\r\nChất liệu mặt:\r\n\r\nKính Sapphire\r\nChất liệu khung viền:\r\n\r\nTitanium\r\nChất liệu dây:\r\n\r\nSilicone\r\nĐộ rộng dây:\r\n\r\nHãng không công bố\r\nĐộ dài dây:\r\n\r\n13 - 20 cm\r\nKhả năng thay dây:\r\n\r\nCó\r\nKích thước, khối lượng:\r\n\r\nDài 49 mm - Ngang 44 mm - Dày 14.4 mm - Nặng 61.4 g\r\nTiện ích\r\n\r\nMôn thể thao:\r\n\r\nĐạp xe\r\n\r\nĐi bộ\r\n\r\nYoga\r\n\r\nChạy bộ\r\n\r\nBơi lội\r\n\r\nLặn\r\n\r\nSim:\r\n\r\neSIM\r\nHỗ trợ nghe gọi:\r\n\r\nNghe gọi độc lập\r\nTiện ích đặc biệt:\r\n\r\nMàn hình luôn hiển thị\r\n\r\nNghe nhạc\r\n\r\nKết nối bluetooth với tai nghe\r\n\r\nChống nước / Kháng nước:\r\n\r\nChống nước 10 ATM (Bơi, lặn vùng nước nông)', 'Đồng hồ thông minh Apple Watch Ultra 2 GPS + Cellular 49mm viền Titanium dây Ocean   So sánh', 0, 'ACTIVE', '2024-07-15 09:35:20.577369', NULL, 27, 3);
INSERT INTO `product` VALUES (106, '2024-07-15 09:38:07.129043', 'Apple Watch Series 9 GPS + Cellular 41mm viền nhôm dây thể thao là một trong những sản phẩm thu hút được nhiều sự chú ý trong sự kiện ra mắt sản phẩm năm 2023. Sản phẩm này sở hữu ngoại hình sang trọng, bên trong được trang bị con chip mạnh mẽ mang đến cho người dùng trải nghiệm mượt mà.\r\nThân thiện với môi trường hơn, màn hình sáng hơn\r\nApple Watch là dòng sản phẩm trung hòa carbon đầu tiên của nhà Apple. Những cải tiến trong thiết kế kết hợp sử dụng nguồn năng lượng sạch đã giảm thiểu đáng kể lượng phát thải trong việc sản xuất. Ước tính phương pháp trung hòa carbon đã giảm hơn 75% lượng khí thải cho mỗi chiếc Apple Watch so với thế hệ trước.\r\n\r\nApple Watch Series 9 vẫn có ngoại hình tương tự như Apple Watch Series 8, một điểm đặc biệt là Apple đã bổ sung thêm gam màu hồng vô cùng thời thượng, được nhiều bạn nữ ưa thích. Khung viền hợp kim nhôm vừa chắc chắn vừa nhẹ giúp người dùng thoải mái khi đeo. Sử dụng mặt kính cường lực Ion-X bảo vệ hiệu quả màn hình bên trong trước những va chạm không mong muốn.\r\n\r\nApple Watch S9 LTE 41mm viền nhôm dây silicone - Thiết kế\r\n\r\nĐồng hồ thông minh sở hữu tấm nền OLED với độ phân giải cao 430 x 352 pixels cho các nội dung từ văn bản đến hình ảnh đều được hiển thị rõ nét. Đồng thời màn hình có độ sáng lên đến 2000 nits cao gấp đôi so với thế hệ tiền nhiệm, cho bạn nhìn rõ các thông tin ngay cả khi ở nơi có cường độ sáng cao. Những lúc bạn đang trong rạp phim hay nơi có ánh sáng yếu thì độ sáng có thể giảm xuống đến 1 nit, không bị chói mắt khi xem.\r\n\r\nHiệu năng mạnh mẽ với S9 SiP và WatchOS thế hệ mới\r\nChip Apple S9 SiP mới được nhà Táo trang bị cho Apple Watch Series 9 là một sự nâng cấp đáng kể so với thế hệ trước. Chip này có 5,6 tỷ bóng bán dẫn, tăng 60% so với thế hệ S8. Kết hợp cùng Neural Engine 4 lõi cho phép thiết bị hoạt động nhanh hơn, mượt mà hơn và xử lý được nhiều tác vụ phức tạp hơn.\r\n\r\nWatchOS 10 (tại thời điểm ra mắt) có giao diện được thiết kế lại với các biểu tượng và bố cục mới. Các biểu tượng được làm mới để trông hiện đại và dễ nhận biết, bố cục cũng được thay đổi để giúp người dùng thao tác nhanh hơn. Bổ sung thêm một số mặt đồng hồ cho người dùng nhiều sự lựa chọn, đa dạng phong cách trong quá trình sử dụng.\r\n\r\nLưu ý: Apple Watch S9 tương thích với dòng iPhone Xs trở lên và sử dụng hệ điều hành iOS 17 trở lên.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/c86f3adc-b55b-447b-aa3c-870480dd57ee.jpg?alt=media', 'Màn hình\r\n\r\nCông nghệ màn hình:\r\n\r\nOLED\r\nKích thước màn hình:\r\n\r\n1.9 inch\r\nĐộ phân giải:\r\n\r\n430 x 352 pixels\r\nKích thước mặt:\r\n\r\n41 mm\r\nThiết kế\r\n\r\nChất liệu mặt:\r\n\r\nIon-X strengthened glass\r\nChất liệu khung viền:\r\n\r\nHợp kim nhôm\r\nChất liệu dây:\r\n\r\nSilicone\r\nĐộ rộng dây:\r\n\r\nHãng không công bố\r\nĐộ dài dây:\r\n\r\nHãng không công bố\r\nKhả năng thay dây:\r\n\r\nCó\r\nKích thước, khối lượng:\r\n\r\nDài 41 mm - Ngang 35 mm - Dày 10.7 mm - Nặng 32.1 g\r\nTiện ích\r\n\r\nMôn thể thao:\r\n\r\nĐạp xe\r\n\r\nĐi bộ\r\n\r\nYoga\r\n\r\nChạy bộ\r\n\r\nBơi lội\r\n\r\nSim:\r\n\r\neSIM\r\nHỗ trợ nghe gọi:\r\n\r\nNghe gọi độc lập\r\nTiện ích đặc biệt:\r\n\r\nMàn hình luôn hiển thị\r\n\r\nPhát hiện té ngã\r\n\r\nKết nối bluetooth với tai nghe', 'Đồng hồ thông minh Apple Watch Series 9 GPS + Cellular 41mm viền nhôm dây thể thao', 0, 'ACTIVE', '2024-07-15 09:38:07.129043', NULL, 27, 3);
INSERT INTO `product` VALUES (107, '2024-07-15 09:40:32.849679', 'Mi Band 8 Pro là thế hệ smartband tiếp theo được nhà Xiaomi cho ra mắt. Với nhiều cải tiến về thiết kế, màn hình lớn mở rộng không gian hiển thị, khả năng định vị độc lập, hỗ trợ hơn 150 chế độ thể thao,... đây sẽ là phiên bản đáng sở hữu, nâng cấp cho người dùng.\r\nThiết kế thời thượng, màn hình lớn \r\nXiaomi Band 8 Pro sở hữu thiết kế nhỏ gọn, ôm sát cổ tay, mang đến sự thoải mái tối đa cho người sử dụng. Với khối lượng chỉ 22.5 g (chưa tính dây đeo), dù tập luyện thể thao hay làm việc nhà thì chiếc smartband sẽ không gây bất kỳ cản trở nào cho bạn.\r\n\r\nDây đeo của Xiaomi Band 8 Pro được làm từ chất liệu TPU mềm mại, thoáng khí, đảm bảo cảm giác êm ái và thoải mái khi đeo trong thời gian dài. Chất liệu này cũng có khả năng chống nước và bụi bẩn, giúp bạn dễ dàng vệ sinh và giữ cho vòng tay luôn sạch sẽ.\r\n\r\nMi Band 8 Pro - Thiết kế \r\n\r\nXiaomi Band 8 Pro sở hữu kích thước màn hình lớn giúp hiển thị được nhiều thông tin hơn. Tấm nền AMOLED hỗ trợ độ phân giải 336 x 480 pixels, mật độ điểm ảnh 336 ppi kết hợp tần số quét 60 Hz cung cấp khả năng hiển thị sắc nét, sống động đến từng chi tiết kể cả khi sử dụng ngoài trời nắng. \r\n\r\nXiaomi cũng trang bị hơn 100 mặt đồng hồ trên vòng tay thông minh với đa dạng chủ đề khác nhau, cho phép người dùng dễ dàng lựa chọn giao diện phù hợp với phong cách, sở thích cá nhân.\r\n\r\nHơn thế nữa, thiết bị còn cho phép người dùng thêm nhiều widget trên giao diện. Từ đó, thoải mái điều chỉnh cũng như chọn nhanh một vài ứng dụng cần thiết. Các widget cũng được thiết kế lại mang đến sự trực quan, dễ dùng hơn các thế hệ trước.\r\n\r\nMi Band 8 Pro - Màn hình\r\n\r\nKhả năng định vị độc lập\r\nĐược trang bị hệ thống định vị hiện đại gồm: GPS, GLONASS, Galileo, Beidou và QZSS, người dùng có thể thỏa sức tham gia các hoạt động rèn luyện, thể thao ngoài trời để ghi lại quãng đường, thời gian luyện tập,... mà không cần mang theo điện thoại bên mình.\r\n\r\nVòng đeo tay thông minh Mi Band 8 Pro - Định vị độc lập\r\n\r\nHơn 150 chế độ luyện tập tha hồ chọn \r\nBứt phá giới hạn bản thân với hơn 150 chế độ luyện tập đa dạng, từ cơ bản đến nâng cao, smartband nhà Xiaomi hứa hẹn mang đến cho bạn hành trình rèn luyện thể chất đầy hứng khởi và hiệu quả. Hãy thỏa sức đam mê với môn thể thao yêu thích như chạy bộ, bóng bàn, đạp xe, bơi lội, nhảy dây, leo núi,... hay luyện tập thể hình với các dụng cụ chuyên nghiệp.\r\n\r\nSmartband sẽ đồng hành cùng bạn trong hành trình rèn luyện, ghi nhận và phân tích các chỉ số quan trọng như nhịp tim, quãng đường, thời gian tập luyện,... Dữ liệu được tổng hợp trực quan, giúp bạn theo dõi tiến độ và điều chỉnh bài tập hợp lý, tránh tình trạng quá sức hoặc chấn thương khi luyện tập.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/390b0d58-b9d0-4e8c-a785-6c410c9657d0.jpg?alt=media', 'Màn hình\r\n\r\nCông nghệ màn hình:\r\n\r\nAMOLED\r\nKích thước màn hình:\r\n\r\n1.74 inch\r\nĐộ phân giải:\r\n\r\n336 x 480 pixels\r\nKích thước mặt:\r\n\r\nHãng không công bố\r\nThiết kế\r\n\r\nChất liệu mặt:\r\n\r\nKính cường lực Gorilla Glass 3\r\nChất liệu khung viền:\r\n\r\nNhựa mạ kim loại\r\nChất liệu dây:\r\n\r\nTPU\r\nĐộ rộng dây:\r\n\r\n2 cm\r\nĐộ dài dây:\r\n\r\n13 - 20.5 cm\r\nKhả năng thay dây:\r\n\r\nCó\r\nKích thước, khối lượng:\r\n\r\nDài 46 mm - Ngang 33.35 mm - Dày 9.99 mm - Nặng 22.5 g\r\nTiện ích\r\n\r\nMôn thể thao:\r\n\r\nĐạp xe\r\n\r\nĐi bộ\r\n\r\nYoga\r\n\r\nNhảy dây\r\n\r\nLeo núi\r\n\r\nCầu lông\r\n\r\nBóng rổ\r\n\r\nChạy bộ\r\n\r\nBơi lội\r\n\r\nGolf\r\n\r\nTiện ích đặc biệt:\r\n\r\nMàn hình luôn hiển thị\r\nChống nước / Kháng nước:\r\n\r\nChống nước 5 ATM - ISO 22810:2010 (Tắm, bơi vùng nước nông)', 'Vòng đeo tay thông minh Mi Band 8 Pro', 0, 'ACTIVE', '2024-07-15 09:40:32.849679', NULL, 27, 3);
INSERT INTO `product` VALUES (108, '2024-07-15 09:45:56.651985', 'iaomi Watch 2 Pro là thế hệ smartwatch thứ 2 sử dụng hệ điều hành Wear OS vừa được Xiaomi trình làng. Với thiết kế sang trọng, hiện đại cùng nhiều tính năng vượt trội, đây hứa hẹn sẽ là người bạn đồng hành lý tưởng cho người dùng trong mọi hoạt động.\r\nSự phối hợp hài hòa giữa cổ điển và hiện đại\r\nXiaomi Watch 2 Pro có mặt hình tròn kết hợp cùng phần viền kiểu bằng thép không gỉ được đánh bóng tinh xảo. Phần viền bezel được vát phẳng mang đến cảm giác vừa hiện đại vừa cổ điển. Với kích thước 46 mm thì chiếc đồng hồ thông minh này sẽ phù hợp với những bạn nam có cổ tay to.\r\n\r\nXiaomi Watch 2 Pro - Thiết kế\r\n\r\nSản phẩm này được trang bị một núm vặn tựa như những chiếc đồng hồ cơ học giúp điều hướng nhanh chóng và trực quan hơn. Nút xoay mượt, có độ rung vừa phải giúp mình khá nhiều trong các tác vụ hằng ngày. Ở phía trên và dưới của nút xoay được trang bị thêm 2 nút bấm, theo cảm nhận của mình thì có độ nảy cao, êm ái khi bấm. \r\n\r\nXiaomi Watch 2 Pro - Nút xoay\r\n\r\nĐồng hồ sử dụng dây silicone có bề mặt mềm mại, ôm sát cổ tay, mang lại cảm giác thoải mái và dễ chịu ngay cả khi đeo trong thời gian dài. Khi trải nghiệm sản phẩm thì mình rất hài lòng với cảm giác đeo mà dây silicone mang lại. Những lúc chơi thể thao đổ nhiều mồ hôi, chỗ đeo đồng hồ cũng không bị rít, không gây vướng víu giúp mình tập luyện thoải mái hơn.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/0a59c92a-136c-4de7-9a81-2d665140e8b9.jpg?alt=media', 'Màn hình\r\n\r\nCông nghệ màn hình:\r\n\r\nAMOLED\r\nKích thước màn hình:\r\n\r\n1.43 inch\r\nĐộ phân giải:\r\n\r\n466 x 466 pixels\r\nKích thước mặt:\r\n\r\n46 mm\r\nThiết kế\r\n\r\nChất liệu mặt:\r\n\r\nKính thường\r\nChất liệu khung viền:\r\n\r\nThép không gỉ\r\nChất liệu dây:\r\n\r\nSilicone\r\nĐộ rộng dây:\r\n\r\n2.2 cm\r\nĐộ dài dây:\r\n\r\n26 cm\r\nKhả năng thay dây:\r\n\r\nCó\r\nKích thước, khối lượng:\r\n\r\nDài 46 mm - Ngang 46 mm - Dày 9.1 mm - Nặng 54.5 g\r\nTiện ích\r\n\r\nMôn thể thao:\r\n\r\nĐạp xe\r\n\r\nĐi bộ\r\n\r\nQuần vợt\r\n\r\nYoga\r\n\r\nNhảy dây\r\n\r\nCầu lông\r\n\r\nChạy bộ\r\n\r\nBơi lội\r\n\r\nHỗ trợ nghe gọi:\r\n\r\nNghe gọi ngay trên đồng hồ\r\nTiện ích đặc biệt:\r\n\r\nMàn hình luôn hiển thịNghe nhạc', 'Đồng hồ thông minh Xiaomi Watch 2 Pro 46 mm', 0, 'ACTIVE', '2024-07-15 09:45:56.651985', NULL, 27, 3);
INSERT INTO `product` VALUES (109, '2024-07-15 10:03:12.980089', 'Ưu điểm của đồng hồ Casio MTP-1374L-1AVDF\r\nĐồng hồ chính hãng, xuất xứ Nhật Bản nên độ bền cao.\r\nGiá tầm trung, hơn 1.5 triệu đồng tại WatchStore.\r\nThiết kế thanh lịch, sang trọng, khỏe khoắn với bộ 3 màu tương phản đen – bạc – đỏ.\r\nMặt kính Mineral Crystal chống trầy xước trước các hoạt động hàng ngày.\r\n2 gờ bảo vệ quanh núm vặn bằng thép không gỉ, hạn chế tối đa các va đập.\r\nDây da tổng hợp 2 lớp dập vân cá sấu, không bong tróc và không đứt gãy hay bạc màu trong 2 năm.\r\nĐồng hồ 6 kim hiển thị cụ thể từng đơn vị thời gian: 3 kim (giờ, phút, giây) và 3 kim (ngày, thứ, 24 giờ).\r\nPin SR927SW có tuổi thọ 3 năm, bộ máy Quartz Module 5374 chính xác cao ± 20 giây/tháng.\r\nTính năng nổi bật: lịch thứ, lịch ngày, lịch 24 giờ, dạ quang.\r\nChống nước 50m, đạt tiêu chuẩn ISO 2281; dùng khi tắm, đi mưa, rửa tay, rửa xe; ngâm trong nước 1 giờ (+5 phút) vẫn hoạt động bình thường.\r\nNhược điểm của đồng hồ Casio MTP-1374L-1AVDF\r\nCác mặt số phụ (ô lịch ngày, thứ, 24 giờ) có kích thước hơi nhỏ, khó xem thông tin với người mắt kém.\r\nChất liệu dây đeo da tổng hợp cứng hơn da thật.\r\nĐối tượng phù hợp với đồng hồ Casio MTP-1374L-1AVDF\r\nĐồng hồ Casio MTP-1374L-1AVDF phù hợp với nam giới có cỡ cổ tay 18.5 - 20cm.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/ff4f3cdc-e704-45b0-be66-9e29ea29d66a.webp?alt=media', 'Thông số sản phẩm - Casio MTP-1374L-1AVDF\r\nThương hiệu: Casio\r\nXuất xứ: Nhật Bản\r\nĐối tượng: Nam\r\nDòng sản phẩm: Casio MTP\r\nKháng nước: 5atm\r\nLoại máy: Pin/Quartz\r\nChất liệu kính: Kính Khoáng\r\nChất liệu dây: Dây Da\r\nSize mặt: 43.5mm\r\nĐộ dầy: 10.4mm\r\nSeries: Casio MTP 1374\r\nTiện ích: Dạ quang, Lịch thứ, Lịch ngày, Giờ, phút, giây, Lịch 24 giờ', 'Đồng Hồ Casio - Nam MTP-1374L-1AVDF Size 43.5mm', 0, 'ACTIVE', '2024-07-15 10:03:12.980089', NULL, 32, 4);
