INSERT INTO `product` VALUES (112, '2024-07-15 10:15:56.273512', 'Thông số sản phẩm - Citizen BH5003-00L\r\nThương hiệu: Citizen\r\nXuất xứ: Nhật Bản\r\nĐối tượng: Nam\r\nKháng nước: 5atm\r\nLoại máy: Pin/Quartz\r\nChất liệu kính: Kính Khoáng\r\nChất liệu dây: Dây Da\r\nSize mặt: 42mm\r\nĐộ dầy: 9mm\r\nTiện ích: Giờ, phút, giây', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/db865379-0436-4e02-83ca-c406ba755f4b.webp?alt=media', 'Thông số sản phẩm - Citizen BH5003-00L\r\nThương hiệu: Citizen\r\nXuất xứ: Nhật Bản\r\nĐối tượng: Nam\r\nKháng nước: 5atm\r\nLoại máy: Pin/Quartz\r\nChất liệu kính: Kính Khoáng\r\nChất liệu dây: Dây Da\r\nSize mặt: 42mm\r\nĐộ dầy: 9mm\r\nTiện ích: Giờ, phút, giây', 'Đồng Hồ Citizen - Nam BH5003-00L Size 42mm', 0, 'ACTIVE', '2024-07-15 10:15:56.273512', NULL, 32, 4);
INSERT INTO `product` VALUES (113, '2024-07-15 10:17:31.174393', 'Thông số sản phẩm - Orient RA-AR0005Y10B\r\nThương hiệu: Orient\r\nXuất xứ: Nhật Bản\r\nĐối tượng: Nam\r\nKháng nước: 5atm\r\nLoại máy: Cơ/Automatic\r\nChất liệu kính: Kính Sapphire\r\nChất liệu dây: Dây Da\r\nSize mặt: 40.8mm\r\nĐộ dầy: 11mm\r\nKhoảng trữ cót: 40 tiếng\r\nTiện ích: Dạ quang, Giờ, phút, Small Second', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/c1f4e0e5-1221-490f-8474-9102cf78cea8.webp?alt=media', 'Thông số sản phẩm - Orient RA-AR0005Y10B\r\nThương hiệu: Orient\r\nXuất xứ: Nhật Bản\r\nĐối tượng: Nam\r\nKháng nước: 5atm\r\nLoại máy: Cơ/Automatic\r\nChất liệu kính: Kính Sapphire\r\nChất liệu dây: Dây Da\r\nSize mặt: 40.8mm\r\nĐộ dầy: 11mm\r\nKhoảng trữ cót: 40 tiếng\r\nTiện ích: Dạ quang, Giờ, phút, Small Second', 'Đồng Hồ Orient - Nam RA-AR0005Y10B Size 40.8mm', 0, 'ACTIVE', '2024-07-15 10:17:31.174393', NULL, 32, 4);
INSERT INTO `product` VALUES (114, '2024-07-15 10:33:13.869611', 'Chi tiết sản phẩm\r\nChúng ta thường bị lạc vào vòng luẩn quẩn của thời thế. Mãi theo đuổi những giá trị vật chất hữu hình, để rồi nhận lại hệ quả nặng nề từ cuộc chạy đua đó. Hãy từng bước chậm rãi và từ tốn, cảm nhận những tạo tác vô hình mà thế giới này mang đến. Mở rộng thế giới quan, tối giản lối sống, tự khắc tâm hồn sẽ an nhiên và đủ đầy.\r\n\r\nCasio – LTP-V007L-7E1UDF sở hữu nét mộc mạc và đơn thuần nhưng lại tỏa ra một sức hút vô cùng mãnh liệt, thôi miên phái nữ. Cũng chính vì sự tinh giản mà lại lại độc đáo bởi mặt số chữ nhật đã khiến em nó chiếm trọn trái tim của người phụ nữ đương đại.\r\n\r\nMỤC LỤC\r\n\r\n› Review chi tiết Casio LTP-V007L-7E1UDF\r\n\r\n1. Mặt số hình vuông độc đáo\r\n\r\n2. Dây đeo da chính hãng dập nổi vân cá sấu\r\n\r\n› Phối đồ với Casio LTP-V007L-7E1UDF\r\n\r\n› Đổi gió với thiết kế dây da nâu\r\n\r\n› Đánh giá tổng quan Casio LTP-V007L-7E1UDF\r\n\r\nREVIEW CHI TIẾT CASIO LTP-V007L-7E1UDF\r\n\r\nThiết kế thanh lịch và tối giản\r\n\r\n1. Mặt số hình vuông độc đáo\r\nTừ đầu những năm 80 của thế kỷ 20, những chiếc đồng hồ cơ mặt vuông, chữ nhật đã tạo nên tiếng vang trên khắp thế giới.\r\n\r\nCũng chính bởi thiết kế lạ mắt và hợp thời trang. Vì thế mà Casio lại một lần nữa tái hiện thiết kế mang tính hoài niệm lên từng chiếc đồng hồ của mình.\r\n\r\nTìm hiểu thêm: Đồng hồ mặt vuông nam nữ chính hãng\r\n\r\nVới sắc trắng có pha chút màu kem khiến tổng thể mặt số thoạt nhìn trông tối giản nhưng lại cũng có đôi nét đặc trưng vốn có. Bộ kim thanh mảnh đồng điệu với 12 ô cọc số tỉ mỉ đã cho ra đúng chuẩn phong cách cổ điển và thanh lịch.\r\n\r\n\r\nDây da chính hãng dập nổi vân cá sấu\r\n\r\nNgay tâm điểm của mặt số là logo thương hiệu “Casio”, đối xứng qua trung tâm bộ kim là dòng chữ “Water Resist” nghĩa là chống nước. Đúng như vậy, Casio – LTP-V007L-7E1UDF được trang bị khả năng chống nước 3 ATM. Cho phép nàng tự tin hơn khi tiếp xúc với nước như rửa tay hay những trường hợp đi mưa nhỏ.\r\n\r\nTuy nhiên, Đồng Hồ Hải Triều khuyến khích nàng không nên để đồng hồ dính nước thường xuyên vì sẽ ảnh hưởng đến bộ máy bên trong và đặc biệt là sẽ làm hỏng dây đeo bằng da.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/f49710b2-43b6-4679-a5ac-c590e933df8a.avif?alt=media', '2. Dây đeo da chính hãng dập nổi vân cá sấu\r\nDù Casio – LTP-V007L-7E1UDF chỉ nằm ở phân khúc những mẫu đồng hồ dưới 1 triệu, nhưng không vì thế mà bị đối xử “ghẻ lạnh”. Casio luôn đặt cái tâm và cái tầm vào quy trình sản xuất đồng hồ nhằm đưa đến nhiều mẫu đồng hồ đẹp với giá hạt dẻ, phục vụ cho nhu cầu của người tiêu dùng.\r\n\r\n\r\nCasio đồng hồ mặt vuông với thiết kế độc đáo\r\n\r\nBộ dây da chính hãng được dập nổi vân cá sấu đặc trưng. Thiết kế này thường thấy trên đồng hồ đến từ thương hiệu nổi tiếng như Daniel Wellington, SRWatch. Các chi tiết vân nổi trên bề mặt dây khiến cho em nó không còn đơn điệu như ban đầu mà mang đến vẻ đẹp thanh lịch và quý phái.', 'Casio LTP-V007L-7E1UDF – Nữ – Quartz (pin) – Mặt số trắng – Thiết kế mặt vuông độc đáo – Dây đeo da dập nổi vân cá sấu', 0, 'ACTIVE', '2024-07-15 10:33:13.869611', NULL, 33, 4);
INSERT INTO `product` VALUES (115, '2024-07-15 10:34:55.274752', 'Đồng hồ Casio có thể được coi là thương hiệu biết lắng nghe nguyện vọng của khách hàng nhất. Nhận định này đến từ việc hãng có cho mình rất nhiều dòng đồng hồ trải dài ở nhiều mức giá, từ bình dân đến đẳng cấp. Trong khung giá rẻ, có phiên bản đồng hồ Casio LTP-V005D-4B2UDF mặt hồng xinh xắn.\r\n\r\n4 đặc điểm của đồng hồ Casio LTP-V005D-4B2UDF\r\nCasio hiện đang đứng trong top những thương hiệu đồng hồ bán chạy nhất Nhật Bản. Ở thị trường Việt Nam, có thể nói, hãng này dường như đã trở nên quá đỗi quen thuộc và chiếm được rất nhiều cảm tình của người tiêu dùng.\r\n\r\nThành lập vào năm 1946 bởi kỹ sư chế tạo chuyên nghiệp Tadao Kashio, một công ty sản xuất và kinh doanh linh kiện điện tử chính là tiền thân của thương hiệu.\r\n\r\nNhờ có nền tảng vững chắc mà Casio khá thuận lợi trên con đường đến với những chiếc đồng hồ đeo tay. Tuy nhiên, không vì thế mà hãng chủ quan, đó là lý do 28 năm sau khi thành lập mới có phiên bản Casiotron.\r\n\r\nĐồng hồ Casio luôn phát triển theo cách rất riêng, thể hiện rõ nhất trong những sản phẩm chứa đầy sự bức phá công nghệ, đem đến trải nghiệm vừa hiện đại vừa tiện lợi cho người dùng.\r\n\r\nTrong khi thế giới đang đi theo chiều hướng mỏng hóa thì năm 1983, Casio cho ra mắt dòng G-Shock, sau đó là Baby-G. Nằm ngoài dự đoán, những thiết kế hầm hố này vậy mà lại nhận về không ít tiếng thơm, đến nay vẫn còn rất nổi tiếng trong giới trẻ.\r\n\r\nĐồng hồ Casio LTP-V005D-4B2UDF giá rẻ, thay pin miễn phí - Ảnh 1\r\n\r\nCasio LTP-V005D-4B2UDF có vẻ ngoài rất dịu dàng và dành riêng cho các bạn nữ tuổi teen\r\n\r\nCasio cũng là một trong những thương hiệu đầu tiên sử dụng màn hình kỹ thuật số để hiển thị giờ, có bộ bấm giờ, báo thức, và một số tính năng tích hợp như đo độ cao, đo nhiệt độ, la bàn, kết nối Bluetooth…\r\n\r\nNgoài hai dòng đồng hồ khác biệt đã nêu tên, hãng còn rất có những cái tên nổi bật như Casio Edifice, Casio Sheen hay Pro Tech…\r\n\r\nMỗi sự thành công đều có bí quyết và có lẽ bí quyết của Casio chính là làm ra những chiếc đồng hồ chất lượng cho nhiều đối tượng tiêu dùng, ai cũng có thể tiếp cận được sản phẩm của thương hiệu này ở nhiều mức giá khác nhau.\r\n\r\nVà với mức chi phí dưới 1 triệu VNĐ, chúng ta sẽ dễ dàng sở hữu món phụ kiện thời trang Casio LTP-V005D-4B2UDF có mặt số hồng phấn nữ tính. Sau đây sẽ là những thông tin bổ ích miêu tả chi tiết về sản phẩm mà Hải Triều muốn gửi đến quý độc giả.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/c84ede8c-0f5c-4678-abc2-7ab2cb99777f.avif?alt=media', 'Mặt số nữ tính với tone màu hồng\r\nMặt số của Casio LTP-V005D-4B2UDF thể hiện đúng mục đích của một chiếc đồng hồ nữ, vừa nhỏ nhắn thanh nhã, vừa có tone màu dịu dàng trẻ trung.\r\n\r\nKhông có kết cấu bề mặt bằng phẳng, niềng của phiên bản được thiết kế theo dạng uốn cong và có dạng gờ nhằm tạo chiều sâu cho mặt số.\r\n\r\nBộ phận này luôn được ưu tiên về độ chắc chắn, làm từ thép không gỉ 316L, chống ăn mòn bởi yếu tố bên ngoài như nước, muối hay axit, có độ bóng sáng tự nhiên của kim loại.\r\n\r\nĐược bảo vệ bởi phần niềng vững chắc như đã giới thiệu, nền mặt số giờ đây đã có thể tự tin phô diễn toàn bộ vẻ đẹp mộng mơ của mình.\r\n\r\nNền mặt số là một mặt phẳng được tráng men kỹ lưỡng không có tì vết, lại còn phủ một lớp màu hồng phấn nhẹ nhàng. Chắc hẳn, ngay từ lần đầu tiên gặp mặt, các cô nàng sẽ chẳng thể rời mắt khỏi Casio LTP-V005D-4B2UDF.', 'Casio LTP-V005D-4B2UDF – Nữ – Quartz (Pin) – Mặt Số 28.2mm, Japan Movt, Chống Nước 3ATM', 0, 'ACTIVE', '2024-07-15 10:34:55.274752', NULL, 33, 4);
INSERT INTO `product` VALUES (116, '2024-07-15 10:37:19.914889', 'Casio đặc biệt ưu ái dành cho các bạn nữ mẫu đồng hồ Casio LTP-V006L-4BUDF cực nịnh mắt. Dự sẽ là một lựa chọn hoàn hảo cho các bạn gái nữ tính yêu thích thương hiệu đồng hồ này.\r\n\r\nGiới thiệu về thương hiệu đồng hồ Casio\r\nTại Việt Nam, Casio được đánh giá là một thương hiệu đồng hồ nằm lòng và đặc biệt ưa thích. Ra đời vào năm 1946 và đến từ xứ phù hoa Nhật Bản lại càng củng cố thêm lòng tin và mong đợi về một chiếc đồng hồ.\r\n\r\nĐồng hồ nữ Casio LTP-V006L-4BUDF không làm người dùng thất vọng về thiết kế - Hình 1\r\n\r\nPhối màu hồng Pastel nhẹ nhàng, nữ tính\r\n\r\nĐồng hồ nam Casio đã có được những đấu ấn riêng khi hầu hết các bạn trẻ đều để mắt tới. Lượng mua lớn của Casio chính là lời khẳng định vị thế của mình. Bên cạnh đó, đồng hồ nữ Casio cũng không làm người dùng thất vọng bởi sự kết hợp, vận dụng khéo léo trong thiết kế.\r\n\r\nCác loại vật liệu và cách sử dụng đồng hồ Casio LTP-V006L-4BUDF\r\nĐồng hồ Casio LTP-V006L-4BUDF mang vẻ đẹp của một cô gái điệu đà. Sự ngọt ngào, thanh lịch ấy có được chính nhờ sự tinh tế trong mắt nhìn, ra đời một sản phẩm mang đậm dấu ấn thời trang phái đẹp.\r\n\r\n1. Mặt đồng hồ Casio LTP-V006L-4BUDF\r\nThoạt nhìn vào, dễ dàng nhận thấy nền mặt số màu hồng nhạt, tên thương hiệu Casio nổi bật giữa mặt số.\r\n\r\nCọc số đơn giản mang sắc hồng yêu thích của các cô gái. Màu hồng phơn phớt chỉ đậm hơn nền mặt số đôi chút tạo điểm nhấn và sự nhẹ nhàng vừa phải. Có thể đây chính là chiếc đồng hồ mà các nàng thơ nên có trong tủ phụ kiện của mình.\r\n\r\nCasio LTP-V006L-4BUDF mặt số mang nét đẹp của một cô thiếu nữ - Hình 2\r\n\r\nMặt số mang nét đẹp của một cô thiếu nữ\r\n\r\n3 kim chỉ giờ, phút giây cũng tận dụng sự đồng điệu. Thông thường ở những chất liệu khác nhau, việc sử dụng màu sắc để có thể đồng nhất khá khó khăn. Khéo léo trong việc sử dụng cùng một sắc độ này trên mẫu đồng hồ nữ Casio LTP-V006L-4BUDF đã cho thấy sự tinh tế của thương hiệu.\r\n\r\nSắc hồng tinh tế nhẹ nhàng của Casio LTP-V006L-4BUDF- Hình 3\r\n\r\nSắc hồng tinh tế nhẹ nhàng\r\n\r\nĐồng hồ kính cứng bảo vệ mặt số và các chi tiết bên trong. Trong phân khúc đồng hồ bình dân thì kính cứng được xem là chàng vệ sĩ làm tốt nhất chức năng chống trầy xước hiệu quả.\r\n\r\nCasio LTP-V006L-4BUDF có đường kính mặt số 25mm và bề dày mặt 9.2mm, sự tính toán hợp lý của thương hiệu phù hợp với cổ tay của đại đa số các bạn nữ hiện đại.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/c1acc307-1e7a-4510-8622-9f1075f20aa6.avif?alt=media', '2. Thiết kế dây đeo đồng hồ\r\nKhi có Casio LTP-V006L-4BUDF trong tay, chắc chắn bạn sẽ không nhàm chán với dây đeo màu hồng hút mắt. Đặc biệt những bạn có làn da gam lạnh, màu hồng trên dây da sẽ đẩy bật tông da, mang đến một điểm nhấn cho cô gái nữ tính.\r\n\r\nDây đeo Casio LTP-V006L-4BUDF màu hồng đẩy bật tông da gam lạnh - Hình 4\r\n\r\nDây đeo màu hồng đẩy bật tông da gam lạnh\r\n\r\nĐồng hồ dây da khi sờ cảm giác trơn mượt, đem đến sự thoải mái khi đeo. Các đường chỉ may trên dây rõ nét cũng là một điểm cộng cho vẻ ngoài hoàn hảo của đồng hồ nữ Casio LTP-V006L-4BUDF.\r\n\r\n3. Thiết kế bộ máy đồng hồ\r\nSử dụng bộ máy Quartz là hợp lý cho những mẫu đồng hồ Casio nữ tính này. Đồng hồ Quartz sẽ làm tốt chức năng đảm bảo sự ổn định của bộ máy, giữ cho đồng hồ hoạt động tốt trong một thời gian khá dài nhất định.\r\n\r\nBộ máy Quartz hoàn thành tốt chức năng giữ cho đồng hồ Casio LTP-V006L-4BUDF vận hành ổn định - Hình 5', 'Casio LTP-V006L-4BUDF – Nữ – Quartz (Pin) – Mặt Số 25mm, Kính Cứng, Chống Nước 3ATM', 0, 'ACTIVE', '2024-07-15 10:37:19.914889', NULL, 33, 4);
INSERT INTO `product` VALUES (117, '2024-07-15 10:40:46.167785', 'Chi tiết sản phẩm\r\n“Vẻ đẹp tiềm ẩn đằng sau những viên đá Swarovski”\r\n\r\nSaga liên tục trình làng giới mộ điệu vô vàn thiết kế đầy tính sáng tạo và độc đáo. Điển hình như bộ sưu tập Saga Charm luôn đem lại cảm giác của sự nữ tính từ chiếc lắc tay và sự lấp lánh của đá Swarovski. Phiên bản lần này cũng không phải là ngoại lệ, Saga\r\n\r\nMỤC LỤC\r\n\r\n› Review chi tiết Saga Charm – 53229-RGMWRG-5\r\n\r\n1. Đá Swarovski và mặt xà cừ – Nét đặc trưng riêng của Saga\r\n\r\n2. Saga Charm và những dấu ấn không thể phai\r\n\r\n3. Bộ máy đồng hồ Saga 53229-RGMWRG-5\r\n\r\n› Phối đồ cùng Saga Charm 53229-RGMWRG-5\r\n\r\n› Bộ sưu tập Saga Charm lấp lánh đầy sắc màu\r\n\r\n› Lý do nàng nên sở hữu Saga 53229-RGMWRG-5\r\n\r\nREVIEW CHI TIẾT SAGA CHARM - 53229-RGMWRG-5\r\n1. Đá Swarovski và mặt xà cừ – Nét đặc trưng riêng của Saga\r\nSaga và Swarovski là hai người bạn đồng hành tuyệt vời nhất. Chính bởi, vẻ đẹp của những viên đá Swarovski chỉ có thể lột tả hết thảy nhờ vào thiết kế của Saga mà thôi !\r\n\r\nMỗi luồng sáng khúc xạ qua cấu trúc đá pha lê, từng đợt từng đợt tán sắc lộng lẫy dưới lớp kính cứng. Tất cả kết hợp tạo nên một bức họa tuyệt đẹp trên nền số khảm xà cừ.\r\n\r\n\r\nMặt số đính đá Swarovski đầy quyến rũ\r\n\r\nNàng có thể nhìn thấy được ngự trị trên nền số là 4 viên đá Swarovski lấp lánh ở vị trí 12, 3, 6 9 giờ tạo sự cân xứng khi nhìn vào. Dòng chữ “Saga Stella” được đặt cách, ngự trị ở cột mốc 12 giờ như đang đánh dấu lãnh thổ.\r\n\r\nHiệu ứng chuyển sắc của màn xà cừ chưa bao giờ khiến giới mộ điệu phải thất vọng. Nghệ thuật chế tác xà cừ tưởng chừng như đơn giản nhưng thật chất lại đòi hỏi người thợ phải am hiểu sâu rộng.\r\n\r\n\r\nNghệ thuật khảm xà cừ điêu liệu của nghệ nhân lành nghề\r\n\r\nQuá trình khảm xà cừ bao gồm 6 bước từ vẽ mẫu, cưa ốc, đục, tách, gắn, sơn. Mỗi công đoạn lại chia ra nhiều phần nhỏ, quan trọng nhất là khâu lựa chọn loại nguyên liệu. Đây chính là yếu tố tiên quyết cho vẻ đẹp của mặt số.', 'https://firebasestorage.googleapis.com/v0/b/image-vtv.appspot.com/o/8589762e-d59e-4a48-bd5f-958e88a65aea.avif?alt=media', '2. Saga Charm và những dấu ấn không thể phai\r\nKhi nhắc đến cái tên “Saga charm”, nàng thường sẽ nghĩ ngay đến những bộ charm, trang sức, vòng tay. Và đó cũng chính là nét đặc riêng của thương hiệu đến từ Mỹ. Không tuân theo phong cách truyền thống, Saga tiên phong trong lĩnh vực đồng hồ mang thiên hướng phụ kiện và trang sức.\r\n\r\n\r\nBộ charm mạ vàng lấp lánh trên cổ tay nàng\r\n\r\nMong muốn gửi gắm các thiết kế của mình đến nàng thơ sở hữu nét đẹp ngọt ngào, tinh tế, hiện đại. Hãng đã làm nổi bật bộ dây bởi nhiều “hạt charm” đan xen lẫn nhau, phối cùng các màu sắc tươi mới, trẻ trung và năng động.\r\n\r\nThương hiệu đồng hồ đến từ Mỹ này luôn ví von những chiếc đồng hồ của mình tựa như một bông hoa và mỗi người phụ nữ sở hữu vẻ đẹp rất riêng.\r\n\r\nChính vì thế mà trong từng chiếc Charm ẩn náu hình ảnh của một cô gái mang trong mình sự tươi trẻ, tràn đầy sức sống, sở hữu trái tim luôn thổn thức và nồng nàn hơi thở của sự tái sinh.', 'Saga Charm 53229-RGMWRG-5 – Nữ', 0, 'ACTIVE', '2024-07-15 10:40:46.167785', NULL, 33, 4);
